INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(1, 105, 'Huawei Mate S Review', 'This is awesome product.', '<span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">Officially unveiled at IFA Berlin, the Huawei Mate S is one of the most awaited devices of the season and is build on the foundations that made its predecessor, Mate 7, a super-cool phone. So, let us have an in-depth review of the Mate S and checks what it has got under the hood.</span><br><br><br><center><img src="http://mobda.com/wp-content/uploads/2015/10/Huawei-Mate-S.jpg" alt="Huawei Mate S" width="600" height="400"></center><br><br><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Design of Huawei Mate S</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Huawei Mate S is the premium device from the company, and hence, possesses a full metal body design as other high-end devices have. However, it has an updated build along with curved rear and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2.5D Corning Gorilla Glass 4.<span class="Apple-converted-space">&nbsp;</span></strong>According to Huawei, the curves provided in the phone have allowed to reduce the thickness of the edges, keeping the complete profile of just<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">7.2mm,<span class="Apple-converted-space">&nbsp;</span></strong>making an elegant handset, which is easy to hold.</p><br><br><br><center><img src="http://mobda.com/wp-content/uploads/2015/10/Huawei-Mate-S-Design.jpg" alt="Huawei Mate S Design" width="600" height="400"></center><br><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">All the buttons of the Huawei Mate S are extremely responsive and easy to press, providing a sufficient amount of tactile feedback. If you will look around the phone, you will find a volume rocker and power button on the right side, headphone jack and microphone on the top and a microUSB port, a single speaker at the bottom. Just above the display, the phone is fitted with an<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">8MP</strong><span class="Apple-converted-space">&nbsp;</span>front facing camera with flash and on the back; there is a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">13MP</strong><span class="Apple-converted-space">&nbsp;</span>camera sensor with a dual-tone LED flash and fingerprint reader.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display of Huawei Mate S</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Huawei Mate S is featured with a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.5-inches AMOLED Full HD<span class="Apple-converted-space">&nbsp;</span></strong>display, giving a screen color saturation of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">105 percent</strong><span class="Apple-converted-space">&nbsp;</span>of the RGB gamut and contrast ration of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1.8M:1.<span class="Apple-converted-space">&nbsp;</span></strong>The new Huawei devices, including Huawei Mate S, are now having an option to adjust the color temperatures of the display. So, if you want to do so, just go to the settings menu and choose the display option.</p><br><br><center><img src="http://mobda.com/wp-content/uploads/2015/10/Huawei-Mate-S-Display.jpg" alt="Huawei Mate S Display" width="600" height="400"></center><br><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">However, the device does not have a Quad HD display, but the Full HD resolution is no less than the Quad HD. You will not have any complaint against the display of Huawei Mate S, especially related to the viewing experience.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery of Mate S</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Almost all the smartphones are fitted with a non-removable battery and Mate S is no exception in this. The Mate S is backed up with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2700mAh</strong><span class="Apple-converted-space">&nbsp;</span>battery, which allows superb battery life and can give five to six hours of screen-on time during a busy day. Your busy day may include watching videos, a lot of internet browsing, responding to your loved ones, and taking a lot of selfies.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Moreover, if you are game lover, you can easily play the 3D intensive games continuously for around 4-5 hours, starting with a full battery. So the bottom line is that you can easily use the phone for a whole day not even worrying about the charger.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Performance of Huawei Mate S</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Huawei Mate S is fitted with an<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Octa-core HiSilicon Kirin 935<span class="Apple-converted-space">&nbsp;</span></strong>processor, four<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Cortex-A53<span class="Apple-converted-space">&nbsp;</span></strong>processors, clocking at<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2.25GHz</strong><span class="Apple-converted-space">&nbsp;</span>and four clocking at<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1.5GHz</strong>. A<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Mali-T628 GPU</strong><span class="Apple-converted-space">&nbsp;</span>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3GB</strong><span class="Apple-converted-space">&nbsp;</span>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">RAM<span class="Apple-converted-space">&nbsp;</span></strong>back all these great specs<strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">.<span class="Apple-converted-space">&nbsp;</span></strong>The performance of Huawei Mate S is super smooth and you will hardly find any lag or stutter while using the device. So, you have smooth UI, smooth opening, closing and switching among the applications, which is fast and snappy also. Moreover, the gaming in Huawei Mate S is superbly smooth, however, a little lag you can find when you are playing some graphically intensive games.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Hardware of Huawei Mate S</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Talking about the hardware of Huawei Mate S, it comes with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">32GB<span class="Apple-converted-space">&nbsp;</span></strong>or<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">64GB<span class="Apple-converted-space">&nbsp;</span></strong>internal storage. You have an option to expand the memory and can make it to<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">128GB</strong><span class="Apple-converted-space">&nbsp;</span>with the help of a microSD card. In the selected markets, you can also find the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">128GB<span class="Apple-converted-space">&nbsp;</span></strong>version of the Mate S, which will include the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Force Touch</strong><span class="Apple-converted-space">&nbsp;</span>or the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Pressure-Sensitive screen.</strong></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">In the entry level storage of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">32GB,</strong>you will get around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">24GB<span class="Apple-converted-space">&nbsp;</span></strong>&nbsp;of storage for use. It clearly means that around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">8GB<span class="Apple-converted-space">&nbsp;</span></strong>is saved to be used as flash memory.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You get the standard connectivity options in the Huawei Mate S phone, which include<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">NFC<span class="Apple-converted-space">&nbsp;</span></strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">4G LTE</strong>. As mentioned above, the Huawei Mate S is loaded with a fingerprint scanner, which is placed in an easy reach of your index finger.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Software of Huawei Mate S</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Running on<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android 5.1.1 Lollipop,<span class="Apple-converted-space">&nbsp;</span></strong>the Huawei Mate S is also coupled with the newest version of Huawei’s<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Emotion UI</strong><span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">(EMUI v3.1)</strong>. With this, you can get rid of the app drawers, which will leave your things organized.</p><br><br><center><img src="http://mobda.com/wp-content/uploads/2015/10/Software-of-Huawei-Mate-S.jpg" alt="Software of Huawei Mate S" width="600" height="400"></center><br><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Taking about the notification panel, it is divided into two sections – Shortcuts &amp; Notifications. You also get a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">theme engine</strong><span class="Apple-converted-space">&nbsp;</span>to change the look and feel of the entire UI. There are a lot of options available and you can choose the theme according to your likings.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera of Huawei Mate S</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Huawei Mate S is loaded with a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">13MP<span class="Apple-converted-space">&nbsp;</span></strong>rear camera, which include a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">4-color RGBW<span class="Apple-converted-space">&nbsp;</span></strong>imaging sensor and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Optical Image Stabilization.</strong></p><br><center><img src="http://mobda.com/wp-content/uploads/2015/10/Camera-of-Huawei-Mate-S.jpg" alt="Camera of Huawei Mate S" width="600" height="400"></center><br><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The camera app has got some awesome features, which will increase your shot quality. Some of the awesome modes it has are panorama, HDR, super night mode, time-lapse, slow motion, and light painting mode, in case you want to take long exposure shots. Apart from these awesome modes, there are also a few built-in filters that include car light trails, if you want to capture moving car lights clearly; light graffiti, if you want to capture light trails when environment is dark; silky water, to get the silky smooth effects of running water; and star track, if you want to capture the star and galaxies trails during the night.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Final Words</strong></h3><br><center><img src="http://mobda.com/wp-content/uploads/2015/10/Huawei-Mate-S-Conclusion.jpg" alt="Camera of Huawei Mate S" width="600" height="400"><br><br></center><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">So we had an in-depth look of the Huawei Mate S, which brings us to the conclusion that the Huawei Mate S is an awesome phone. It has elegant display, superb battery life, and great camera. The performance of the Huawei Mate S is snappy and smooth in the majority of the parts. So, if you want an awesome phone with awesome features, Huawei Mate S is the one you must go for.</span>', '/image/uploads_productReview_productReviewImage-641873-1484677372.jpg', 1, '2017-01-17 12:52:53', '2017-01-17 12:53:44');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(2, 3, 'HTC One A9 Review', 'This HTC One A9 have great review', '<span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">HTC is famous for launching one flagship product each year. However, 2015 is different, as this year this Taiwanese mobile phone giant has launched its One M9 in march and now it is back again with its another flagship product HTC One A9. It is the latest flagship of the HTC as of now, and is causing a lot of stir. Despite of not having the best internal specifications inside the phone, the company is expecting a good sale of the same because of its affordable price and the great user experience.</span><p style="text-align: justify;"><a href="http://mobda.com/wp-content/uploads/2015/10/htc-one-a9.jpg"></a></p><center><a href="http://mobda.com/wp-content/uploads/2015/10/htc-one-a9.jpg"><img class="aligncenter size-full wp-image-3041" src="http://mobda.com/wp-content/uploads/2015/10/htc-one-a9.jpg" alt="htc one a9" width="600" height="400"></a><p></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Design of HTC One A9</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Like all other devices in HTC One’s family, HTC One A9 comes with an all-metal body but being a little small in size as compared to other devices. With the rounded sides and corners, the HTC One A9 is fitted with a panel of 2.5D glass on the front screen making it extremely comfortable to hold.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The superb<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5”<span class="Apple-converted-space">&nbsp;</span></strong>display is also a big help in the handling of the device, making it superb for one-handed uses. All the control keys like power/standby and volume keys are situated at the right side of the device. On the other hand, the SIM and microSD card slots are situated on the left side. Apart from it, all the other ports, which include Micro USB and 3.5 mm jack for headphones are at the bottom of the device.</p><p style="text-align: justify;"><a href="http://mobda.com/wp-content/uploads/2015/10/Design-of-HTC-One-A9.jpg"></a></p><center><a href="http://mobda.com/wp-content/uploads/2015/10/Design-of-HTC-One-A9.jpg"><img class="aligncenter size-full wp-image-3042" src="http://mobda.com/wp-content/uploads/2015/10/Design-of-HTC-One-A9.jpg" alt="Design of HTC One A9" width="600" height="400"></a><p></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The people have always loved the front- facing speakers in all the HTC devices. However, in the HTC One A9, company has taken an odd move by not giving these front-facing BoomSound speakers. Instead of these speakers, there is a recessed fingerprint reader beneath the display that can also be used as the home button, if you want to. Moreover, the front of the device also holds an UltraPixel camera just above the display. You may find a bare back of the device, with just the HTC logo in the middle and new camera package of HTC in the dead center at the top.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display of HTC One A9</strong></h3><p><a href="http://mobda.com/wp-content/uploads/2015/10/Display-of-HTC-One-A9.jpg"></a></p><center><a href="http://mobda.com/wp-content/uploads/2015/10/Display-of-HTC-One-A9.jpg"><img class="aligncenter size-full wp-image-3043" src="http://mobda.com/wp-content/uploads/2015/10/Display-of-HTC-One-A9.jpg" alt="Display of HTC One A9" width="600" height="400"></a><p></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Talking about the display of HTC One A9, we have a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5”<span class="Apple-converted-space">&nbsp;</span></strong>display, which is extremely comfortable for the people who love one-handed usability in the smartphone. The phone has the AMOLED panel that gives the resolution of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1920 x 1080.<span class="Apple-converted-space">&nbsp;</span></strong>It is one of the best displays available in the market with awesome black levels and contrasts. Moreover, the viewing angles are also decent ones.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Performance of HTC One A9</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The HTC One A9 is giving you an above average performance in its segment, and is fitted with a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Qualcomm Snapdragon 617</strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3GB<span class="Apple-converted-space">&nbsp;</span></strong>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">RAM</strong><span class="Apple-converted-space">&nbsp;</span>with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">32GB<span class="Apple-converted-space">&nbsp;</span></strong>of internal storage. The RAM helps a lot in speeding up the process of opening and closing of the apps despite of having a 617 under its hood. However, you may find sometimes that the apps take some time to load and especially when using GPS the phone may lag a lot.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Software of HTC One A9</strong></h3><p><a href="http://mobda.com/wp-content/uploads/2015/10/Software-of-HTC-One-A9.jpg"><img class="aligncenter size-full wp-image-3044" src="http://mobda.com/wp-content/uploads/2015/10/Software-of-HTC-One-A9.jpg" alt="Software of HTC One A9" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You may not know but the HTC One A9 is the first device that is non-Nexus to feature<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android 6.0 Marshmallow.<span class="Apple-converted-space">&nbsp;</span></strong>You get all the features of Marshmallows are included in the device, for example, Google Now on Tap, Doze, and redesigned permissions system. You can get the app permissions in the Settings menu. The Blinkfeed is replacing the Google Now from the Google’s own launcher.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera of HTC One A9</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Talking about the camera of HTC One A9, it is one of the most effective camera combinations in the market. You get an UltraPixel shooter<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">4MP</strong><span class="Apple-converted-space">&nbsp;</span>front-facing camera and a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">13MP<span class="Apple-converted-space">&nbsp;</span></strong>rear camera with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">f/2.0<span class="Apple-converted-space">&nbsp;</span></strong>aperture. The camera is one of the best that you can expect from HTC – details are awesomely captured and colors also are perfectly saturated. As it has the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Optical Image Stabilization (OIS)</strong>, the snaps in the low-light are wonderful, which also helps in capturing the videos.</p><p><img class="aligncenter size-full wp-image-3045" src="http://mobda.com/wp-content/uploads/2015/10/camera-of-HTC-A9.jpg" alt="camera of HTC A9" width="600" height="400"></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The stock camera app is superb with the same<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Zoe-powered</strong><span class="Apple-converted-space">&nbsp;</span>gallery that you might have seen in all the past HTC devices. You get a lot of different modes in the camera along with a new<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Hyperlapse</strong><span class="Apple-converted-space">&nbsp;</span>mode. The Pro mode lets you control the manual focus and allows you to capture RAW images on which you can try your creative mind. With the HDR mode, you get a good punch and evened shadows and highlights to your photos. However, the processing time can be a little longer than the expected.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Final Words</strong></h3><a href="http://mobda.com/wp-content/uploads/2015/10/HTC-one-A9-conclusion.jpg"><img class="aligncenter size-full wp-image-3046" src="http://mobda.com/wp-content/uploads/2015/10/HTC-one-A9-conclusion.jpg" alt="HTC one A9 conclusion" width="600" height="400"></a><p style="text-align: justify;"><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">As a low budget device, it can really be loved by the majority of the people who prefer midrangers. Yes we accept that it is a look alike of iPhone6S, but apart from it is in line with what a lot of users were expecting from the HTC. With a solid and easy-to-hold build, cool camera, superb and fast finger print reader, HTC One A9 is an unmatchable combination of smartphone features.</span></p><!-- WhatsApp Share Button for WordPress: http://peadig.com/wordpress-plugins/whatsapp-share-button/ --><p></p></center>                                                     </center></center>', '/image/uploads_productReview_productReviewImage-426678-1484677983.jpg', 1, '2017-01-17 13:03:03', '2017-01-17 13:03:46');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(3, 268, 'LG Nexus 5X Review', 'This LG Nexus 5X have great review ', '<div class="new_description "><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">After the two years of Nexus 5 launch, which was one of the best selling smartphones of the time, LG is back again with the brand new sibling of Nexus 5, the Nexus 5X. Because of the superb manufacturing quality, Nexus has got a great trust on LG for its phone development.</span><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Nexus-5X.jpg"><img class="aligncenter size-full wp-image-3061" src="http://mobda.com/wp-content/uploads/2015/10/Nexus-5X.jpg" alt="Nexus 5X" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">It is 21<sup style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">st</sup><span class="Apple-converted-space">&nbsp;</span>century and there is a serious competition in the smartphone market. Therefore, it is extremely finical now to make your mark and make people love your product. It means that the Nexus 5X may have to face some real competition now, unlike the Nexus 5. So, with the help of this review let us try to find out whether the Nexus 5X will be able to withstand the competition or not.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Design of Nexus 5X</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Looking for the first time at the Nexus 5X, you can have a déjà vu feeling, because of its almost identical build quality and design language. However, in today’s time, where the phones are manufactured with metal-clad and glass, the Nexus 5X is more of a midranger, rather being a flagship, especially when Nexus 6P is in the picture.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Manufactured entirely with the plastic, the Nexus 5X is extremely light weight, weighing around just<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">130 grams.<span class="Apple-converted-space">&nbsp;</span></strong>We will not say that it feels cheap in the hand, however, it also does not give a premium feel that a phone packed with metal or a glass gives.</p><div style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Design-of-Nexus-5X.jpg"><img class="aligncenter size-full wp-image-3062" src="http://mobda.com/wp-content/uploads/2015/10/Design-of-Nexus-5X.jpg" alt="Design of Nexus 5X" width="600" height="400"></a></div><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Nexus 5X is extremely elegant device fitted with beautiful rounded corners and a back that tapers a bit at the end. Though it has a plastic back, it comes in a matte finish, avoiding fingerprints at all and giving a good grip so that the phone does not slip from your hands. Moreover, its compact size, of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.2-inches,<span class="Apple-converted-space">&nbsp;</span></strong>is a big help that gives a comfortable one-handed operation.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display of Nexus 5X</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Talking about the display, the Nexus 5X has a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.2-inches IPS LCD</strong><span class="Apple-converted-space">&nbsp;</span>display with a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Full HD<span class="Apple-converted-space">&nbsp;</span></strong>resolution that results in a pixel density of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">424ppi.<span class="Apple-converted-space">&nbsp;</span></strong>Despite of not being a Quad HD variety screen, you will not find any miss in the resolution, still offering superb sharpness.</p><div style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Display-of-Nexus-5X.jpg"><img class="aligncenter size-full wp-image-3063" src="http://mobda.com/wp-content/uploads/2015/10/Display-of-Nexus-5X.jpg" alt="Display of Nexus 5X" width="600" height="400"></a></div><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Talking about the viewing angels, they are fantastic and you will not find overly saturated colors anywhere. However, in direct sunlight, even with the maximum brightness, it is a little difficult to read the screen and hence, we can say that it has an average sunlight legibility.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Performance of Nexus 5X</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Nexus 5X is a powerful device. It has got a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">hexa-core Qualcomm Snapdragon 808<span class="Apple-converted-space">&nbsp;</span></strong>processor, clocking at<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1.82 GHz.<span class="Apple-converted-space">&nbsp;</span></strong>These are backed up with the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Adreno 418 GPU<span class="Apple-converted-space">&nbsp;</span></strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2GB<span class="Apple-converted-space">&nbsp;</span></strong>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">RAM.<span class="Apple-converted-space">&nbsp;</span></strong>Talking spec-wise, the RAM may appear low in the first place, but performance-wise there are no issues at all with the device. The phone handles everything, from general tasks to multi-tasking to gaming, perfectly and do not produce any lag in the performance. It runs completely smooth and snappy throughout.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Hardware of Nexus 5X</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">One of the most notable additions in the hardware of Nexus 5X is the fingerprint scanner, present at the back of the phone. It is a helpful addition, because the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android 6.0 Marshmallow</strong><span class="Apple-converted-space">&nbsp;</span>provides the built-in support for fingerprint readers. It is easy in extremely easy reach for you through your index finger. With the help of this fingerprint scanner, you can easily unlock or wake up the device in just one go. Moreover, to register a fingerprint on the fingerprint scanner, the process is pretty simple. You just have to tap<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">five</strong><span class="Apple-converted-space">&nbsp;</span>times on it, and it’s done. However, waking up and unlocking process is not that fast, but it is quick enough that you will not notice the lockscreen.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Hardware-of-Nexus-5X.jpg"><img class="aligncenter size-full wp-image-3064" src="http://mobda.com/wp-content/uploads/2015/10/Hardware-of-Nexus-5X.jpg" alt="Hardware of Nexus 5X" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Nexus 5X is available with the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">16GB<span class="Apple-converted-space">&nbsp;</span></strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">32GB<span class="Apple-converted-space">&nbsp;</span></strong>storage and you do not get an option to expand the storage through the microSD card. So, it is advisable that you opt for the larger storage phone.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">&nbsp;<strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Software of Nexus 5X</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Software-of-Nexus-5X.jpg"><img class="aligncenter size-full wp-image-3065" src="http://mobda.com/wp-content/uploads/2015/10/Software-of-Nexus-5X.jpg" alt="Software of Nexus 5X" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">As usual, the Nexus leads the race when it comes to software. Here in Nexus 5X also, the device is loaded with the latest version of Android,<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android 6.0 Marshmallow</strong>, which also guarantees the timely updates of the same. So, if you are looking for the purest Android experience, Nexus is one brand you must buy. With the induction of Marshmallow, the OS experience has become smoother and a lot of neat improvements. Some of which include the battery saving feature called Doze, and many more.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery of Nexus 5X</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Talking about the battery, the Nexus 5X is loaded with a powerful<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2,700mAh</strong>, which can last almost for a day, provided you are having the average use of device. Moreover, if you are a hardcore gamer and love to have many games onboard, make sure you have the charger handy, as gaming may kill the battery quickly. However,<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Doze</strong><span class="Apple-converted-space">&nbsp;</span>– the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">battery saving feature</strong><span class="Apple-converted-space">&nbsp;</span>from the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android 6.0 Marshmallow</strong><span class="Apple-converted-space">&nbsp;</span>– is a big help and works efficiently. It works by putting the phone in very deep state of sleep and limits the apps activity in the background.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Unlike the last few models of Nexus, Nexus 5X does not have the wireless charging support. However, you get a fast charging in this device through the walled charger, which can charge the device from 0 to 100 percent in just<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">90 minutes.</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera of Nexus 5X</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">We know that camera has always been the disappointing aspects of the majority of Nexus devices. However, with the incoming of Nexus 5x and Nexus 6P in the market, Google is hoping to improve in this area.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Camera-of-Nexus-5X.jpg"><img class="aligncenter size-full wp-image-3066" src="http://mobda.com/wp-content/uploads/2015/10/Camera-of-Nexus-5X.jpg" alt="Camera of Nexus 5X" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Talking about the Nexus 5X, it has a brand new<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">12.3MP</strong><span class="Apple-converted-space">&nbsp;</span>sensor with a pixel size of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1.55microns</strong>;<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">f/2.0<span class="Apple-converted-space">&nbsp;</span></strong>aperture lens and a laser auto focus system. Though you do not have the optical image stabilization in the device, and if you are just a lukewarm about photography, it is not a huge loss for you.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Launching the camera is a very easy process. Just double press the home button and camera pops up in front of you in less than a second. The camera UI is minimalistic but is better than its predecessors are. To switch between the video and camera mode, just swipe left and right respectively. Moreover, you can find the HDR toggle situated comfortably on the viewfinder.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">&nbsp;<strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Final Words</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Nexus-5x-Conclusion.jpg"><img class="aligncenter size-full wp-image-3067" src="http://mobda.com/wp-content/uploads/2015/10/Nexus-5x-Conclusion.jpg" alt="Nexus 5X Conclusion" width="600" height="400"></a></p><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">Over all Nexus 5X is a superb device and it is available in the<span class="Apple-converted-space">&nbsp;</span></span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: 600; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">black, mint-blue<span class="Apple-converted-space">&nbsp;</span></strong><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">and<span class="Apple-converted-space">&nbsp;</span></span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: 600; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">white<span class="Apple-converted-space">&nbsp;</span></strong><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">colors, or as Google calls them as<span class="Apple-converted-space">&nbsp;</span></span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: 600; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Carbon, Ice<span class="Apple-converted-space">&nbsp;</span></strong><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">and<span class="Apple-converted-space">&nbsp;</span></span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: 600; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Quartz<span class="Apple-converted-space">&nbsp;</span></strong><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">colors. After checking all the aspects of the Nexus 5X, we will say that the device fits in your pocket perfectly with awesome features. However, there are numerous other devices available on the same price, but the Nexus 5X is a good device, which has a lot to offer.</span>                                      	</div>', '/image/uploads_productReview_productReviewImage-862643-1484678348.jpg', 1, '2017-01-17 13:09:09', '2017-01-17 13:31:19');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(4, 15, ' Sony Xperia Z5 Review', 'This  Sony Xperia Z5 have great review', '<div class="new_description "><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">The new Xperia Z5 family from Sony has definitely attracted the people to buy the device. Launching the three flagship product in Z5 family, Xperia Z5 Premium, Xperia Z5, and Xperia Z5 Compact, Xperia Z5 being the middle one, Sony has tried to give some best devices to its consumers. However, we will not say that it is the “latest and greatest” device from the Sony and it looks identical to the Z3+ in various aspects, being a little more expensive.</span><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Xperia-Z5.jpg"><img class="aligncenter size-full wp-image-3049" src="http://mobda.com/wp-content/uploads/2015/10/Xperia-Z5.jpg" alt="Xperia Z5" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">However, reading it on the paper will not do the work, we will have to dig deeper and find out what exactly is the Sony Xperia Z5</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Unboxing Sony Xperia Z5</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Xperia-Z5-unboxing.jpg"><img class="aligncenter size-full wp-image-3050" src="http://mobda.com/wp-content/uploads/2015/10/Xperia-Z5-unboxing.jpg" alt="Xperia Z5 unboxing" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Sony Xperia Z5 has a very minimalistic packaging. Housed inside a white, two-piece cardboard boxy, Sony Xperia Z5 is accompanied with a wall charger (1.5 A), a pair of in-ear headphones, USB cable, everything with superb quality. You also get two extra padding sizes and a clip with the headphones. Many of you may have not noticed, but the bundled accessories of the Sony Xperia Z5 vary from market to market.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Design &amp; Build Quality of Sony Xperia Z5</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Sony Xperia Z5 depicts a clean and slick exterior and is designed completely by following the Sony’s new language of minimalistic design. When you will look at the Sony Xperia Z5 family, you will definitely notice a big change in design. It is one of the biggest change after the Z1 and hence, sharing this new exterior.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Design-of-Xperia-Z5.jpg"><img class="aligncenter size-full wp-image-3051" src="http://mobda.com/wp-content/uploads/2015/10/Design-of-Xperia-Z5.jpg" alt="Design of Xperia Z5" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Seeing the design of the Xperia Z5, it seems that Sony wanted to go one step beyond with the symmetry as compared to its previous devices. Not only this, the current design language has taken the uniformity concept to a new level. It is not only superbly symmetrical, but also uniform and identical from every corner and angle. There are no more grills that are obvious; no more accents on curves and groves, and everything is removed to make minimalistic exterior. Looking at the phone, it seems that it has machined out of one uniform block.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Looking at the dimensions, the Sony Xperia Z5 measures<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">146 x 72 x 7.3 mm</strong><span class="Apple-converted-space">&nbsp;</span>and weighs around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">154 grams</strong>. Sony has really tried to get most out of the available material, and hence, provide the back of Sony Xperia Z5 with the frosted glass or matte glass.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Sony Xperia Z5 will be available in<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">four colors</strong>: two classic –<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">white &amp; black</strong><span class="Apple-converted-space">&nbsp;</span>– and two vibrant colors –<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">yellow &amp; green</strong>.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display of Sony Xperia Z5</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">This device of Sony has gone for the more traditional panel. The Sony Xperia Z5 has<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1920 x 1080<span class="Apple-converted-space">&nbsp;</span></strong>pixels resolution that is perfectly adequate on its<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.2 inches<span class="Apple-converted-space">&nbsp;</span></strong>screen, giving<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">428ppi.<span class="Apple-converted-space">&nbsp;</span></strong>You will not feel any shortage of pixel in the complete display of Sony Xperia Z5. The other specs like<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Mobile BRAVIA Engine 2, Triluminos<span class="Apple-converted-space">&nbsp;</span></strong>technology and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">X-Reality</strong><span class="Apple-converted-space">&nbsp;</span>engine for mobile, amount to nice and sharp imagery one the Xperia Z5. Moreover, the 1080p resolution leads to less stain on the GPU.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Display-of-Sony-Xperia-Z5.jpg"><img class="aligncenter size-full wp-image-3052" src="http://mobda.com/wp-content/uploads/2015/10/Display-of-Sony-Xperia-Z5.jpg" alt="Display of Sony Xperia Z5" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Talking about the sunlight legibility, the Z5 will not disappoint you. You can easily see the screen even in the bright sunlight. The color accuracy of the device has gone to the next level and it burgeons the moment you start the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">X Reality</strong><span class="Apple-converted-space">&nbsp;</span>mode for the screen image enhancements. Maximum brightness in the Sony Xperia Z5 gives you around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">550nits.</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery of Sony Xperia Z5</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">This great device from Sony is packed with a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2900mAh<span class="Apple-converted-space">&nbsp;</span></strong>battery and is non-removable, as expected. With endurance rating of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">73 hours</strong>, it is one of the best-performed devices in the market. A 73 hours endurance rating means, you can easily use the device for<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">two</strong><span class="Apple-converted-space">&nbsp;</span>days with just one-hour use of 3G calls, web browsing and video play back respectively. So, once fully charged, you have<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">17 hours<span class="Apple-converted-space">&nbsp;</span></strong>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3G talk time, 14 hours<span class="Apple-converted-space">&nbsp;</span></strong>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">web browsing,<span class="Apple-converted-space">&nbsp;</span></strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">8 hours<span class="Apple-converted-space">&nbsp;</span></strong>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">video playback.</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">User Interface of Sony Xperia Z5</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Sony Xperia Z5 is loaded with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android 5.1.1 Lollipop.<span class="Apple-converted-space">&nbsp;</span></strong>On a positive note, Sony is perfectly comfortable with the new platforms and hence, spreading its presence in almost all of its devices. You can call the UI of Sony Xperia Z5 as<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">‘Android Lollipop with a pinch of Xperia.’</strong><span class="Apple-converted-space">&nbsp;</span>In terms of UI, it is identical to its predecessors, but obviously with a few notable changes.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/UI-of-Sony-Xperia-Z5.jpg"><img class="aligncenter size-full wp-image-3053" src="http://mobda.com/wp-content/uploads/2015/10/UI-of-Sony-Xperia-Z5.jpg" alt="UI of Sony Xperia Z5" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Talking about the launcher, Sony has travelled a long way to preserve its signature look and feel. No matter even if you are getting Lollipop from KitKat, everything is just right there where you left, only getting a fresher look of material-design.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">As far as UX and navigation, the majority of the apps are also untouched, only getting the eye-candy visuals of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android Lollipop.<span class="Apple-converted-space">&nbsp;</span></strong>However, the lock screen has got a few changes with the incoming of Android 5.0.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Performance of Sony Xperia Z5</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Talking about the performance of Sony Xperia Z5, it is a true flagship from Sony. Running on<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Qualcomm MSM8994 Snapdragon 810 SoC</strong><span class="Apple-converted-space">&nbsp;</span>, it is the top offer from chip manufacturer. Apart from this, Sony has the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">eight-core chip</strong>, which include –<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Quad-core 1.5 GHz Cortex-A53<span class="Apple-converted-space">&nbsp;</span></strong>&amp;<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Quad-core 2 GHz Cortex-A57.<span class="Apple-converted-space">&nbsp;</span></strong>These are backed up by an<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Adreno 430 GPU, 3GB<span class="Apple-converted-space">&nbsp;</span></strong>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">RAM<span class="Apple-converted-space">&nbsp;</span></strong>and an expandable storage of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">32GB.</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera of Sony Xperia Z5</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Without a good camera, no single flagship product can survive in the market in the present times. Talking about the Sony Xperia Z5, it is no exception. Sony has fitted the complete Z5 family with its new<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">23MP<span class="Apple-converted-space">&nbsp;</span></strong>camera. Therefore, you can expect a pretty compatible photo quality from the Sony Xperia Z5.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Sony-Xperia-Z5-Camera.jpg"><img class="aligncenter size-full wp-image-3054" src="http://mobda.com/wp-content/uploads/2015/10/Sony-Xperia-Z5-Camera.jpg" alt="Sony Xperia Z5 Camera" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">No matter how much Sony markets it just as a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">23MP<span class="Apple-converted-space">&nbsp;</span></strong>camera, fitted with an<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">f/2.0 24mm-equivalent wide angle lens,</strong><span class="Apple-converted-space">&nbsp;</span>here is definitely a lot more that is going behind the scenes. It has Sony’s<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">multi-aspect</strong><span class="Apple-converted-space">&nbsp;</span>sensor,<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Sony IMX300</strong>, which is said to have a bit more pixels than said – around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">25MP</strong><span class="Apple-converted-space">&nbsp;</span>to be precise.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Because of a dedicated<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">two-stage</strong><span class="Apple-converted-space">&nbsp;</span>shutter button, the focus process has become a whole lot easier in the camera of Sony Xperia Z5. However, with such a nice camera, you are not getting a dual-tone flash, but just a single LED flash.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Final Words</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Sony-Xperia-Z5-Conclusion.jpg"><img class="aligncenter size-full wp-image-3055" src="http://mobda.com/wp-content/uploads/2015/10/Sony-Xperia-Z5-Conclusion.jpg" alt="Sony Xperia Z5 Conclusion" width="600" height="400"></a></p><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">There is no doubt and you know well that the mobile division of Sony is going through the hard times. So, to cover up these bad times, Sony has experimented a lot and has launched three flagships simultaneously in the Z5 family. Talking about the Sony Xperia Z5, it is a superbly designed process, with impressive specs and can easily compete in the market with the bigger leagues.</span>                                      	</div>', '/image/uploads_productReview_productReviewImage-373092-1484678595.jpg', 1, '2017-01-17 13:13:15', '2017-01-17 13:31:19');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(5, 936, 'Motorola Moto X Play Review', 'This Motorola Moto X Play have great review', '<div class="new_description "><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">Motorola has launched Moto X Play under phablet category to balance between the Moto X Style and Moto G with a screen size of 5.5”.&nbsp; With numerous mind-blowing features packed in it, Motorola Moto X Play is one superb device. So, let us have a deeper insight about the device.</span><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Moto-X-Play.jpg"><img class="aligncenter size-full wp-image-3040" src="http://mobda.com/wp-content/uploads/2015/10/Moto-X-Play.jpg" alt="Moto X Play" width="600" height="400"></a></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Unboxing Motorola Moto X Play</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Unboxing-Moto-X-Play.jpg"><img class="aligncenter size-full wp-image-3034" src="http://mobda.com/wp-content/uploads/2015/10/Unboxing-Moto-X-Play.jpg" alt="Unboxing Moto X Play" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The retail package of Motorola Moto X Play is made up of thin cardboard and is a victim of budget cuts. Inside the retail box you can find the device itself, a USB-to-microUSB cable, and an AC adapter. Yes, you guessed it right; there are no headsets inside the retail package.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Design &amp; Build Quality of Motorola Moto X Play</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">As the device is for budget-conscious crowd, hence, it is manufactured with a polycarbonate body. We will not say it is a bad thing, in fact, many people would favor it over the device constructed with fragile glass or a heavy metal.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The phone’s plastic body has a shiny frame that goes till its sides, a little light grey on the black model and silver on the white ones.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Design-of-Moto-X-Play.jpg"><img class="aligncenter size-full wp-image-3035" src="http://mobda.com/wp-content/uploads/2015/10/Design-of-Moto-X-Play.jpg" alt="Design of Moto X Play" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The dimension of Motorola Moto X Play measures<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">148 x 75 x 10.9 mm</strong>, making it a reasonable and compact device. However, with the thickness<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">10.9mm<span class="Apple-converted-space">&nbsp;</span></strong>the Motorola Moto X Play is the thickest smartphone available in the market and weighing around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">169 grams.<span class="Apple-converted-space">&nbsp;</span></strong>The back cover of Motorola Moto X Play is made up of soft rubbery plastic with the gentle waves all over it.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display of Motorola Moto X Play</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Motorola Moto X Play offers a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.5” IPS<span class="Apple-converted-space">&nbsp;</span></strong>display with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1080p<span class="Apple-converted-space">&nbsp;</span></strong>resolution that gives a pixel density of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">403ppi.<span class="Apple-converted-space">&nbsp;</span></strong>You get an LCD panel this year on Motorola Moto X Play, instead of the AMOLED screen.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we will have a closer look, the Motorola Moto X Play has got an impressive screen. With the maximum brightness of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">620nits</strong>, it is one of the best in the market. Moreover, if you enable the automatic brightness control, it can move even further to<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">760nits</strong><span class="Apple-converted-space">&nbsp;</span>in direct sunlight. The contrast ratio of Motorola Moto X Play is also superb with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1504:1.</strong></p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Display-of-Moto-X-Play.jpg"><img class="aligncenter size-full wp-image-3036" src="http://mobda.com/wp-content/uploads/2015/10/Display-of-Moto-X-Play.jpg" alt="Display of Moto X Play" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Not only the maximum brightness, but the minimum brightness is also mind-blowing. No matter how dark the room is, you can still see the screen with brightness set to its minimum level.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery of Motorola Moto X Play</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">In terms of battery, the Motorola Moto X Play is very generous. The phone is packed with a battery of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3,630mAh</strong>. Despite of the removable back cover, you cannot take out or replace the battery.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With the endurance rating of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">85 hours,<span class="Apple-converted-space">&nbsp;</span></strong>the phone has got the good reputation. With the full charged battery, you can make around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">26.5 hours<span class="Apple-converted-space">&nbsp;</span></strong>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3G calls,</strong><span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">12 hours<span class="Apple-converted-space">&nbsp;</span></strong>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">web browsing</strong>, and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">12 hours<span class="Apple-converted-space">&nbsp;</span></strong>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">video playback.</strong></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">&nbsp;</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Performance of Motorola Moto X Play</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You will never see Motorola deviating much from Android stock and it is the case with Moto X Play. You will not find any pre-installed app, apart from the Google Package apps.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Talking about the home screen, you get two options – either you can choose<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">default Moto Display<span class="Apple-converted-space">&nbsp;</span></strong>lockscreen or the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Ambient Display mode of Android.<span class="Apple-converted-space">&nbsp;</span></strong>As you do not get any LED notification light, so you would want to enable one in your phone.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Moto-X-Play-Performance.jpg"><img class="aligncenter size-full wp-image-3037" src="http://mobda.com/wp-content/uploads/2015/10/Moto-X-Play-Performance.jpg" alt="Moto X Play Performance" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Motorola Moto X Play is equipped with a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Snapdragon 615<span class="Apple-converted-space">&nbsp;</span></strong>chipset and features a dual<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">quad-core CPU</strong><span class="Apple-converted-space">&nbsp;</span>with one huddle of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Cortex-A53</strong><span class="Apple-converted-space">&nbsp;</span>core clocked at<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1.65GHz</strong><span class="Apple-converted-space">&nbsp;</span>and the other at<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1.11GHz.<span class="Apple-converted-space">&nbsp;</span></strong>Talking about the graphics,<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Adreno 405</strong><span class="Apple-converted-space">&nbsp;</span>is in charge with a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2GB RAM<span class="Apple-converted-space">&nbsp;</span></strong>on board.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera of Motorola Moto X Play</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Motorola Moto X Play is fitted with an excellent<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">21MP<span class="Apple-converted-space">&nbsp;</span></strong>shooter. This superb<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">21MP Sony sensor</strong><span class="Apple-converted-space">&nbsp;</span>is resting behind an<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">f/2.0</strong><span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">lens</strong><span class="Apple-converted-space">&nbsp;</span>with a phase detection autofocus. Not only this, you also get a dual-tone flash that will adjust the color of the flashlight, producing more natural results.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">To launch the camera, just twist your wrist and the camera pops up in front of you in less than a second. This process will work every time, no matter whether your phone is locked; you are inside some app or even on your home screen. Basically, you can call it a universal camera shortcut. Another surprise for you, just twist your wrist second time and you camera will switch between front and rear camera.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Camera-of-Moto-X-Plau.jpg"><img class="aligncenter size-full wp-image-3038" src="http://mobda.com/wp-content/uploads/2015/10/Camera-of-Moto-X-Plau.jpg" alt="Camera of Moto X Play" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The camera’s user interface is clean with nothing but a rear/front camera toggle option and video capture button. You do not get any shutter option, hence, to take a snap, just tap anywhere on the screen. If you will long press the device on other hand, it will activate the burst mode, taking around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">115 full-res shots</strong><span class="Apple-converted-space">&nbsp;</span>in just<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">30 seconds</strong><span class="Apple-converted-space">&nbsp;</span>with an impressive frame rate of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">4fps.</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Final Words</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Moto-X-Play-Conclusion.jpg"><img class="aligncenter size-full wp-image-3039" src="http://mobda.com/wp-content/uploads/2015/10/Moto-X-Play-Conclusion.jpg" alt="Moto X Play Conclusion" width="600" height="400"></a></p><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">We are calling the Motorola Moto X Play a ‘Crowd Pleaser.’ It is as much compelling in reality as it is on paper. It is superb mid-ranger phone aspired with its flagship products and you cannot find even one area of disappointment in the device.</span>                                      	</div>', '/image/uploads_productReview_productReviewImage-331262-1484678846.jpg', 1, '2017-01-17 13:17:27', '2017-01-17 13:31:20');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(6, 13, 'Samsung Galaxy S6 Edge Plus Review', 'This Samsung Galaxy S6 Edge Plus have great review', '<div class="new_description "><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">So people, the bigger and flashier sibling of the Samsung Galaxy S6 Edge, Samsung Galaxy S6 Edge+, is here. The phone that astonished the world with dual-curve display, Samsung Galaxy S6 Edge has got its siblings, which is a little bigger in size. Samsung’s primary aim to launch Galaxy S6 Edge+ is to focus those people who want to own a premium phablet but without an S Pen, as you get in the Samsung Galaxy Note5.</span><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/S6-Edge-.jpg"><img class="aligncenter size-full wp-image-3011" src="http://mobda.com/wp-content/uploads/2015/10/S6-Edge-.jpg" alt="S6 Edge+" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we see spec-wise, Samsung Galaxy S6 Edge+ is similar to the Samsung Galaxy Note5, except no stylus. Therefore, to cover up the absence of stylus, you get the curved screen on both the sides, giving one of the best designs in the business segment</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Unboxing Galaxy S6 Edge+</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">There is no difference in the retail package of Samsung Galaxy S6 Edge+ and Galaxy Note5. Inside the retail package, you get the device, microUSB cable, wall charger, stereo headphones, and the usual set of booklets.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/S6-Edge-Unboxing.jpg"><img class="aligncenter size-full wp-image-3015" src="http://mobda.com/wp-content/uploads/2015/10/S6-Edge-Unboxing.jpg" alt="S6 Edge+ Unboxing" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Apart from the aforementioned mandatory accessories, Samsung is offering a wide range of optional accessories that you have to buy separately. Some of which include chargers, headphones, and back cases for the device.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Design &amp; Build Quality of Samsung Galaxy S6 Edge+</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we look at the design of Samsung Galaxy S6 Edge+, you may call it the stretched out version of the Galaxy S6 Edge smartphone. This phone manufacturer giant from Korea has completely nailed the smartphone market with the design of these two phones.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">There is no doubt in the build quality of the Samsung Galaxy S6 Edge+. It has a complete metal crafted body and Corning Gorilla Glass 4 and it can easily withstand regular wear and tear, unless you do not drop it from your hands.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we talk about the dimensions of Samsung Galaxy S6 Edge+, it has physical measures of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">154.4 x 75.8 x 6.9 mm<span class="Apple-converted-space">&nbsp;</span></strong>and weighs around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">153 grams.</strong></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The handling of the phone may make you worry a bit. Due to its large size, it is not as comfortable to hold the Samsung Galaxy S6 Edge+ as its smaller sibling. However, thanks to its curved design, which allows users to perform some tasks with one hand.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display of Samsung Galaxy S6 Edge+</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy S6 Edge+ has a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.7” Super AMOLED<span class="Apple-converted-space">&nbsp;</span></strong>display and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">QHD (2560 x 1440 pixels)</strong><span class="Apple-converted-space">&nbsp;</span>resolution. This delivers the pixel density of around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">518ppi<span class="Apple-converted-space">&nbsp;</span></strong>on the 5.7” screen of the Samsung Galaxy S6 Edge+.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The flagship smartphones of Samsung has always got one of the best displays in complete smartphone business, and with the latest iteration, Samsung has continued the legacy. If you will slide the brightness slider to the maximum, you can easily have the brightness level of an LCD. Moreover, in extremely bright lights, the auto-brightness level can slide it above the manual achievable capacity, up to<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">540nits</strong>, as compared to its normal<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">410nits.</strong></p><p style="text-align: center;"><img class="aligncenter size-full wp-image-3012" src="http://mobda.com/wp-content/uploads/2015/10/S6-Edge-Display.jpg" alt="S6 Edge+ Display" width="600" height="400"></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Once again, the sunlight legibility of Samsung Galaxy S6 Edge+ is unbeatable. It means even in bright sunlight conditions, you get to see the clear screen of your phone.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With various<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Screen modes</strong>, you can choose contrast and saturation preset, and color temperature as per your convenience.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery of Samsung Galaxy S6 Edge+</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy S6 Edge+ is a power packed phone with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3,000mAh<span class="Apple-converted-space">&nbsp;</span></strong>non-removable battery, giving an endurance rating of around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">83 hours.<span class="Apple-converted-space">&nbsp;</span></strong>It means you can trust on the battery of Samsung Galaxy S6 Edge+ that it will run for around 3 and half days with one-hour usage of call, web browsing and video playback. Moreover, you get<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">31 hours<span class="Apple-converted-space">&nbsp;</span></strong>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3G talk time,</strong><span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">11 hours<span class="Apple-converted-space">&nbsp;</span></strong>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">web browsing,<span class="Apple-converted-space">&nbsp;</span></strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">14 hours<span class="Apple-converted-space">&nbsp;</span></strong>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">video playback.</strong></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You get a quick charger with the Samsung Galaxy S6 Edge+ that can top up the battery in less than<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">90-minutes</strong><span class="Apple-converted-space">&nbsp;</span>from empty, increasing the use of phone manifolds. On the other hand, with the wireless charging, the phone gets charged in less than<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">120<span class="Apple-converted-space">&nbsp;</span></strong>minutes making it extremely convenient for you.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">In the Samsung Galaxy S6 Edge+, you get two<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">battery saving modes</strong><span class="Apple-converted-space">&nbsp;</span>available to you –<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Power saving mode<span class="Apple-converted-space">&nbsp;</span></strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Ultra power saving mode.<span class="Apple-converted-space">&nbsp;</span></strong>If you will use the latter, all the apps except the crucial ones will be turned off, allowing the phone to last for hours, even with a single percentage of battery.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Software &amp; Performance of Samsung Galaxy S6 Edge+</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy S6 Edge+ is loaded with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android 5.1.1 Lollipop</strong>.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we talk about the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Edge Screen,<span class="Apple-converted-space">&nbsp;</span></strong>Samsung Galaxy S6 Edge+ offers you some coolest functionality with it,<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Night Clock</strong><span class="Apple-converted-space">&nbsp;</span>being the one. The Night Clock shows you the time on the edge strips during the night, which is always on. Whether the Night clock is active or not, you can awake the edge strip by just swiping it.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/S6-Edge-Edges.jpg"><img class="aligncenter size-full wp-image-3013" src="http://mobda.com/wp-content/uploads/2015/10/S6-Edge-Edges.jpg" alt="S6 Edge+ Edges" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Samsung Galaxy S6 Edge+ is packed with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Exynos 7420</strong><span class="Apple-converted-space">&nbsp;</span>chipset and has<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1.5 GHz quad-core Cortex-A53 CPU, 2.1GHz quad-core Cortex-A57 CPU, Mali-T760MP8 GPU<span class="Apple-converted-space">&nbsp;</span></strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">4 GB<span class="Apple-converted-space">&nbsp;</span></strong>of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">RAM.<span class="Apple-converted-space">&nbsp;</span></strong>All these specs have made the Samsung Galaxy S6 Edge+ one of the most powerful smartphones available in the market.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera of Samsung Galaxy S6 Edge+</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy S6 Edge+ is loaded with superb<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">16MP Sony IMX240<span class="Apple-converted-space">&nbsp;</span></strong>camera sensor and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">f/1.9</strong><span class="Apple-converted-space">&nbsp;</span>lens and a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5MP</strong><span class="Apple-converted-space">&nbsp;</span>front camera. One of the best features is the quick launch of camera. Just double tap the home key anywhere in the UI and the camera is ready in front of you to take the snap, in just less than a second.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/S6-Edge-Camera.png"><img class="aligncenter size-full wp-image-3017" src="http://mobda.com/wp-content/uploads/2015/10/S6-Edge-Camera.png" alt="S6 Edge+ Camera" width="600" height="400"></a></p><p style="text-align: justify;"><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">The UI of camera is pretty simple and user friendly. You can find the majority of settings on the viewfinder. With the help of<span class="Apple-converted-space">&nbsp;</span></span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: 600; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Pro</strong><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;"><span class="Apple-converted-space">&nbsp;</span>mode, you get the access to adjust the focus manually; apart from this, you can also adjust exposure compensation and ISO, white balance and many more. Moreover, you can save your manual settings as a preset so that you can use it again.</span></p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/S6-Edge-Camera.jpg"><img class="aligncenter size-full wp-image-3018" src="http://mobda.com/wp-content/uploads/2015/10/S6-Edge-Camera.jpg" alt="S6 Edge+ Camera" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If photography is your passion, then the Samsung Galaxy S6 Edge+ is for you. The device enables you to save the images in the RAW format so that you can show all your creativity in the images after the post processing.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Final Words</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/S6-Edge-Conclusion.jpg"><img class="aligncenter size-full wp-image-3014" src="http://mobda.com/wp-content/uploads/2015/10/S6-Edge-Conclusion.jpg" alt="S6 Edge+ Conclusion" width="600" height="400"></a></p><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">Samsung Galaxy S6 Edge+ is worth the money. All its specs, performances and other things are up to the mark. Moreover, if you want a business phablet feel, but without a stylus, undoubtedly the Samsung Galaxy S6 Edge+ is for you. The gorgeous look, strong hardware device with bigger size is the one you must buy.</span>                                      	</div>', '/image/uploads_productReview_productReviewImage-431375-1484679095.jpg', 1, '2017-01-17 13:21:35', '2017-01-17 13:31:21');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(7, 756, 'Xiaomi Redmi Note 2 Review', 'This Xiaomi Redmi Note 2 have great review', '<div class="new_description "><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">The Xiaomi Redmi Note 2 is famous for being the cheapest phablet that is available in the market, and sooner or later, you would definitely think of buying it. You may remember that the Redmi Note went out in a flash in the year 2014. Similarly, the LTE upgrade, Redmi Note 2 is comfortable in finding record breaking place in the market.</span><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Xiomi-Redmi-Note-2.jpg"><img class="aligncenter size-full wp-image-3001" src="http://mobda.com/wp-content/uploads/2015/10/Xiomi-Redmi-Note-2.jpg" alt="Xiomi Redmi Note 2" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Sooner in the future, Xiaomi is also eyeing to expand its market in Europe and the US, although the company is waiting for the correct time. However, the company is already running the online stores in these countries.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With the launch of cheap Redmi Note 2, Xiaomi has tried to compete with the established brands that are providing midrange phablets and trying to match their equipments.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Unboxing Xiaomi Redmi Note 2</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Unboxing-Xiaomi-Redmi-Note-2.jpg"><img class="aligncenter size-full wp-image-3006" src="http://mobda.com/wp-content/uploads/2015/10/Unboxing-Xiaomi-Redmi-Note-2.jpg" alt="Unboxing Xiaomi Redmi Note 2" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">There is nothing unique about the retail package of the Redmi Note 2. It is made up of the recycled paper, which is said to bear about 130 kg of weight for all that is worth. Once you open the retail package, you can find the device itself with a 2amp A/C adapter and one microUSB cable.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Design &amp; Build Quality of Xiaomi Redmi Note 2</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">This giant phablet from Xiaomi is<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">152 x 76 x 8.3mm</strong><span class="Apple-converted-space">&nbsp;</span>in dimensions, making it<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2mm<span class="Apple-converted-space">&nbsp;</span></strong>shorter,<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3mm<span class="Apple-converted-space">&nbsp;</span></strong>narrower and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1mm</strong><span class="Apple-converted-space">&nbsp;</span>thinner than its predecessor does. With a screen size of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.5”,</strong><span class="Apple-converted-space">&nbsp;</span>the Redmi Note 2 is around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">25g<span class="Apple-converted-space">&nbsp;</span></strong>lighter than the previous version.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The other important change that you get to see in the Xiaomi Redmi Note 2 is that the glossy plastic, as compared to its predecessor, is replaced with the matte finish. The frond of the device is completely covered with a black piece of glace, regardless of the color of device. The Redmi Note 2 also has the red accent on its capacitive keys, a signature feature of the Redmi series.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we look at the back of the device, the entire rear cover can be removed and is primarily made of matte plastic. You can find the design of Xiaomi Redmi Note 2 resembles a lot to the Mi 4i and Redmi Note. However, the matte touch at the back definitely enhanced the looks and handling of the device.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display of Xiaomi Redmi Note 2</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">In the Xiaomi Redmi Note 2, you get a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Full HD IPS 5.5”<span class="Apple-converted-space">&nbsp;</span></strong>display that gives you<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">401ppi</strong><span class="Apple-converted-space">&nbsp;</span>for the pleasant and sharp imagery. However, the glass that you get on the screen does not seem to be scratch-resistant type. The brightness level is a little less on the display of Xiaomi Redmi Note 2 when compared with the Mi 4i, while maintaining almost same contrast and colors.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You get the manual settings for color temperature. You can easily adjust between the normal, cool and warm colors. To get the higher color accuracy than normal just set your phone’s color to warm settings.</p><p style="text-align: center;"><img class="aligncenter size-full wp-image-3002" src="http://mobda.com/wp-content/uploads/2015/10/Display-of-Xiaomi-Redmi-Note-2.jpg" alt="Display of Xiaomi Redmi Note 2" width="600" height="400"></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">When it comes to sunlight legibility, you may have a little disappointment, being it to be average. The screen glass is also reflective, so, to see what is going on your phone screen during the bright sunlight, you need to set the brightness level to highest, washing out all the colors.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery of Xiaomi Redmi Note 2</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">One of the most important deciding factors, battery of Xiaomi Redmi Note 2 is a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3,060mAh</strong><span class="Apple-converted-space">&nbsp;</span>strong enough to hold a solid unit with a 5.5” display. With the battery tests, we found that the battery of Xiaomi Redmi Note 2 has the endurance rating of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">49 hours</strong>, which means if you use the device exactly for one hour each for calling, browsing the web and video playback, it may easily run for 2 days. However, if you add the second SIM, the endurance rating gets down 2 hours, making it<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">47 hours.<span class="Apple-converted-space">&nbsp;</span></strong>So, you get<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">17 hours of 3G talk time, 8 hours of web browsing and 7 hours of video playback.</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Software &amp; UI of Xiaomi Redmi Note 2</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/UI-of-Xiaomi-Redmi-Note-2.jpg"><img class="aligncenter size-full wp-image-3003" src="http://mobda.com/wp-content/uploads/2015/10/UI-of-Xiaomi-Redmi-Note-2.jpg" alt="UI of Xiaomi Redmi Note 2" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Xiaomi Redmi Note 2 is the first smartphone that is officially running on<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">MIUI 7</strong><span class="Apple-converted-space">&nbsp;</span>and has<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android 5.0.2 Lollipop</strong><span class="Apple-converted-space">&nbsp;</span>core inside it. Xiaomi has also refined their launcher and the performance of the device, instead of refreshing its UI. With these enhancements and induction of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">MIUI 7</strong>, the device has become<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">30% faster</strong><span class="Apple-converted-space">&nbsp;</span>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">10%<span class="Apple-converted-space">&nbsp;</span></strong>more<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">energy efficient.<span class="Apple-converted-space">&nbsp;</span></strong>Moreover, you also get a few new features that include baby album, new default themes, auto DND option and child mode.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera of Xiaomi Redmi Note 2</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Xiaomi Redmi Note 2 is fitted with a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">13MP<span class="Apple-converted-space">&nbsp;</span></strong>camera with a LED flash. As compared to its predecessor, the Xiaomi Redmi Note 2 has got a superb upgrade, featuring the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">hybrid autofocus system</strong><span class="Apple-converted-space">&nbsp;</span>that utilizes the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">phase-detection</strong><span class="Apple-converted-space">&nbsp;</span>for faster and more accurate focus.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/camera-of-Xiaomi-Redmi-Note-2.jpg"><img class="aligncenter size-full wp-image-3004" src="http://mobda.com/wp-content/uploads/2015/10/camera-of-Xiaomi-Redmi-Note-2.jpg" alt="camera of Xiaomi Redmi Note 2" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The interface of Xiaomi Redmi Note 2 is fairly simple, having three panes in its pocket. Out the three, the first one shows the viewfinder with a virtual shutter, front camera key and flash trigger. If you will slide to the top pane, you may find 12 filters along with the live previews. Sliding to the bottom pane, you will find some of the advanced modes, which include Panorama, timer, beautify, manual and Gradient. In the manual mode, you get the option to set white balance and ISO.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">When it comes to the video recording, Xiaomi Redmi Note 2 camcorder is capable of recording a video of up to<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1080p@30fps.<span class="Apple-converted-space">&nbsp;</span></strong>However, the bitrate is certainly poor at about<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">15 Mbps</strong><span class="Apple-converted-space">&nbsp;</span>of the video recording.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Final Words</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Xiaomi-Redmi-Note-2-Conclusion.jpg"><img class="aligncenter size-full wp-image-3005" src="http://mobda.com/wp-content/uploads/2015/10/Xiaomi-Redmi-Note-2-Conclusion.jpg" alt="Xiaomi Redmi Note 2 Conclusion" width="600" height="400"></a></p><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">If we look at the Xiaomi Redmi Note 2, it is straightforward and simple, yet plausible. You will not find any fancy change in the Redmi Note 2 when compared to its predecessor, but still the higher screen resolution, burgeoned processing power, fast battery charging and IR port makes it a little different from its predecessor.</span><p></p>                                                          	</div>', '/image/uploads_productReview_productReviewImage-735998-1484679399.jpg', 1, '2017-01-17 13:26:40', '2017-01-17 13:31:21');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(8, 987, 'Moto X Style (Pure Edition) Review', 'This Moto X Style (Pure Edition) have great review', '<div class="new_description "><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">Many of you may not know, but Moto X Style (Pure Edition) is the biggest member of the product family till now. Moreover, it is the first flagship smart phone that is manufactured completely under the stewardship of Lenovo. You may even call it even a phablet with 5.7” display.</span><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Moto-X-Style-Pure-Edition1.jpg"><img class="aligncenter size-full wp-image-2989" src="http://mobda.com/wp-content/uploads/2015/10/Moto-X-Style-Pure-Edition1.jpg" alt="Moto X Style (Pure Edition)" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The other important thing to note is that<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Moto X Style<span class="Apple-converted-space">&nbsp;</span></strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Moto X Pure Edition<span class="Apple-converted-space">&nbsp;</span></strong>are the same devices, only Motorola chose the second name for its US customers.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Unboxing the Moto X Style (Pure Edition)</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Unboxing-Moto-X-Style-Pure-Edition.jpg"><img class="aligncenter size-full wp-image-2991" src="http://mobda.com/wp-content/uploads/2015/10/Unboxing-Moto-X-Style-Pure-Edition.jpg" alt="Unboxing Moto X Style (Pure Edition)" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You may find the Moto X Pure Edition in a fairly big retail box. Inside the boxy, you can find the device itself, a tool for removing the SIM and memory card slot, a Turbo Charger, and a clear bumper case that goes with the usual set of booklets. There is a bit disappointment for you as no headphones are included in the accessories.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Design &amp; Build Quality of Moto X Style (Pure Edition)</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">As the predecessor, the Moto X Style (Pure Edition) comes in the same three-piece design and has slight curves in the body. However, if you really want to differentiate between a 2014 and 2015 Moto X, the only noticeable difference is that you find a front LED flash and a large camera at the back in the later.</p><div style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Customized-Background-of-Moto-X-Style-Pure-Edition2.jpg"><img class="aligncenter size-full wp-image-2992" src="http://mobda.com/wp-content/uploads/2015/10/Customized-Background-of-Moto-X-Style-Pure-Edition2.jpg" alt="Customized Background of Moto X Style (Pure Edition)2" width="600" height="400"></a></div><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we talk about the Moto Maker, you can find the richest ever Motorola’s customization platform. You get a brand new<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Gold<span class="Apple-converted-space">&nbsp;</span></strong>option in the phone’s metal frame and many textures and colors for the back.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Motorola again has given a superb build quality in Moto X Style (Pure Edition). The device is packed with a strong metal frame, with its frond covered with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Corning Gorilla Glass 3</strong>, and back cover with material of your choice. We can bet that the handset will definitely live up to your expectations in all its aspects.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">water repellent nano-coating treatment</strong><span class="Apple-converted-space">&nbsp;</span>on the device has given the capability to handle light splashes to Moto X Style (Pure Edition).</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Dimensions wise, the Moto X Style (Pure Edition) is<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">153.9mm<span class="Apple-converted-space">&nbsp;</span></strong>long and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">76.2mm<span class="Apple-converted-space">&nbsp;</span></strong>wide. However, the thickness may vary between<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">6.1mm<span class="Apple-converted-space">&nbsp;</span></strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">11.6mm</strong>, and weighs around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">179 grams.<span class="Apple-converted-space">&nbsp;</span></strong>The Moto X Style (Pure Edition ) has a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.7”<span class="Apple-converted-space">&nbsp;</span></strong>display.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display of Moto X Style (Pure Edition)</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Moto X Style (Pure Edition) has a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.7” IPS LCD<span class="Apple-converted-space">&nbsp;</span></strong>display and a resolution of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2560 x 1440 pixels</strong>. Moreover, you get the pixel density of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">520 ppi</strong>, making it sufficiently sharp and worthy as a flagship product of 2015.</p><div style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Display-of-Moto-X-Style-Pure-Edition.jpg"><img class="aligncenter size-full wp-image-2993" src="http://mobda.com/wp-content/uploads/2015/10/Display-of-Moto-X-Style-Pure-Edition.jpg" alt="Display of Moto X Style (Pure Edition)" width="600" height="400"></a></div><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You can easily get impressed with the brightness and different viewing angles of Moto X Style (Pure Edition). Moreover, if you want to use your phone outdoors, here is a good news. The sunlight legibility is of top notch making it completely visible even in the bright sunny days. The colors of Moto X Style (Pure Edition) are superbly accurate from a quality IPS unit, with a stellar contrast. The device has also got the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">QHD<span class="Apple-converted-space">&nbsp;</span></strong>display, which is miles ahead of the quad-HD solutions available in other phones.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery of Moto X Style (Pure Edition)</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">There were some battery issues with the predecessor, therefore, this time, Moto X Style (Pure Edition) has got a massive<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3000mAh</strong><span class="Apple-converted-space">&nbsp;</span>non-removable battery that is equipped with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">XT1575</strong>. With the various battery tests, the phone has given an endurance rating of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">63 hours</strong><span class="Apple-converted-space">&nbsp;</span>with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">23 hours of 3G Talk time, 7 hours of web browsing and 9 hours of video playback.</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">User Interface of Moto X Style (Pure Edition)</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Moto X Style (Pure Edition) is loaded with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android Lollipop 5.1.1</strong>. However, Motorola prefers vanilla Android user interface along with some improvements so that quick firmware updates can be provided.</p><p style="text-align: center;"><img class="aligncenter size-full wp-image-2997" src="http://mobda.com/wp-content/uploads/2015/10/Software-of-Moto-X-Style-Pure-Edition2.jpg" alt="Software of Moto X Style (Pure Edition)2" width="600" height="400"></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Moto X Style (Pure Edition) has got a new and unique way to get the notifications displayed without waking up the screen. This feature is known as<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Notification at a Glance</strong>.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Whenever you will pick up the phone from the table or take out from the pocket, the clock on the locked screen will light up, which will show the icons or any missed notifications. Moreover, if you will tap and hold the icons, you will get more information and details about the same. All of this without even waking up your phone.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Software-of-Moto-X-Style-Pure-Edition.jpg"><img class="aligncenter size-full wp-image-2998" src="http://mobda.com/wp-content/uploads/2015/10/Software-of-Moto-X-Style-Pure-Edition.jpg" alt="Software of Moto X Style (Pure Edition)" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Some of the other cool features include: if you want to activate the camera, just quickly twist your wrist holding the device and the camera will pop up; or use the chopping gesture to switch on the LED flash light and use it like a torch.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Performance of Moto X Style (Pure Edition)</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Moto X Style (Pure Edition) has got some cool features under its hood. It has<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Qualcomm Snapdragon 808SoC, 3GB of RAM,<span class="Apple-converted-space">&nbsp;</span></strong>its chipset has a duo of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Cotex-A57 CPU cores<span class="Apple-converted-space">&nbsp;</span></strong>and a quartet of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Cortex-A53 cores</strong><span class="Apple-converted-space">&nbsp;</span>along with the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Adreno 418 GPU</strong><span class="Apple-converted-space">&nbsp;</span>handling the graphics.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera of Moto X Style (Pure Edition)</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Now comes the most important part, the camera of Moto X Style (Pure Edition). This giant is equipped with a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">21MP<span class="Apple-converted-space">&nbsp;</span></strong>camera with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">f/2.0</strong><span class="Apple-converted-space">&nbsp;</span>lens having dual-tone LED flash.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The camera has the similar interface as on the Moto E and Moto X that includes two on-screen buttons present on the right-hand side and a front facing camera. To take a snapshot, you just have to tap on the screen.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Camera-of-Moto-X-Style-Pure-Edition.jpg"><img class="aligncenter size-full wp-image-2994" src="http://mobda.com/wp-content/uploads/2015/10/Camera-of-Moto-X-Style-Pure-Edition.jpg" alt="Camera of Moto X Style (Pure Edition)" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You’ve got numerous modes available in the camera. Some of them include HDR, touch capture, panorama, widescreen mode, auto mode, night mode and shutter sound.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">As informed above, twisting your hand will switch on the camera. However, this time, Motorola has added another twist in this twisting process. Twisting your hand for the second time will turn on the front-facing camera.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Conclusion</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Moto-X-Style-Pure-Edition-Conclusion1.jpg"><img class="aligncenter size-full wp-image-2996" src="http://mobda.com/wp-content/uploads/2015/10/Moto-X-Style-Pure-Edition-Conclusion1.jpg" alt="Moto X Style (Pure Edition) Conclusion" width="600" height="400"></a></p><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">You can call the Moto X Style (Pure Edition) the best Android smartphone till date. This device is the combination of highly customizable looks, superb build quality, attractiveness, cool camera and unmatchable connectivity suite along with an attractive off-contract price tag. We would give Lenovo as much credit as Motorola in this case.</span>                                      	</div>', '/image/uploads_productReview_productReviewImage-181655-1484679636.jpg', 1, '2017-01-17 13:30:36', '2017-01-17 13:31:22');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(9, 16, 'Sony Xperia Z5 Compact Review', 'This Sony Xperia Z5 Compact have great review', '<div class="new_description "><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">Almost everyone knows that Sony is struggling in the smart phone market. In fact the company has decided that if they do not see any growth in their Android handset division, and the sales and profitability of the same, then they can chop the whole unit.</span><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Sony-Xperia-Z5-Compact.jpg"><img class="aligncenter size-full wp-image-2978" src="http://mobda.com/wp-content/uploads/2015/10/Sony-Xperia-Z5-Compact.jpg" alt="Sony Xperia Z5 Compact" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">However, keeping the aforementioned things in mind, let us have look on the smallest phone of the Sony Xperia Z5 series, the Z5 Compact that is just 4.6” long. Whenever it comes to the question of making the compact phone, Sony gains the reputation for it. We definitely remember that Z3 compact was one of the most-successful and best-selling phone models.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With the launch of Sony Xperia Z5 Compact, the company has fitted the device with flagship grade specs in a smaller body with a 4.6-inch display.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Design &amp; Build Quality of Sony Xperia Z5 Compact</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we talk about the design and have used the older phones of Sony Xperia series, then you would definitely notice the change in the design of Z5 Compact. Sony is trying to revamp its signature design with the launch of Z5 series, as all the members of Z5 family and Xperia Z1 shares the same exterior design.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Design-of-Sony-Xperia-Z5-Compact.jpg"><img class="aligncenter size-full wp-image-2982" src="http://mobda.com/wp-content/uploads/2015/10/Design-of-Sony-Xperia-Z5-Compact.jpg" alt="Design of Sony Xperia Z5 Compact" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With the new design of Z5 compact, Sony has taken the impression of uniformity to a brand new level and at the same time, it moved beyond the symmetry of previous devices. Some of the people out there may find the design of Sony Xperia Z5 Compact a bit boring; however, it is the opposite of it. The device is charming in its simplicity.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we talk about the dimensions, the Z5 Compact measures<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">127 x 65 x 8.9 mm</strong>, that is a little thicker than Z3 compact. However, it is hard to notice the difference between these two devices. The weight of Z5 compact is around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">135 grams.</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display of Sony Xperia Z5 Compact</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/UI-of-Sony-Xperia-Z5-Compact.jpg"><img class="aligncenter size-full wp-image-2980" src="http://mobda.com/wp-content/uploads/2015/10/UI-of-Sony-Xperia-Z5-Compact.jpg" alt="UI of Sony Xperia Z5 Compact" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">As mentioned above, the screen of the Xperia Z5 Compact is<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">4.6-inches</strong><span class="Apple-converted-space">&nbsp;</span>in diagonal. The screen resolution of the device is<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">720 x 1280 pixels</strong><span class="Apple-converted-space">&nbsp;</span>and is fitted with the IPS LCD variety. Apart from this, Sony has installed the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Mobile BRAVIA Engine 2, X-Reality engine for mobile,<span class="Apple-converted-space">&nbsp;</span></strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Triluminos technology.<span class="Apple-converted-space">&nbsp;</span></strong>The display brightness of Sony Xperia Z5 Compact is superbly high with around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">680nits.<span class="Apple-converted-space">&nbsp;</span></strong>You can use both the auto and manual modes to adjust the screen brightness and you do not have to worry about the display contrast ratio in both the modes.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery of Sony Xperia Z5 Compact</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">When it comes to the battery, Sony Xperia Z5 Compact is a device with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2700mAh</strong><span class="Apple-converted-space">&nbsp;</span>battery fitted inside it, which gives an excellent performance with the endurance rating of around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">86 hours.<span class="Apple-converted-space">&nbsp;</span></strong>Apart from high endurance rating, you can comfortable have<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">28 hours of 3G talk time, 11 hours of web browsing and 13 hours of video playback.</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">User Interface of Sony Xperia Z5 Compact</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Software-of-Sony-Xperia-Z5-Compact.jpg"><img class="aligncenter size-full wp-image-2981" src="http://mobda.com/wp-content/uploads/2015/10/Software-of-Sony-Xperia-Z5-Compact.jpg" alt="Software of Sony Xperia Z5 Compact" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we talk about the user interface of Sony Xperia Z5 Compact, it is<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android Lollipop<span class="Apple-converted-space">&nbsp;</span></strong>with a pinch of Xperia. You can say that Sony is now completely comfortable with the newest platform of Android and hence, spreading it across almost all the devices.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">So, here is a good news. The Sony Xperia Z5 Compact comes with the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android Lollipop 5.1.1<span class="Apple-converted-space">&nbsp;</span></strong>version. If we talk about the interface of Sony Xperia Z5 Compact, it is almost similar to its predecessor but with a few notable changes.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">To preserve its signature look and feel, Sony has kept the old launcher its phone. Therefore, if you are getting an Android upgrade, KitKat to Lollipop, you will find all your favorite things right there at the same place but with the brand new eye-candy feels of Android Lollipop.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Performance of Sony Xperia Z5 Compact</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Do not make a mistake of thinking that you have downgraded specs in this compact phone. Whatever the size may be, Sony Xperia Z5 Compact is the prestigious member of “Z” family. Therefore, keeping this in mind, the Sony Xperia Z5 Compact has<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Qualcomm MSM8994 Snapdragon 810, 2GB of RAM, a total of eight cores, four Cortex-A53 units clocking at 1.5GHz and the next four Cortex-A57 at 2.0GHz</strong>.<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Adreno 430</strong><span class="Apple-converted-space">&nbsp;</span>powers the graphics of Sony Xperia Z5 Compact.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">&nbsp;</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera of Sony Xperia Z5 Compact</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you are launching your company’s flagship product, camera is one of the most important features you need to focus on. So, the Sony Xperia Z5 Compact comes with a promising<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">23MP<span class="Apple-converted-space">&nbsp;</span></strong>camera paired with an<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">f/2.0 24mm-sensor</strong>, same as the Z5 Premium.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Camera-of-Sony-Xperia-Z5-Comapct.jpg"><img class="aligncenter size-full wp-image-2979" src="http://mobda.com/wp-content/uploads/2015/10/Camera-of-Sony-Xperia-Z5-Comapct.jpg" alt="Camera of Sony Xperia Z5 Comapct" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The camera has got superb color rendering and white balance, good detail preservation, no matter what the light conditions are, and a good flash with pleasant white balance.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Phone gets the two-stage shutter button, making the precise focus extremely easy. However, you’ve got only a plain single LED, instead of dual-tone flash.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">In the Manual Mode, you get a lot of awesome options. You can easily switch between the video capture and stills. Apart from this, you get the access to “manual controls” on the viewfinder, an exposure compensation slider and a white balance selector, ISO metering, turn on/off image stabilization, and focus modes. However, to get the access of these options, you will have to go into the Settings menu of the camera.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Conclusion</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Z5-Compact-Conclusion.jpg"><img class="aligncenter size-full wp-image-2977" src="http://mobda.com/wp-content/uploads/2015/10/Z5-Compact-Conclusion.jpg" alt="Z5 Compact Conclusion" width="600" height="400"></a></p><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">Despite its small size, the Sony Xperia Z5 Compact has tremendous capability to live up to your expectations. It has comfortably managed to slip in all the major hardware inside its small size. It has got superb build quality, design and is an extremely beautiful device.</span>                                      	</div>', '/image/uploads_productReview_productReviewImage-657391-1484679866.jpg', 1, '2017-01-17 13:34:26', '2017-01-17 14:13:47');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(10, 10, 'Samsung Galaxy A8 Review', 'This Samsung Galaxy A8 have great review', '<div class="new_description "><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">Sometimes you do not have to be the best if you are liked by the masses, and<span class="Apple-converted-space">&nbsp;</span></span><a href="http://mobda.com/product/samsung-galaxy-a8/" target="_blank" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Samsung Galaxy A8</a><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;"><span class="Apple-converted-space">&nbsp;</span>is the best example for it. Galaxy A8 is the thinnest smart phone Samsung has ever launched. Not only the thinnest, it is the biggest smart phone in the A series and have a 5.7” Super AMOLED screen. Despite of having a complete metal frame, the phone is still lighter and thinner.</span><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Samsung-Galaxy-A8-Review1.jpg"><img class="aligncenter size-full wp-image-2945" src="http://mobda.com/wp-content/uploads/2015/10/Samsung-Galaxy-A8-Review1.jpg" alt="Samsung Galaxy A8 Review" width="600" height="400"></a></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Unboxing Samsung Galaxy A8</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Unboxing-A8.png"><img class="aligncenter size-full wp-image-2974" src="http://mobda.com/wp-content/uploads/2015/10/Unboxing-A8.png" alt="Unboxing A8" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy A8 has one of the most attractive retail packages. You get a gorgeous blue color box, which has a one-piece, a micruUSB cable, three-button headset and one charger. The charger is a Quick Charge 1.0, v2.0, which gives 50 percent more power output, 15W. You also get a card eject tool that help you in accessing the card slots.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Design of Samsung Galaxy A8</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Having the thickness of around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.9mm</strong>, Samsung Galaxy A8 is company’s thinnest phone. Approximately 74 percent of the Galaxy A8’s front is covered with screen. With a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.7”</strong><span class="Apple-converted-space">&nbsp;</span>long length, Samsung Galaxy A8 is around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">151g</strong><span class="Apple-converted-space">&nbsp;</span>in weight.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Design-of-Samsung-Galaxy-A8.jpg"><img class="aligncenter size-full wp-image-2935" src="http://mobda.com/wp-content/uploads/2015/10/Design-of-Samsung-Galaxy-A8.jpg" alt="Design of Samsung Galaxy A8" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Below the screen, you get the traditional Home key that also works as the fingerprint reader. Moreover, when the backlight is off, the capacitive App switcher and Back keys fade completely, which leaves a cleaner impression of the phone’s design on the user. Above the screen, you get a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5MP<span class="Apple-converted-space">&nbsp;</span></strong>selfies camera, the proximity sensor and the ambient light sensor.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Apart from the aforementioned features, the rest of the design of Samsung Galaxy A8 is similar, if you have seen all the recent Galaxy phones. However, one of the interesting features that A8 holds is you get two card slots no matter it is a single SIM version or the dual-SIM version. One slot is to hold the primary SIM and other to hold the microSD card.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">However, the only difference in the single SIM version and dual SIM version is that in dual SIM version, the second slot holds either the SIM or the microSD card.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Galaxy A8 comes with the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">32GB<span class="Apple-converted-space">&nbsp;</span></strong>built in storage, so you can use the phone without the microSD card also if you do not have much of the data. However, if you want to use a dual-SIM, then this model is a perfect fit for you, providing you with a lot of storage.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display of Samsung Galaxy A8</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Display-of-Samung-Galaxy-A8.jpg"><img class="aligncenter size-full wp-image-2936" src="http://mobda.com/wp-content/uploads/2015/10/Display-of-Samung-Galaxy-A8.jpg" alt="Display of Samung Galaxy A8" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">As mentioned above, the screen of Galaxy A8 is huge with 5.7 inches and matches the Galaxy Note’s size. Display wise, the Samsung Galaxy A8 comes with the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1080p<span class="Apple-converted-space">&nbsp;</span></strong>resolution with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">389ppi</strong>, and has the Super AMOLED display.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You may be disappointed by the battery though. Installed with the 3,050mAh, non-removable battery, A8 is sailing in the same boat as of Galaxy Note5. However, you do not have to worry at all, because after battery tests, we found that you can easily get the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">12 hours</strong><span class="Apple-converted-space">&nbsp;</span>of web browsing and video playback. Moreover, you get around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">25 hours<span class="Apple-converted-space">&nbsp;</span></strong>of 3G Talk time.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">User Interface</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy A8 has the latest<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android 5.1.1 Lollipop</strong><span class="Apple-converted-space">&nbsp;</span>that is the latest manifestation of TouchWiz surpassing all the previous A series phones and getting the premium treatment.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">There is a fun fact that the Galaxy A8 can launch its camera in just<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">0.9<span class="Apple-converted-space">&nbsp;</span></strong>seconds and Samsung is proud of that. On the lock screen, you get a few shortcuts like notifications, and to launch the camera. As similar to the Galaxy S6, you can open the camera just by double pressing the home button. Moreover, you also get the weather information on the lock screen, which is not Samsung’s standard but is useful.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You can add the security to the lock screen with your fingerprints. The finger print reader is installed on the home button that is extremely easy to use.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">One more extra feature that you have in A8 is the theme store. Because the preloaded themes in the phone are not that awesome, therefore, to give you more options, theme store is there. Themes not only change your wallpaper and icons, but also the icons of dialer, contacts, messages, and the notification area.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">One more unique feature that you get is<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">100GB free storage in OneDrive.</strong><span class="Apple-converted-space">&nbsp;</span>Yes, Samsung has partnered with Microsoft and hence, you get the OneDrive in your phone.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we talk about the apps storage, then out of 32 GB only<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">6-7GB<span class="Apple-converted-space">&nbsp;</span></strong>is reserved for the inbuilt apps. It means a 32GB internal storage is sufficient without the expansion of microSD.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Performance</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Powered by<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Snapdragon 615</strong><span class="Apple-converted-space">&nbsp;</span>chipset or an<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Exynos 5430</strong>, the Samsung Galaxy A8 have octa-core processors, which include two groups of four<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1.3GHz<span class="Apple-converted-space">&nbsp;</span></strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1.8GHz</strong>. the RAM in the Samsung Galaxy A8 is<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2GB</strong>, a little disappointment here.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Overall, the performance of Samsung Galaxy A8 is superb, however, you may find a lag while 3D gaming because the GPU is only half-powerful. Still, the speed of processor is sufficient enough for most of the workloads.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera of Samsung Galaxy A8</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy A8 is equipped with a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">16MP<span class="Apple-converted-space">&nbsp;</span></strong>camera, having<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">f/1.9 aperture</strong>. However, unlike Samsung Galaxy Note5, the camera of Galaxy A8 does not have the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">OIS</strong><span class="Apple-converted-space">&nbsp;</span>and the sensor is also different, having the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">4:3 native aspect ratio<span class="Apple-converted-space">&nbsp;</span></strong>instead of 16:9.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Camera-of-Samsung-Galaxy-A8.jpg"><img class="aligncenter size-full wp-image-2933" src="http://mobda.com/wp-content/uploads/2015/10/Camera-of-Samsung-Galaxy-A8.jpg" alt="Camera of Samsung Galaxy A8" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You get the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Pro</strong><span class="Apple-converted-space">&nbsp;</span>mode in the phone but it is not as superb as you get in the flagship S and Note series of Samsung phones. You only get to adjust the white balance, compensation of exposure and the ISO. If you want more modes in your Samsung Galaxy A8, you need to download them. Some of the extra features include Rear-cam selfies, Sound &amp; shot, Animated GIF and many more.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The camera of Samsung Galaxy A8 also includes the HDR, continuous shooting, night mode and Panorama and some of the color effects too.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we talk about the video camera, in Samsung Galaxy A8, it can go up to only<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1080p @ 30fps.<span class="Apple-converted-space">&nbsp;</span></strong>If you are recording a FullHD video, they are recorded at the usual<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">17Mbps<span class="Apple-converted-space">&nbsp;</span></strong>and the sound is captured at<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">256Kbps (stereo, 48kHZ).</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Disadvantages</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Samsung’s A8 is one of the thinnest phone ever. With numerous positive aspects, the device has some of the negative features too. Let us have a look at them.</p><ul style="padding: 0px 0px 10px; margin: 0px 0px 0px 30px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">The battery is not user-replaceable</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No IR port</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No enhanced resistance to liquids or dust</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No stereo speakers</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No NFC, so no Samsung Pay</li></ul>                                      	</div>', '/image/uploads_productReview_productReviewImage-390396-1484680127.jpg', 1, '2017-01-17 13:38:47', '2017-01-17 14:13:48');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(11, 297, 'OnePlus 2 Review', 'This OnePlus 2 have great review', '<div class="new_description "><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Introduction</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With huge success of the flagship product OnePlus, the company has come up with its another flagship killer, OnePlus 2. By the launch of OnePlus 2, we can say that the Chinese are now following the rules instead of breaking them.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/OnePlus-2.jpg"><img class="aligncenter size-full wp-image-2964" src="http://mobda.com/wp-content/uploads/2015/10/OnePlus-2.jpg" alt="OnePlus 2" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">So, to start with, the OnePlus 2 is one of the most sophisticated phone ever. It still has a bigger size, but is more elegant than its predecessor is. Equipped with some of the best tech specs, OnePlus 2 has the latest Android OS, after the breakup with CyanoGen. Moreover, with the success of OnePlus, we can say that the company has established a brand name in the market after just being a startup.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Unboxing OnePlus 2</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You will find the OnePlus 2 in a red compact box. This red box holds the device itself, a 2A charger, and a USB type-C cable that is tangle free. One of the coolest features of the USB cable is that it is reversible at both of the ends.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/OnePlus-2-Unboxing.jpg"><img class="aligncenter size-full wp-image-2966" src="http://mobda.com/wp-content/uploads/2015/10/OnePlus-2-Unboxing.jpg" alt="OnePlus-2-Unboxing" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">There is one disappointment for you. It is that the headphones are not bundled with the phone. However, this will not surprise you if you are already familiar with the OnePlus One.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Design &amp; Build of OnePlus 2</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The design of OnePlus 2 is a complete justice to the device. The phone has got the magnesium alloy frame, which is strong but is not overdone. While the phone’s back has, a Sandstone Black texture as its predecessor, but is a little different and contains more plastic.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With the OnePlus 2, you have got a handful of StyleSwap back covers that are replaceable. Some of the back covers include<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Bamboo, Black Apricot, Kevlar, and Rosewood</strong>. The best part is that all the covers are made up of real wood and DuPont Kevlar. If you want one, you can buy them separately.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Back-Covers-of-OnePlus-2.jpg"><img class="aligncenter size-full wp-image-2965" src="http://mobda.com/wp-content/uploads/2015/10/Back-Covers-of-OnePlus-2.jpg" alt="Back Covers of OnePlus 2" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we see the customization side of the phone, you get the removable cover, which will give you the access to the compartment of dual-nanoSIM. However, still you cannot take out the battery of the phone.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The complete OnePlus 2 is guarded by the piece of Gorilla Glass 4, which twice the scratch resistance of the device as compared to its predecessor. However, you may find your fingerprint impressions over the glass in the front sometimes.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With a screen size of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.5”</strong>, the OnePlus 2 is rather a heavy device bearing the weight of around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">175g.<span class="Apple-converted-space">&nbsp;</span></strong>Although, the sandstone texture is superb and provides an awesome grip.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display of OnePlus 2</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we talk about the display of OnePlus 2, it is nothing short of its predecessor. It comes with the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Japan Display-made 5.5”<span class="Apple-converted-space">&nbsp;</span></strong>that gives a resolution of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1080 x 1920</strong><span class="Apple-converted-space">&nbsp;</span>with a pixel density of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">401ppi.</strong></p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/OnePlus-2-HomeScreen.jpg"><img class="aligncenter size-full wp-image-2968" src="http://mobda.com/wp-content/uploads/2015/10/OnePlus-2-HomeScreen.jpg" alt="OnePlus 2 HomeScreen" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Another unique thing about the display of OnePlus 2 is that it is an LTPS unit, and a low temperature polysilicon LCD. It means that the device will not heat much when you will increase the brightness to the maximum and that also for long periods.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery of OnePlus 2</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">OnePlus 2 has an extremely powerful battery. A non-replaceable battery of 3,300mAh, which gives around 6.5% more power than the predecessor does, which is a huge upgrade, powers the device.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With the improved<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3G talk time of around 31 hours,<span class="Apple-converted-space">&nbsp;</span></strong>OnePlus 2 has disappointed in the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">web browsing hours (8 hours), and video playback time (8.5 hours),<span class="Apple-converted-space">&nbsp;</span></strong>giving it an endurance rating of around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">61 hours.</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Software Overview – OnePlus 2</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The original OnePlus One came with the CyanogenMod but due to some issues, OnePlus has come up with its original launcher, dropping the Cynogen completely. In this way, the new OS<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Oxygen<span class="Apple-converted-space">&nbsp;</span></strong>was born and is currently in its version 2.0 phase.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/OnePlus-2-OS.jpg"><img class="aligncenter size-full wp-image-2969" src="http://mobda.com/wp-content/uploads/2015/10/OnePlus-2-OS.jpg" alt="OnePlus 2 OS" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The launcher of Oxygen OS gives you the near vanilla Android experience. However, OnePlus has added some of the new but important software tricks to it.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">OnePlus has also added the support for fingerprint security in the device and drivers for the new Type-C USB Port. Both of these features are going to be the part of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android 6.0 Marshmallow,<span class="Apple-converted-space">&nbsp;</span></strong>which is going to be the next OS of OnePlus 2.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Around four very useful features, OnePlus has added in the OnePlus 2 phones, which are even available if your screen is turned off. These are: if you want to wake up the phone, just double tap it; to open the camera without switching on the screen, just draw an<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">O</strong><span class="Apple-converted-space">&nbsp;</span>on the screen; if you want to On/Off the flash light, just draw a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">V</strong>; or just draw<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">&lt;&gt;</strong><span class="Apple-converted-space">&nbsp;</span>to go to previous/next track.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Another action that you can perform without waking up the phone is to unlock it with fingerprints. Yes, just place your finger and the home screen will appear in front of you.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">OnePlus also has added some of its own unique features. For example, you have the option to reverse the App Switcher and Menu keys; you can configure the LED colors for notifications and some more.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera of OnePlus 2</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">OnePlus 2 is fitted with a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">13MP OIS</strong><span class="Apple-converted-space">&nbsp;</span>camera on its back. It has laser assisted autofocus, optical image stabilization and 4K video recording. With the installed Oxygen Os, you get a custom camera app, which gives extremely clean interface along with a few settings. There are many modes to choose from; some of which include Video, Panorama, Photo, Slow Motion and Time-Lapse.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/OnePlus-2-Camera.jpg"><img class="aligncenter size-full wp-image-2970" src="http://mobda.com/wp-content/uploads/2015/10/OnePlus-2-Camera.jpg" alt="OnePlus 2 Camera" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">However, here is a bit disappointment for you. The camera does not include the proper image viewer; instead, you can just see the preview of the last photo you have taken. Once you click on the image, you will be redirected to the gallery.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">While taking photos in low light conditions, you can experience a little delay between the pressing of the on-screen shutter key and actual time of taking the photo.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you are a selfie lover, here is a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5MP<span class="Apple-converted-space">&nbsp;</span></strong>front camera installed in the device, which gives a superb quality photo that you can upload on social networks.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Conclusion</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">OnePlus 2 is a great choice over the more expensive alternatives with same specifications. Moreover, if the company lives up to its expectations, OnePlus 2 can experience the great sales.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/OnePlus2-Conclusion.jpg"><img class="aligncenter size-full wp-image-2967" src="http://mobda.com/wp-content/uploads/2015/10/OnePlus2-Conclusion.jpg" alt="OnePlus2 Conclusion" width="600" height="400"></a></p><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">With the great design, superb specs, latest software and many new features, OnePlus 2 is one of the best choices for you to go with. The new device with the new design having metal all over it has improved the overall feel of holding the device.</span>                                      	</div>', '/image/uploads_productReview_productReviewImage-274600-1484680350.jpg', 1, '2017-01-17 13:42:31', '2017-01-17 14:13:51');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(12, 401, 'Samsung Galaxy Note5 Review', 'This Samsung Galaxy Note5 have great review', '<div class="new_description "><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">Samsung Galaxy Note5, as you may be aware of, is the fourth successor of the device that introduced the proper definition of a phablet to the world. It is, no doubt, the most deep-seated release in the Note family.</span><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Samsung-Galaxy-Note-5-Review.jpg"><img class="aligncenter size-full wp-image-2955" src="http://mobda.com/wp-content/uploads/2015/10/Samsung-Galaxy-Note-5-Review.jpg" alt="Samsung Galaxy Note 5 " width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Whenever we talk about the Note family, the expectations for high specs automatically burgeon, and Samsung has never disappointed us in the same. In its latest iteration, Galaxy Note5 has one of the most powerful chipset available in the business, best camera, and fastest memory. Moreover, the S pen is more productive and clickable than ever.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">To ensure that you are holding a premium device, Samsung has given it a brand new look and used premium material as per the hardware requirements.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Unboxing Samsung Galaxy Note5</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You may be surprised by looking the retail box of Samsung Galaxy Note5 as it has the same design as that of Samsung Galaxy S6. Inside the retail box, you will find the wall charger, handset, stereo headset, and the S pen’s replacement tips.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Unboxing-Galaxy-Note-5.jpg"><img class="aligncenter size-medium wp-image-2956" src="http://mobda.com/wp-content/uploads/2015/10/Unboxing-Galaxy-Note-5-225x300.jpg" alt="Unboxing Galaxy Note 5" width="225" height="300"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Apart from the standard accessory, Samsung has provided with a lot more secondary or optional accessories for its flagship phablet. &nbsp;Some of the optional accessories include the hardware keyboard case, hardware Task switcher/Home/Back buttons and many more.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Build Quality &amp; Design of Samsung Galaxy Note5</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">There is no doubt that the Samsung Galaxy Note5 is a huge device. The dimension and weight of the Samsung Galaxy Note5 are<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">153.2 x 76.1 x 7.6</strong><span class="Apple-converted-space">&nbsp;</span>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">171 grams<span class="Apple-converted-space">&nbsp;</span></strong>respectively and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.7”<span class="Apple-converted-space">&nbsp;</span></strong>display. The Samsung Galaxy Note5 has dominated the phone design with awesome fusion of metal and glass. Moreover, one of the most distinctive features of the Samsung Galaxy Note5 is its back that has curves at its edges. Samsung has given the unique touch to the device as of now.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Colors-of-Note5.png"><img class="aligncenter size-full wp-image-2957" src="http://mobda.com/wp-content/uploads/2015/10/Colors-of-Note5.png" alt="Colors of Note5" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The color of Samsung Galaxy Note5 include the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Black Sapphire, Gold Platinum, White Pearl<span class="Apple-converted-space">&nbsp;</span></strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Silver Titanium.<span class="Apple-converted-space">&nbsp;</span></strong>The color availability of the handsets may vary as per the market requirements.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy Note5’s build quality is outstanding because it is completely made up of the metal and Corning Gorilla Glass 4. However, despite of these ingredients, for your safety, a protective case is recommended to you.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With this weight of 171 grams, the Samsung Galaxy Note5 is comparatively lighter than its predecessor is, despite of the use of more materials. However, people with small hands may find the device slippery at times. Therefore, it is highly recommended that you go with the protective case.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy Note5 is installed with a 5.7”<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Super AMOLED<span class="Apple-converted-space">&nbsp;</span></strong>display, has QHD 2560 x 1440 resolution, and gives the pixel density of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">518ppi.<span class="Apple-converted-space">&nbsp;</span></strong>With the Screen mode settings, you can set the saturation, contrast and color temperature as per your convenience. Moreover, if you will increase the brightness slider, you may even reach the brightness level of LCD and can give you the screen brightness of up to<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">620nits<span class="Apple-converted-space">&nbsp;</span></strong>with the color saturation and screen contrast making it the brightest SuperAMOLED Samsung device that has ever come. Moreover, the legibility of sunlight for Samsung Galaxy Note5 is superb. It means, even if you are using your phone in direct sunlight, you can easily read your emails, open and close apps and do other important stuffs with your phone.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery of Samsung Galaxy Note5</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy Note5 is equipped with the non-removable<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3,000mAh Li-Po<span class="Apple-converted-space">&nbsp;</span></strong>battery, which is 220mAh less than its predecessor is. However, despite of the smaller battery, the Samsung Galaxy Note5 performs and gives almost the similar results as its older version. The endurance rating that the Note5 has given is of 85 hours, which means you can use the device for straight three days with an hour use of video playback, telephone, and web browsing every day. In addition to this, the Samsung Galaxy Note5 can give you around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">29 hours of 3G Talk Time, 11 hours of Web Browsing and 14 hours of video playback.</strong></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You will be amazed to know that the Samsung’s new quick charger can fill the battery in less than 90 minutes from empty, making it extremely efficient and convenient to use. On the other hand, with the help of wireless charging, the phone is completely full in just 120 minutes.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">S Pen of Samsung Galaxy Note5</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The most useful part of Samsung Galaxy Note5 is the S Pen. Once again, the S Pen has come up with many improvements as compared to the last year’s version. The S Pen or the Stylus is using the new release mechanism that needs the user to click on the top before taking it out. Doing so has completely removed the accidental possibility of its coming out.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Once again, your favorite Signature side button is available on the S Pen giving the smooth textures and thereby making it a little slippery as compared to its predecessor.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/S-Pen-Galaxy-Note5.jpg"><img class="aligncenter size-full wp-image-2958" src="http://mobda.com/wp-content/uploads/2015/10/S-Pen-Galaxy-Note5.jpg" alt="S Pen Galaxy Note5" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Not only the hardware of S Pen, but also the software has improved in various ways. Now you can take the notes even with the screen off. It means just take out the stylus and start writing, even if your screen is off.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">There are also huge improvements in the Air command. Now you can make it float anywhere you want on the screen. Moreover, you can add the custom shortcuts for three apps that you like the most.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Specifications</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy Note5 is fitted with the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Exynos 7420</strong><span class="Apple-converted-space">&nbsp;</span>chipset, developed by the Samsung, and has<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1.5 GHz quad-core Cortex-A53, 2.1 GHz quad-core Cortex-A57 CPU, Mali-T760MP8 GPU</strong>, and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">4GB of RAM.<span class="Apple-converted-space">&nbsp;</span></strong>In short, the hardware setup is equivalent to the Samsung Galaxy S6 and Galaxy S6 Edge.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With all the aforementioned specs, the Samsung Galaxy Note5 is one of the most powerful smartphones available in the market today.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera of Samsung Galaxy Note5</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Samsung Galaxy Note5 is installed with the awesome<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">16MP Sony IMX240<span class="Apple-converted-space">&nbsp;</span></strong>sensor and an<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">f/1.9</strong><span class="Apple-converted-space">&nbsp;</span>lens. One of the best features is the quick launch. Just double press the Home key from anywhere in the UI and the camera is in front of you in less than a second.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You can find the majority of the settings in the viewfinder, making the camera UI pretty simple and user friendly. Moreover, you also get an option to download the new shooting modes.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Camera-Samsung-Galaxy-Note5.jpg"><img class="aligncenter size-full wp-image-2959" src="http://mobda.com/wp-content/uploads/2015/10/Camera-Samsung-Galaxy-Note5.jpg" alt="Camera Samsung Galaxy Note5" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you are a creative human being and love to play with your photos, Samsung Galaxy Note5’s camera is for you. It can capture the images in the RAW format, which can later be converted into the creative ones.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Conclusion</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy Note5 is one of the best-looking phablet by now. However, you do not get the microSD slot and no 128 GB built in memory, but its 32 GB and 64 GB internal options is sufficient to store all your data. Moreover, not only the best looking but the Samsung Galaxy Note5 is one of the most powerful phablets present in the market today.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Samsung-Galaxy-Note-5.jpg"><img class="aligncenter size-full wp-image-2960" src="http://mobda.com/wp-content/uploads/2015/10/Samsung-Galaxy-Note-5.jpg" alt="Samsung Galaxy Note 5" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Equipped with numerous new features and tricks and its clickable release mechanism, the S Pen has proved it again that it is one of the best stylus in the market. Apart from stylus, the 5.7” QHD display and 16MP camera has done a complete justice to the device.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Even with the lack of microSD and a removable battery, Samsung Galaxy Note5 is for everyone who have a budget to pick one.</p>                                      	</div>', '/image/uploads_productReview_productReviewImage-521929-1484680580.jpg', 1, '2017-01-17 13:46:20', '2017-01-17 14:13:51');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(13, 14, 'Apple iPhone6S Plus Review', 'This Apple iPhone6S Plus have great review', '<div class="new_description "><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Introduction</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The iPhone6S Plus is a second-generation phablet. It is a project, which Apple was neglecting from a long time to be attached with. Being an S model means that the design of last year and changes are still under the hood.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/iPhone6S-Plus-Review.jpg"><img class="aligncenter size-full wp-image-2937" src="http://mobda.com/wp-content/uploads/2015/10/iPhone6S-Plus-Review.jpg" alt="iPhone6S Plus Review" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Following their rule to make it simpler, Apple has introduced the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3D Touch</strong><span class="Apple-converted-space">&nbsp;</span>in the device, making your interaction with the Smartphone meaningful.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Unboxing iPhone6S Plus</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Unboxing-iPhone6S-Plus.jpg"><img class="aligncenter size-full wp-image-2939" src="http://mobda.com/wp-content/uploads/2015/10/Unboxing-iPhone6S-Plus.jpg" alt="Unboxing iPhone6S Plus" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The iPhone6S Plus comes in the similar retail package as its predecessors, and the phone is printed on it reflecting its contents. Beneath the phone, there is the AC adapter, a meter-long USB-to-lightning cable, and a bundled headset.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Design &amp; Colors of Apple iPhone6S Plus</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Apple iPhone6S Plus has got a huge display with the size<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">158.2 x 77.9 x 7.3mm<span class="Apple-converted-space">&nbsp;</span></strong>and a weight of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">192g.</strong></p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Colors-of-iPhone6S-Plus.jpg"><img class="aligncenter size-full wp-image-2940" src="http://mobda.com/wp-content/uploads/2015/10/Colors-of-iPhone6S-Plus.jpg" alt="Colors of iPhone6S Plus" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we talk about the color, Apple has deliberately launched an unique color for the Plus unit. The majority of the people out there are calling it<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Pink,<span class="Apple-converted-space">&nbsp;</span></strong>however, Apple is calling it<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Rose Gold.<span class="Apple-converted-space">&nbsp;</span></strong>Apart from this, the other colors of iPhone6S plus include<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Space Gray, Silver &amp; Gold.</strong></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With its size and weight, you can call it a man’s phone; however, carrying it inside your pocket is still not possible. Therefore, it is better you keep it inside a purse and you know the reasons.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The screen size of the iPhone6S Plus is<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5.5 inches<span class="Apple-converted-space">&nbsp;</span></strong>with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">IPS LCD display<span class="Apple-converted-space">&nbsp;</span></strong>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1080 x 1920<span class="Apple-converted-space">&nbsp;</span></strong>pixels resolution that gives the density of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">440ppi</strong>, getter than the retina display. The display of iPhone6S plus is brighter than the iPhone6S; however, because of a little brighter blacks, both the devices have almost similar contrast ratios of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1382:1.</strong></p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Display-of-iPhone6S-Plus.jpg"><img class="aligncenter size-full wp-image-2941" src="http://mobda.com/wp-content/uploads/2015/10/Display-of-iPhone6S-Plus.jpg" alt="Display of iPhone6S Plus" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Compared to the older model, the new iPhone6S Plus has got the better sunlight legibility with the highest ranking for its LCD panels in the test.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With the decrease from 2,915mAh, the battery of current iPhone6S Plus is<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2,750mAh.<span class="Apple-converted-space">&nbsp;</span></strong>However, the company claims that there will not be any difference in the performance of the same. If we talk about the performance of battery, we can easily get around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">16 hours of 3G calling, 14 hours of video playback, around 12 hours of web browsing</strong>. So, if talk about the endurance rating of iPhone 6S Plus, it comes to around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">85hours.</strong></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">&nbsp;</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Software of iPhone6S Plus- Apple iOS 9</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">As usual, Apple launched its iOS 9 in June. However, it did not cause much of the excitement because of lookalike of the iOS 8 and adding only a few new features. But with the launch of iPhone6S and iPhone6S Plus its very important feature was brought into the light. It is that, it supports the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3D Touch</strong><span class="Apple-converted-space">&nbsp;</span>display and the APIs that will be available for the app and game developers.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/iOS-9.jpg"><img class="aligncenter size-full wp-image-2942" src="http://mobda.com/wp-content/uploads/2015/10/iOS-9.jpg" alt="iOS 9" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With the introduction of 3D Touch, we have reached to another level of interaction with the smart phones. Pressing the screen for a bit harder and longer duration gives the contextual options and extra actions.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The iOS 9 also brings in a few new apps that include – News and Notes, and at the same time giving the public transit support to the Maps. Addition of the new system font is also refreshing the Mails and messages. Your favorite<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Siri<span class="Apple-converted-space">&nbsp;</span></strong>also got smarter.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3D Touch</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">This one unique feature has completely changed the way we use our smart phones. However, the 3D Touch option is available only on limited apps. 3D Touch can be used on the lock screen, within the apps and the home screen.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/iPhone6S-Plus-3D-Touch.jpg"><img class="aligncenter size-full wp-image-2943" src="http://mobda.com/wp-content/uploads/2015/10/iPhone6S-Plus-3D-Touch.jpg" alt="iPhone6S Plus- 3D Touch" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">For example, if you will force press the Message icon, it will pop up with a balloon showing you the New Message shortcut and a small list of your contacts to which you have just messaged. Similarly, this force press on the Phone app will pop up the Create New Contact option and a list of recently called people.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If the 3D Touch technology becomes famous, it can greatly boost the smartphone usage and industry in the upcoming years. It can be the case similar to the multi-touch or the fingerprint sensor that Apple brought into the market.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Performance of Apple iPhone6S Plus</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">All the new generation iPhones are fitted with Apple’s brand new<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">A9 chipset</strong>, which has a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">dual-core 1.85 GHz Typhoon Processor</strong>,<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">PowerVR GT7600 six-core Graphics</strong><span class="Apple-converted-space">&nbsp;</span>and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2GB of RAM</strong>. This A9 chipset has the enhanced processing power, doubling the RAM, improved thermal properties and a stronger GPU punch.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">After sticking with the 8MP camera for around four generations, Apple has come up with the brand new upgrade of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">12MP camera</strong><span class="Apple-converted-space">&nbsp;</span>to all its latest iPhone6S and iPhone6S Plus. Not only the back camera, but the front camera also got a brand new<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5MP</strong><span class="Apple-converted-space">&nbsp;</span>camera as well. Both the cameras, primary and secondary, are equipped with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">F/2.2 aperture lens</strong>.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/Camera-iPhone6S-Plus.jpg"><img class="aligncenter size-full wp-image-2944" src="http://mobda.com/wp-content/uploads/2015/10/Camera-iPhone6S-Plus.jpg" alt="Camera-iPhone6S Plus" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The new 12MP camera, along with the brand new A9 chipset, allows iPhone6S Plus to take<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">4K video recording</strong><span class="Apple-converted-space">&nbsp;</span>in almost all the modes and it also enables it to take the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Live Photos.</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Disadvantages</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">So, this is the brand new Apple iPhone6S Plus. No matter how much the device is perfect, there are always some disadvantages into it. So, let us have a look into some of the disadvantages of Apple’s brand new iPhone6S Plus.</p><ul style="padding: 0px 0px 10px; margin: 0px 0px 0px 30px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Heavy</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No microSD slot</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Pricey memory upgrades, 32GB version should be standard for such an expensive phone</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No user-replaceable battery</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Protruding camera lens makes the phone wobble if you don’t have a case on</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">NFC functionality limited to Apple Pay</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No wireless charging, an infrared port, or FM radio</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Mediocre screen-to-body ratio</li></ul>                                      	</div>', '/image/uploads_productReview_productReviewImage-726303-1484680796.jpg', 1, '2017-01-17 13:49:56', '2017-01-17 14:13:52');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(14, 664, 'Samsung Galaxy S6 Edge Review', 'This Samsung Galaxy S6 Edge have great review', '<div class="new_description "><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">What impact can a small change make? Not much or very much. Samsung Galaxy S6 Edge, a phone with only the extra curved screen is the real difference that you feel when you hold the S6 Edge and S6 in your hands.<br><br></span><div style="text-align: center;"><figure id="attachment_2921" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/10/71.png"><img class="size-full wp-image-2921" src="http://mobda.com/wp-content/uploads/2015/10/71.png" alt="Samsung Galaxy S6 Edge" width="600" height="400"></a><figcaption class="wp-caption-text">Samsung Galaxy S6 Edge</figcaption></figure></div><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Introduction</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we look at the key features of S6 and S6 Edge, the two Galaxy phones share a few of the best components&nbsp; that are present in the market, both have the same software that is built on new values that is matching the ideology of new hardware.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Before we dig deep into the aspects of Samsung Galaxy S6 Edge, let us have a look at the key features of it. However, while reading the key features, you may have a ‘Déjà vu’ feeling.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With the launch of Galaxy S6, Samsung has made the first attempt in such design approach where the metal frame with the dual-glass build – front and back – has come into the market by excelling in its implementation. The Galaxy S6 Edge has taken this approach even further to make it feel more special for people. However, with just minor change, is it worth making the device overly priced? We will figure it out.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">To inform you, the Samsung Galaxy S6 Edge will come with the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">64GB of storage</strong><span class="Apple-converted-space">&nbsp;</span>in its base version. Therefore, we may say that with this burgeoned price we are not only getting the more storage, but also a lot more things that we will check.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The size of the Samsung Galaxy S6 Edge is completely same as the Galaxy S6. The curved edge at the side of the phone has not affected the width, length or the height of the phone. However, it does have reduced the thickness of the phone by 0.2mm, which is hard to notice.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Unboxing Samsung Galaxy S6 Edge</strong></h3><div style="text-align: center;"><figure id="attachment_2923" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/10/61.png"><img class="size-full wp-image-2923" src="http://mobda.com/wp-content/uploads/2015/10/61.png" alt="Unboxing Galaxy S6 Edge" width="600" height="400"></a><figcaption class="wp-caption-text">Unboxing Galaxy S6 Edge</figcaption></figure></div><figure id="attachment_2923" class="wp-caption aligncenter" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); width: 600px;"><figcaption class="wp-caption-text" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Unboxing Galaxy S6 Edge</figcaption></figure><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The most excited part is to check what is there inside the box. So, to end this excitement, let us unbox the Galaxy S6 Edge. However, there is no difference in the retail package of Galaxy S6 Edge and its sibling, Galaxy S6. Inside the box you can find the fast-charge adapter, which the company claims can charge the phone for<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">4-hours usage</strong><span class="Apple-converted-space">&nbsp;</span>in just<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">10 minutes</strong><span class="Apple-converted-space">&nbsp;</span>along with the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2-hours video playback</strong><span class="Apple-converted-space">&nbsp;</span>of HD videos. Apart from this, you get a detachable microUSB cable, which you can use to transfer data and to charge your phone. There is also a brand new Samsung headset with the earplugs and a three button remote and flat, and a tangle free cable. One more thing you get inside the box is the ‘SIM ejector tool.’</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Build Quality &amp; Design of Samsung Galaxy S6 Edge</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">By introducing the bending screens in its phones, Samsung had just one goal in mind – to make the phone more attractive. With the attempt of bending one side of the screen in Note Edge, the Galaxy S6 Edge has both of its side bent. The primary aim of the screen bending is to enhance the UI and this idea has worked really great. However, these bent sides are treated as the part of the same screen.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">In the Galaxy S6 Edge, sides are not as curved as in the Note Edge, but the side swiping experience is smoother in the S6 Edge than in the Note Edge. The design guidelines of Android to put options in either of the sides of screen have promoted the adoption of such gestures. Adding to that, Samsung has induced more functionality into it, which works well with the sideswipes and capitalizes the working of these gestures.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Not only the functionality, but the curved screens also improve the looks of the device. The screen shape of Galaxy S6 Edge is unique in the market and giving quite good looks to the device.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy S6 Edge has a complete metal frame that is exposing the sides of the phone. As the curved screen is pushing the sides back, they are a little thinner than the usual size. Still there is enough space so that the volume keys on the left and power key on the right can fit. However, the SIM slot had to shift a bit.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">As the Samsung Galaxy S6 Edge is one of the newest designs in the market, you may find it unusual while holding the device.&nbsp; It is a bit wider at the back than its front, making you feel a bit odd. If you will provide the necessary grip to the device, it will dig inside your arms. Doing so makes you feel that the phone is thinner than it actually is and is extremely comfortable in your hands.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">In the Galaxy S6 Edge, you get the no-swipe fingerprint sensor incorporated in the hardware home key at the bottom of the screen. The length of the key is taller than before and it is easy to position your finger on it, allowing it to detect your finger at any angle.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Home key will also work as the quick launch key for the camera. You just need to press the key twice in a quick succession and instantly you can see the camera is ready for you to take beautiful pictures. The unique part is, it works even when your phone is locked and screen is off.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">At the back of the phone and beside the flash, there is a heart rate monitor, which can measure the blood-oxygen saturation, also known as SpO2. It is used to grab the biometric data and is in conjunction with S health. You can also use this to start the selfies camera.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy S6 Edge is fitted with two sheets of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Gorilla Glass 4<span class="Apple-converted-space">&nbsp;</span></strong>on the back and front side with having a slight curve on the back around the edges.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Presently, you can get the Samsung Galaxy S6 Edge in<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">White Pearl, Black Sapphire, Gold Platinum and Green Emerald<span class="Apple-converted-space">&nbsp;</span></strong>colors. You can see a subtle change in color of the device, depending on the color of light surrounding it. The<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Green Emerald<span class="Apple-converted-space">&nbsp;</span></strong>color is the exclusive one of the S6 Edge, similar to the Topaz Blue color for Galaxy S6.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you will have a look at the bottom of the phone, you may find it a bit buried. It has the 3.5mm audio jack, loudspeaker, microUSB 2.0 port and a mouthpiece, all gathered up at the bottom.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">On the other hand, the top of Galaxy S6 Edge has got a new component, the nanoSIM slot and the secondary mic for noise cancellation.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display of Samsung Galaxy S6 Edge</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Galaxy S6 Edge has a Super AMOLED screen with a 5.1” display and a QHD resolution of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1,440 x 2,560px</strong>. The brightness in the S6 Edge has got a little boost, which you can get it to approximately<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">470nits<span class="Apple-converted-space">&nbsp;</span></strong>manually. On the other hand, if you will leave the brightness to auto, you can get it to an impressive<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">750nits,<span class="Apple-converted-space">&nbsp;</span></strong>brighter than most of the LCDs present in the market.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With the Galaxy S6 Edge, Samsung has completely nailed the accuracy of colors, displaying the uniform colors all over the device, including the curved section of the device. The legibility of sunlight is better than ever, and the lamination of Gorilla Glass 4 to the AMOLED display below it reduces the reflection to a great extent. However, you may find a little reflection from the curved sides but not enough to be an issue.</p><div style="text-align: center;"><figure id="attachment_2924" style="width: 600px;" class="wp-caption aligncenter"><img class="wp-image-2924 size-full" src="http://mobda.com/wp-content/uploads/2015/10/33.png" alt="Display of Samsung Galaxy S6 Edge" width="600" height="400"></figure></div><figure id="attachment_2924" class="wp-caption aligncenter" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); width: 600px;"><figcaption class="wp-caption-text" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Display of Samsung Galaxy S6 Edge</figcaption></figure><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">In the Samsung Galaxy S6 Edge, you get three preset<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display Modes</strong><span class="Apple-converted-space">&nbsp;</span>to change the color saturation and white balance of the device. Depending on your personal preference, you can get more accurate and bolder colors options.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery of Samsung Galaxy S6 Edge</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">In the Samsung Galaxy S6 Edge, you get a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2,600mAh Li-Ion, non-removable<span class="Apple-converted-space">&nbsp;</span></strong>battery. To get a four hours charge in just 10 minutes, use the fast-charging adapter from the retail box.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">For the Galaxy S6 Edge, the company has enabled the wireless charging that support two existing standards. The first is<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Qi</strong>, which is used in Nexus and Lumia phones and the other standard wireless charging is the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">PMA,<span class="Apple-converted-space">&nbsp;</span></strong>which you can find in some of the Starbucks locations and is extremely popular in the US. With the endurance rating of 73, we can expect a three days full casual usage of the phone and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">20 hours of 3G talk time</strong>. However, with the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Edge Strip</strong><span class="Apple-converted-space">&nbsp;</span>on, the endurance rating of the Galaxy Edge S6 drops to<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">54 hours.</strong></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">&nbsp;</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">User Interface of Samsung Galaxy S6 Edge</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Samsung Galaxy S6 Edge is loaded with the latest incarnation of TouchWiz and the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android 5.0.2 Lollipop.<span class="Apple-converted-space">&nbsp;</span></strong>The Samsung Galaxy S6 Edge has almost similar features to the S6, adding a few features that are spanning around the curved edges of the device.</p><div style="text-align: center;"><figure id="attachment_2927" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/10/41.png"><img class="size-full wp-image-2927" src="http://mobda.com/wp-content/uploads/2015/10/41.png" alt="Home Screen of Galaxy S6 Edge" width="600" height="400"></a><figure id="attachment_2927" class="wp-caption aligncenter" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); width: 600px;"><figcaption class="wp-caption-text" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Home Screen of Galaxy S6 Edge</figcaption></figure><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Samsung has worked on the addition of new features along with simplifying its software. You get both the dialer and camera shortcuts on the lock screen. The private mode is back in the Samsung Galaxy S6 Edge along with the enhanced fingerprint reader.</p><h4 style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; text-transform: capitalize; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-indent: 0px; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Edge Screen Of Galaxy S6 Edge</strong></h4></figure></div><div style="text-align: center;"><figure id="attachment_2925" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/10/23.png"><img class="size-full wp-image-2925" src="http://mobda.com/wp-content/uploads/2015/10/23.png" alt="Curved Screen of Galaxy S6  Edge" width="600" height="400"></a><figure id="attachment_2925" class="wp-caption aligncenter" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); width: 600px;"><figcaption class="wp-caption-text" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Curved Screen of Galaxy S6 Edge</figcaption></figure><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">By default, the edge display features are turned off. Therefore, if you want to activate it, go to</p><h6 style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: center;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Settings&gt;Edge Display</strong></h6><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Out of all the important features,<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Night Clock</strong><span class="Apple-converted-space">&nbsp;</span>is the one that is highlighted in the edge screen display and shows the time and date at one of the strips.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">&nbsp;</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The camera on the Samsung Galaxy S6 Edge is a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">16MP Sony IMX240 sensor<span class="Apple-converted-space">&nbsp;</span></strong>with a wider,<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">f/1.9</strong><span class="Apple-converted-space">&nbsp;</span>aperture, allowing more light and gives a better<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">bokeh</strong><span class="Apple-converted-space">&nbsp;</span>effect. You get an option of quick launch to turn on the camera in the phone. To achieve this, you just need to double press the Home key from random UI location.</p></figure></div><div style="text-align: center;"><figure id="attachment_2928" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/10/15.png"><img class="size-full wp-image-2928" src="http://mobda.com/wp-content/uploads/2015/10/15.png" alt="Camera of Galaxy S6 Edge" width="600" height="400"></a><figure id="attachment_2928" class="wp-caption aligncenter" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); width: 600px;"><figcaption class="wp-caption-text" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Camera of Galaxy S6 Edge</figcaption></figure><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we talk about the panorama shots from the Galaxy S6 Edge, they are of very high resolution – approximately 3,200px tall, if you are holding the phone upright and around 1,800px if you are holding the phone by side.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Disadvantages</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Some of the disadvantages of the Samsung Galaxy S6 Edge include:</p><ul style="padding: 0px 0px 10px; margin: 0px 0px 0px 30px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Pricier than its sibling, with only the curved screen to show for it</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No water or dust protection</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No user-replaceable battery</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No microSD slot</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No FM radio</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No stereo speakers</li></ul></figure></div></div>', '/image/uploads_productReview_productReviewImage-773846-1484681114.png', 1, '2017-01-17 13:55:15', '2017-01-17 14:13:52');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(15, 574, 'Samsung Galaxy S6 Review', 'This Samsung Galaxy S6 Review have great review', '<div class="new_description "><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you ask us to describe Samsung Galaxy S6 in few words, then those words will be Powerful, Awesome, Stunning, and Unique. With the launch of Galaxy S6, Samsung has gone for its complete overhaul.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Introduction</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/9.png"><img class="aligncenter wp-image-2593 size-full" src="http://mobda.com/wp-content/uploads/2015/10/9-e1444628895200.png" alt="Samsung Galaxy S6 Review" width="600" height="450"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You can say there have been a message they wanted us to convey from long back. And if it is to remove the memory card slot, and to&nbsp;install a non-removable battery, then let us accept it.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Samsung has completely recreated the Galaxy S6 from the scratch by saying good-bye to plastic and installing it with glass and metal. This installation is one of the best and critically acclaimed combinations present at this time.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">We know that the absence of memory card slot and the removable battery is making you upset. However, by doing so, it is clear that Samsung is trying to copy the Apple &amp; Sony brands.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">No matter how much these things upset you, there is a lot more to look into this flagship product of Samsung. So, let’s see what has it got under its hood in details.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">In Galaxy S6, Samsung has completely shifted to its own<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Exynos Platform</strong><span class="Apple-converted-space">&nbsp;</span>for the first time. The primary rumored reason for the decision was the cooling issues with the predecessors and thermal strangling with the Snapdragon 810 chipset. However, the main reason is just that<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Exynos 7420 (7 Octa)</strong><span class="Apple-converted-space">&nbsp;</span>is better. Exynos is built on 14nm process that permits the higher or similar clockspeeds thereby higher performance along with less power consumption. It means the device will cool down easily.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Looks &amp; Colors</strong></h3><div style="text-align: center;"><figure id="attachment_2596" style="width: 300px;" class="wp-caption alignleft"><a href="http://mobda.com/wp-content/uploads/2015/10/22.png"><img class="wp-image-2596 size-medium" src="http://mobda.com/wp-content/uploads/2015/10/22-300x225.png" alt="Black Sapphire" width="300" height="225"></a><figcaption class="wp-caption-text">Black Sapphire</figcaption></figure></div><div style="text-align: center;"><figure id="attachment_2598" style="width: 300px;" class="wp-caption alignright"><a href="http://mobda.com/wp-content/uploads/2015/10/7.png"><img class="wp-image-2598 size-medium" src="http://mobda.com/wp-content/uploads/2015/10/7-300x225.png" alt="Gold Platinum" width="300" height="225"></a><figcaption class="wp-caption-text">Gold Platinum</figcaption></figure></div><div style="text-align: center;"><figure id="attachment_2597" style="width: 300px;" class="wp-caption alignleft"><a href="http://mobda.com/wp-content/uploads/2015/10/32.png"><img class="wp-image-2597 size-medium" src="http://mobda.com/wp-content/uploads/2015/10/32-300x225.png" alt="Blue Topaz" width="300" height="225"></a><figcaption class="wp-caption-text">Blue Topaz</figcaption></figure></div><div style="text-align: center;"><figure id="attachment_2599" style="width: 300px;" class="wp-caption alignright"><a href="http://mobda.com/wp-content/uploads/2015/10/11.png"><img class="wp-image-2599 size-medium" src="http://mobda.com/wp-content/uploads/2015/10/11-300x225.png" alt="White Pearl " width="300" height="225"></a><figcaption class="wp-caption-text">White Pearl</figcaption></figure></div><p>&nbsp;</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">By looking at the model, we can say that the Samsung has done the perfect justice with its trademark AMOLED and is a superb match with the brand name. Samsung is calling the Galaxy S6 as “the best ever” phone, and they will definitely be right.&nbsp; With 5.1 inches of QHD resolution, Galaxy S6 has an impressive 557ppi.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Samsung has also surprised with the launch of new colors in the Galaxy S6. The four official colors of Galaxy S6 include<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Black Sapphire, Gold Platinum, White Pearl and Blue Topaz.</strong></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Key Features</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Before we dig deep into the details of Samsung’s new baby, let us have an overview of its features.</p><ul style="padding: 0px 0px 10px; margin: 0px 0px 0px 30px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Thin (6.8mm) profile, premium dual-glass design reinforced by a metal frame</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">1″ Super AMOLED of QHD (1440 x 2560) resolution, class-leading ~577ppi, Corning Gorilla Glass 4</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Exynos 7420 64-bit chipset, octa core processor with four 2.1GHz Cortex-A57’s and four 1.5GHz Cortex-A53 cores, Mali-T760 MP8 GPU, 3GB of RAM</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Android 5.0.2 Lollipop with TouchWiz and Samsung Pay</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">16MP camera, f/1.9 aperture, 4K video recording, LED flash, optical image stabilization</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">5MP front-facing camera, f/1.9 aperture, QHD video, HDR</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">32/64/128 GB of built-in storage</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Active noise cancellation via dedicated mic</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Fingerprint scanner</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">LTE Cat.6, Wi-Fi a/b/g/n/ac, GPS/GLONASS/Beidou, NFC, IR port, Bluetooth 4.1, ANT+</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Heart-rate sensor, barometer, SpO2</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Wireless charging (Qi/PMA)</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">2,550mAh battery</li></ul><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Galaxy S6: Unboxing</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Now comes the time to check what’s there inside the retail package of Samsung Galaxy S6. So, the white, solid box consists of the device, a fast-charging A/C adapter, microUSB cable and Samsung’s own latest set of headphones.</p><div style="text-align: center;"><figure id="attachment_2622" style="width: 800px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/10/13.png"><img class="wp-image-2622 size-full" src="http://mobda.com/wp-content/uploads/2015/10/13.png" alt="Unboxing Samsung Galaxy S6" width="800" height="600"></a><figure id="attachment_2622" class="wp-caption aligncenter" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); width: 800px;"><figcaption class="wp-caption-text" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Unboxing Samsung Galaxy S6</figcaption></figure><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Fast charge adapters are common now, but are not widespread. So, Galaxy S6 has got one, saving your those extra bucks, which otherwise you may had to spend.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Build Quality &amp; Design of Samsung Galaxy S6</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we talk about the Galaxy S6’s design, then Samsung has gone way beyond their comfort zone to design it. Designer engineers of Samsung have shaped&nbsp;this device from the scratch, giving it a brand new design. However, the overall size of Galaxy S6, 5.1” and is unchanged when compared to its predecessor.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The complete size of Samsung Galaxy S6 is very close to its predecessor:<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">143.4×70.5×6.8mm<span class="Apple-converted-space">&nbsp;</span></strong>and weighs around 138g.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The body of Samsung Galaxy S6 is a<strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);"><span class="Apple-converted-space">&nbsp;</span>brushed metal frame</strong><span class="Apple-converted-space">&nbsp;</span>that is grasping simultaneously a pair of panels of glass.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">This is the first time Samsung is introducing two sheets of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Corning Gorilla Glass 4</strong>, both front and rear, in the Galaxy S series phones. However, Samsung is not the inventor; it is good that they discarded the plastic, keeping the shape and look of trademark.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If we take the overall look over Samsung Galaxy S6, then the brand has tremendously enhanced the tech features, simultaneously trimming down the body.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Controls</strong></h3></figure></div><div style="text-align: center;"><figure id="attachment_2623" style="width: 300px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/10/12.png"><img class="wp-image-2623 size-medium" src="http://mobda.com/wp-content/uploads/2015/10/12-300x225.png" alt="Top of Galaxy S6" width="300" height="225"></a><figure id="attachment_2623" class="wp-caption aligncenter" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); width: 300px;"><figcaption class="wp-caption-text" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Top of Galaxy S6</figcaption></figure><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The home key on the Galaxy S6 remains the same, as in other smartphone, however doubling as the fingerprint scanner. Both sides of the home key are the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Capacitive Task Switcher<span class="Apple-converted-space">&nbsp;</span></strong>and Back buttons.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Moreover, on the left side of the phone are two volume keys made up of metal, and at the right side, you can find the lock/power key and the popping-out SIM tray.</p></figure></div><div style="text-align: center;"><figure id="attachment_2624" style="width: 300px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/10/8.png"><img class="size-medium wp-image-2624" src="http://mobda.com/wp-content/uploads/2015/10/8-300x225.png" alt="Bottom of Galaxy S6" width="300" height="225"></a><figure id="attachment_2624" class="wp-caption aligncenter" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); width: 300px;"><figcaption class="wp-caption-text" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Bottom of Galaxy S6</figcaption></figure><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">At the bottom of the Galaxy S6 you can find the 3.5mm jack for headphone, speaker, microphone and the USB port, making it a bit crowded. However, the top side is cleaner just having the IR blaster and pinhole for the secondary microphone.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The back of S6 has the popping out 16MP f/1.9 primary camera, which also include the 4K camcorder. The one of the most important features of the camera include<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">optical image stabilization</strong>, and hence, we can expect some cool photos, even in low light.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Quad HD display of Samsung Galaxy S6 is one of the highlighted features apart from the chipset and its new stylish design. Despite of the unchanged diagonals at 5.1”, the resolution of the device has got a boost of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">QHD – 25560 x 1440 pixels.<span class="Apple-converted-space">&nbsp;</span></strong>It means you are going to have an awesome Super AMOLED panel offering the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">557ppi.</strong></p></figure></div><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/5.png"><img class="aligncenter size-medium wp-image-2639" src="http://mobda.com/wp-content/uploads/2015/10/5-300x225.png" alt="Display of Galaxy S6" width="300" height="225"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The display of the Galaxy S6 produces overly saturated colors with the help of Super AMOLED panel’s key strength and high contrast. By looking at the images created on the default screen mode makes you feel that every image is about to pop of it.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The contrast ratio of the Samsung Galaxy S6 is practically unlimited, making it capable to show the black by just turning off the individual pixels, and lighting up the only part that is showing the different colors.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Considering the screen resolution being doubled of the Samsung Galaxy S6, the life of battery was putting people in some dilemma because it is downgraded to<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2550mAh.<span class="Apple-converted-space">&nbsp;</span></strong>However, our battery tests proved this right and showed a little lesser performance. Although, not that bad, in fact higher than the average. The battery of S6’s enough to last for around<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">20 hours on 3G calls.</strong></p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/1.png"><img class="aligncenter size-medium wp-image-2640" src="http://mobda.com/wp-content/uploads/2015/10/1-300x225.png" alt="Battery" width="300" height="225"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">With the endurance rating of 73, the S6’s battery can last for around three days, if you are using it for only one hour of calls, video playback and web browsing, everyday.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">User Interface Of Galaxy S6</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The Samsung Galaxy S6 has got the latest personification of TouchWiz, and comes with<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Android 5.0.2</strong><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Lollipop.</strong></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Along with simplifying their software usage, Samsung has also added many brand new features too. Some of the new features are also available to the predecessors, because of the upgrade of Android to lollipop, however, there are a few that are available to only the Galaxy S6.</p><figure id="attachment_2629" style="width: 300px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/10/lock-sceen-of-galaxy-s6.jpg"><img class="size-medium wp-image-2629" src="http://mobda.com/wp-content/uploads/2015/10/lock-sceen-of-galaxy-s6-300x225.jpg" alt="lock sceen of galaxy s6" width="300" height="225"></a><figcaption class="wp-caption-text">Lock sceen of Galaxy S6</figcaption></figure><p style="text-align: justify;">If we talk about the lock screen, it is quite engrossed. You can only see two notifications, after it, all the notifications just show the icons by being collapsed. Hence, if you want to see the complete list, tap the arrow down. The notification panel also include the pedometer stats and your location’s weather information.</p><p style="text-align: justify;">Your favorite <strong>Private Mode </strong>is back and you also get the enhanced fingerprint reader. In Galaxy S6, it is too fast that you just have to place your finger on it for around half a second to unlock the device.</p><p style="text-align: justify;">What <strong>Private Mode </strong>does? It creates a folder that is completely secure and that vanishes away when you disable the mode.</p><p style="text-align: justify;">In the Samsung Galaxy S6, we finally have a much better support for themes. However, we only have three preinstalled themes in the devices, but we can have more themes that you can download from the <strong>Galaxy Apps Store. </strong>This is the feature, Samsung has added for the first time. With the new theme, not only your graphical aspects changes, but also the notification tones, alarm sound, ringtones and many more.</p><figure id="attachment_2638" style="width: 300px;" class="wp-caption alignleft"><a href="http://mobda.com/wp-content/uploads/2015/10/10.png"><img class="size-medium wp-image-2638" src="http://mobda.com/wp-content/uploads/2015/10/10-300x225.png" alt="Notification Area" width="300" height="225"></a><figcaption class="wp-caption-text">Notification Area</figcaption></figure><p style="text-align: justify;">The <strong>notification area</strong> of the Galaxy S6 is almost same as its predecessors. You get the brightness slider below the notification area and the Quick connect buttons and S Finder. One unique and cool feature of Samsung Galaxy S6 is that when you adjust the slider, the notification area also fades in or out, showing you the changes in the apps you were using.</p><p style="text-align: justify;">In the S6, the <strong>Multi Window </strong>has become the part of app switcher. In the multi window feature, the TouchWiz is using the Lollipop-style 3D rolodex of apps in the first half and the other half is still filled with the same rolodex apps that support the Multi Window feature.</p><h3 style="text-align: justify;"><strong>Performance</strong></h3><p style="text-align: justify;">Samsung has gone an extra mile with the launch of this flagship product. For the first time, it is using the in-house chipset <strong>Exynos 7420. </strong>It is the first chipset for mobile that is built on the <strong>14nm </strong>fabrication process, which helps in the power usage reduction.</p><p style="text-align: justify;">The Samsung Galaxy S6 is using a <strong>64-bit </strong>version of <strong>Android 5.0.2</strong> with all its cores being 64-bit capable.</p><h3 style="text-align: justify;"><strong>Storage of Samsung Galaxy S6</strong></h3><p style="text-align: justify;">Galaxy S6 is the first flagship product from Samsung, which got rid of the microSD expansion. Why suddenly Samsung did this?</p><p style="text-align: justify;">The answer is that the company has come up with its own <strong>UFS 2.0 storage. </strong>&nbsp;To accelerate the command execution, it is using <strong>“Command Queue”</strong> technology, as present in <strong>Solid State Drives</strong>. After the installation of the UFS 2.0 storage, the company is claiming the <strong>2.7X faster</strong> performance as compared to the <strong>eMMC 5.0 memory</strong> that was present in the predecessors.</p><p style="text-align: justify;">Therefore, to get the fast performance from your Galaxy S6, you have to get rid of the memory card, which is applicable for all high-end phones launched in 2014 onwards.</p><h3 style="text-align: justify;"><strong>Camera</strong></h3><h4 style="text-align: justify;"><strong>Still Camera</strong></h4><p style="text-align: justify;">A <strong>16MP Sony IMX240 sensor</strong> camera is installed in the Samsung Galaxy S6, which was also there in Galaxy note 4. However, the camera of Galaxy S6 has a wider <strong>f/1.9 aperture</strong> behind the lens, letting in more light and making the <strong>Bokeh Effects </strong>much better. Moreover, the camera software too sophisticated.</p><figure id="attachment_2636" style="width: 300px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/10/4.png"><img class="size-medium wp-image-2636" src="http://mobda.com/wp-content/uploads/2015/10/4-300x225.png" alt="Camera ofGalaxy S6" width="300" height="225"></a><figcaption class="wp-caption-text">Galaxy S6 is fiitted with a 16MP camera</figcaption></figure><p style="text-align: justify;">One of the best features, which Galaxy S6 has induced is the feature of <strong>Quick Launch </strong>for camera. Just double press <strong>Home Key</strong> in the UI and the camera will open in less than a second.</p><p style="text-align: justify;">You can find most of the camera settings on <strong>Viewfinder</strong> and the UI is also quite simple. You also have an option to download the various shooting modes.</p><p style="text-align: justify;">If you love photography, hence, Galaxy S6’s <strong>Pro mode</strong> is for you. It allows you to adjust manually the <strong>Exposure Compensation, Focus, ISO and White Balance. </strong>Moreover, you can save these manual settings for a faster come back.</p><p style="text-align: justify;">Despite of getting several preset color effects, you have an option to make your own effects. The adjustments of colors are extremely advanced. You can boost shadows and reign in highlights with the help of sliders, adjust the saturation and contrast, tints and temperatures and many more.</p><h4 style="text-align: justify;"><strong>Video Camera</strong></h4><p style="text-align: justify;">However, there is no special video shooting mode, as all the modes work for videos also.</p><p style="text-align: justify;">The Samsung Galaxy S6 tops at the <strong>2160p resolution, </strong>but it is also capable of making <strong>1080p </strong>videos at both <strong>60fps </strong>and <strong>30fps</strong> and <strong>720p </strong>videos at up to <strong>120fps</strong>.</p><p style="text-align: justify;">If we talk about the <strong>2160p </strong>videos, they are shot at their usual bit rate of <strong>48Mpbs</strong>. Moreover, all the videos that are shot by the Galaxy S6 consist of <strong>256Kbps/48kHz</strong> audio. The videos made with the camera are sharp and do not have any noise, and have perfect colors with a superb dynamic range.</p><p style="text-align: justify;">However, the videos at <strong>2160p </strong>cannot use the <strong>Digital Image Stabilization </strong>feature.</p><h3 style="text-align: justify;"><strong>Disadvantages</strong></h3><p style="text-align: justify;">No matter how much the device is awesome, there definitely are a few disadvantages of Samsung Galaxy S6. Let us have a look at them.</p><ul style="text-align: justify;"><li>No water or dust protection</li><li>A bit pricey at launch, including really steep memory upgrade premiums</li><li>No user-replaceable battery</li><li>No microSD slot</li><li>No FM radio</li><li>No stereo speakers</li></ul><!-- WhatsApp Share Button for WordPress: http://peadig.com/wordpress-plugins/whatsapp-share-button/ --><p></p>                                                          	</div>', '/image/uploads_productReview_productReviewImage-453952-1484681526.png', 1, '2017-01-17 14:02:07', '2017-01-17 14:13:53');
INSERT INTO `admin_reviews` (`admin_reviews_id`, `product_id`, `title`, `description`, `article`, `reviews_image`, `status`, `created_at`, `updated_at`) VALUES
(16, 381, 'Apple iPhone 6S Review: The Thing That’s Changed Is Everything', 'This Apple iPhone 6S have great review', '<div class="new_description "><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">There have been a lot of excitement about the launch of Apple’s new iPhone6S, an iPhone with the<span class="Apple-converted-space">&nbsp;</span></span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: 600; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">‘S’</strong><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;"><span class="Apple-converted-space">&nbsp;</span>badge has<span class="Apple-converted-space">&nbsp;</span></span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: 600; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">iOS 9</strong><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;"><span class="Apple-converted-space">&nbsp;</span>and more power under its hood.</span><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/^952DD19F56E7142FE64B715B94978B4ABC91AFDCCAC22FCB2A^pimgpsh_fullsize_distr.jpg"><img class="aligncenter size-full wp-image-2332" src="http://mobda.com/wp-content/uploads/2015/10/^952DD19F56E7142FE64B715B94978B4ABC91AFDCCAC22FCB2A^pimgpsh_fullsize_distr.jpg" alt="iPhone6S" width="600" height="400"></a></p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/s-badge.jpg"><img class=" size-medium wp-image-2320 aligncenter" src="http://mobda.com/wp-content/uploads/2015/10/s-badge-300x188.jpg" alt="s badge" width="300" height="188"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">It is a bit hard to tell the difference between the iPhone6S and its predecessors at a first glance but through this review, we have tried to tell you everything you need to know about the iPhone 6S.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Unboxing iPhone6S <br></strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/unboxing-iphone-6s.jpg"><img class="  wp-image-2309 aligncenter" src="http://mobda.com/wp-content/uploads/2015/10/unboxing-iphone-6s-300x225.jpg" alt="unboxing iphone 6s" width="264" height="198"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">There are fewer chances that the retail packaging of iPhone6S will surprise you. The box of iPhone 6S holds the phone itself, an A/C adapter, a tightly packed pair of EarPods and one lightning cable.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">&nbsp;</strong><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Design</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">First of all let us talk about the design of iPhone 6S. On the outside, the design is nearly the same but not identical. However, it is super familiar to the users of its predecessor. The iPhone6S do not ha</p><div style="text-align: center;"><img class="  wp-image-2311 alignleft" src="http://mobda.com/wp-content/uploads/2015/10/colors-of-iPhone6S-300x212.jpg" alt="Design of iPhone6S" width="252" height="178"><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">ve the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">FCC markings<span class="Apple-converted-space">&nbsp;</span></strong>as they are no longer required and hence, the company got rid of them. Now it looks a little bit cleaner though.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The main way to actually be able to tell if someone has the new iPhone6S or the older version is if they have new pink color. You may also call the color as<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Rose Gold.<span class="Apple-converted-space">&nbsp;</span></strong>However, the real difference on the outside is that Apple is now using a 7000 series aluminum, which mak</p><div style="text-align: center;"><img class="  wp-image-2322 aligncenter" src="http://mobda.com/wp-content/uploads/2015/10/iphone-6s-side-view-165x300.jpg" alt="iphone 6s side view" width="171" height="311"></div><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">es the body stronger and prevents it from bending easily, even if reinforced internally around the volume button, you can’t see it but it is there.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Overall, the button placements, headphonejack, new switch etc. all the stuff is in the same place. It is still round in shape as of the predecessor. These rounded sides make the iPhone a bit slippery in the hands. Moreover, the new iPhone6S is thicker, wider and taller than its previous version and hence, the cases and skins form the last year won’t fit, depending on how precise they are.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Touch ID</strong></h3></div><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/touch-ID.jpg"><img class="aligncenter size-medium wp-image-2312" src="http://mobda.com/wp-content/uploads/2015/10/touch-ID-300x194.jpg" alt="touch ID" width="300" height="194"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">One of the best changes though on the front of new iPhone is the new Touch ID, which is the new fingerprint sensor. It is ridiculously fast, some might even say too fast that when you wake up your phone and unlock it with your finger on the home button, you might actually miss the notifications that you could have read on your lock screen. Therefore, you can unlock your phone with just a tap and there is no need to hold the home button for the longer time. Therefore, to check the time or notifications , you may have to go with the standard process, by pressing the unlock button present at the side of the phone.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Performance</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The next big upgrade with the iPhone6S is on the inside. Technically, this iPhone is insanely fast and uses Apple’s new<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">A9 chip</strong>. It is a dual-core chip with two powerful cores of nearly<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2GHz and 2GB of RAM,</strong><span class="Apple-converted-space">&nbsp;</span>which is plenty for iOS and<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">multitasking</strong><span class="Apple-converted-space">&nbsp;</span>is great, it keeps more apps in the memory now. The overall day-to-day performance is super snappy; frame rates are consistently high.</p><p style="text-align: center;"><img class="aligncenter size-large wp-image-2313" src="http://mobda.com/wp-content/uploads/2015/10/A9-Chip-1024x683.jpg" alt="A9 Chip" width="604" height="403"></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">So, overall the phone’s speed to open and close app is really quick and performance throughout is top notch.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Battery</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/gsmarena_003.jpg"><img class=" wp-image-2314  aligncenter" src="http://mobda.com/wp-content/uploads/2015/10/gsmarena_003.jpg" alt="Mobda Battery Test" width="514" height="222"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You may disappoint with the news that the battery in the new iPhone6S is down to<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1715mAh</strong>, so this is one idea that is actually worse to have a smaller battery. However, the battery life is still about the same, which means you can have a<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">battery life of almost a complete day</strong><span class="Apple-converted-space">&nbsp;</span>if you use phone normally. On the other hand, on a heavy day you may have to look for the chargers and plugs before the end of the day.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Display</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/display.jpg"><img class="aligncenter size-medium wp-image-2315" src="http://mobda.com/wp-content/uploads/2015/10/display-300x199.jpg" alt="display" width="300" height="199"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The next major change in the iPhone6S is the display. Now, the panel itself is still the same with the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">13.34×7.50 IPS<span class="Apple-converted-space">&nbsp;</span></strong>panel on the iPhone6S. However, the display now has some extra hard work to make it pressure-sensitive.</p><h4 style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; text-transform: capitalize; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-indent: 0px; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3D Touch</strong></h4><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/3d-touch-1.jpg"><img class="  wp-image-2317 alignright" src="http://mobda.com/wp-content/uploads/2015/10/3d-touch-1-300x129.jpg" alt="3d touch-1" width="435" height="187"></a></p><p style="text-align: justify;"><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">Apple calls it the 3D touch and it is the iPhone’s biggest new feature. Do not get confused between the 3D touch and force touch. It is called 3D touch because it has<span class="Apple-converted-space">&nbsp;</span></span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: 600; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">multiple layers of pressure sensitivity</strong><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;"><span class="Apple-converted-space">&nbsp;</span>and that’s what allows Apple call<span class="Apple-converted-space">&nbsp;</span></span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: 600; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">peak and pop</strong><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">. No one uses this terminology, but that is what Apple is calling it.</span></p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/3d-touch-2.jpg"><img class="  wp-image-2318 alignleft" src="http://mobda.com/wp-content/uploads/2015/10/3d-touch-2-300x180.jpg" alt="3d touch-2" width="452" height="271"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">So, when an app supports 3D touch and if you see something you like, you can press into it with a bit of pressure to<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">‘PEEK’</strong><span class="Apple-converted-space">&nbsp;</span>to see what it is. If you like what you see, you can press even harder to<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">‘POP’.</strong><span class="Apple-converted-space">&nbsp;</span>The ‘POP’ is just a longer press that will help you in converting it to full screen. That is the essence of peek and pop.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">It’s not just a long press can actually peek into something and let you decide that’s all you want to see. To get back to normal view, just release it that will minimize it back.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You can also use the 3D touch on the home screen, which will help you in reviewing the quick shortcuts. A couple of Apple apps support this.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">&nbsp;<strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Camera</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/10/camera.jpg"><img class="aligncenter size-full wp-image-2319" src="http://mobda.com/wp-content/uploads/2015/10/camera.jpg" alt="camera" width="320" height="505"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">iPhone6S has the rocking new camera with the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">12MP sensor</strong>, has the same flash and mostly the same optics but with new sensors with the specs to back it up. The camera interface of iPhone6S has been some of the best balances of control and ease of use in any smartphone. It is super fast and responsive, and is extremely easy to take a great photo. It has a great exposure and a pretty good dynamic range. However, you can experience a little bit of noise in the photos, especially in the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">low light</strong>.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Jumping from<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">8MP to 12MP</strong>, it means that finally iPhone has enough pixels with which you can have the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">4K video shoot</strong><span class="Apple-converted-space">&nbsp;</span>for yourself.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Disadvantages</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">No matter how much the device is perfect, there are always some cons in it. So, let’s see what all disadvantages the iPhone6S has.</p><ul style="padding: 0px 0px 10px; margin: 0px 0px 0px 30px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No microSD slot</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Pricey memory upgrades,<strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);"><span class="Apple-converted-space">&nbsp;</span>32GB version</strong><span class="Apple-converted-space">&nbsp;</span>should be standard for such an expensive phone</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Protruding camera lens makes the phone wobble</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Lacks the optical image stabilization of the iPhone 6s Plus</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">NFC functionality limited to Apple Pay</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No wireless charging, an infrared port, or FM radio</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No enhanced resistance to liquids or dust</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">No user-replaceable battery</li></ul><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">&nbsp;If you are not already an iPhone user, you may find iPhone6S pretty interesting because of 3D touch, 4K video recording, ease of use and many other interesting features.</p>                                      	</div>', '/image/uploads_productReview_productReviewImage-501715-1484681847.jpg', 1, '2017-01-17 14:07:28', '2017-01-17 14:13:54');
