(1, 'Top 10 Free Android Games You Should Play In 2016', 'Google Play Store has thousands of games, but not all of them are worth downloading. It’s really hard when it comes to pick out the best Android game to download and play in your handset. So, we’ve compiled a list of Top 10 free Android games to play in 2016. Feel free to add your best picks in the comments in case we missed out something.', '<div class="new_description "><em>Google Play Store</em> has thousands of games, but not all of them are worth downloading. It’s really hard when it comes to pick out the best Android game to download and play in your handset. So, we’ve compiled a list of <em>Top 10 free Android games to play in 2016</em>. Feel free to add your best picks in the comments in case we missed out something.<h3>10. UNKILLED</h3><p></p><center><iframe src="https://www.youtube.com/embed/rW6BRZSzpc0" allowfullscreen="allowfullscreen" width="640" height="360" frameborder="0"></iframe></center><em>UNKILLED</em> is a latest addition in the legion of zombie FPS titles from <em>MADFINGER</em> Games, the one that brought is the <em>Dead Trigger 2</em>. Actually <em>UNKILLED</em> has substituted <em>Dead Trigger 2</em> as the best zombie first-person-shooter game on Android market at present.<p></p><p>The game has awesome graphics, includes more than 300 missions to complete with boss fights, loads of weapons and stuff to upgrade and achieve, online <strong>PvP</strong> campaign, and the graphics gets a lot better when played in a <strong>Tegra X1</strong> device. Yup, it’s a <em>freemium</em> game but certainly a great one to give a try!</p><p>Download this game from <strong>Play Store</strong></p><h3>9. Kill Shot</h3><p></p><center><iframe src="https://www.youtube.com/embed/VGMzx_Tn0eI" allowfullscreen="allowfullscreen" width="640" height="360" frameborder="0"></iframe></center><em>Kill Shot</em> is a simple game that gets harder very quickly. This is a First-Person-Shooter (FPS) game where you’ll be provided with a range of toys like sniper rifles at long range while trying to suppress your enemies over long distances.<p></p><p>You can upgrade your weapons as you proceed through the missions. If you’re a fan of sniper or FPS titles (like me), you should definitely give it a try!</p><p>Download this game from <a href="https://play.google.com/store/apps/details?id=com.hotheadgames.google.free.rawsniper&amp;hl=en" target="_blank"><strong>Play Store</strong></a></p><h3>8. WordBrain</h3><p></p><center><iframe src="https://www.youtube.com/embed/9Y47nfBv15M" allowfullscreen="allowfullscreen" width="640" height="360" frameborder="0"></iframe></center><br>The game starts really simple but gets difficult quickly. You have to discover the hidden words by sliding and collapsing the tiles that has alphabets on them. The game can be played in 15 different languages and 580 different levels are available per language!<p></p><blockquote><p><em>“Even the smartest word game enthusiasts will have a real challenge to complete this game. In fact: only very few have!” – Developers of WordBrain</em></p></blockquote><p>Download this game from <a href="https://play.google.com/store/apps/details?id=se.maginteractive.wordbrain&amp;hl=en" target="_blank"><strong>Play Store</strong></a></p><h3>7.&nbsp;Tank Hero</h3><p></p><center><iframe src="https://www.youtube.com/embed/jJIYF7aCtPM" allowfullscreen="allowfullscreen" width="640" height="360" frameborder="0"></iframe></center>Tank Hero got ninth in our list of top 10 Android games of 2016. This is the kind of a game that you can’t stop playing. You’ll be put in the role of a tank shooting other enemy tanks in random locations. So simple, isn’t it? Your missiles can bounce-off the walls in order to lead your fire at towards other tanks. A great addictive game in recent times.<p></p><p>Download this game from <strong>Play Store</strong></p><h3>6. Fallout Shelter</h3><p></p><center><iframe src="https://www.youtube.com/embed/HY4jCjufLG8" allowfullscreen="allowfullscreen" width="640" height="360" frameborder="0"></iframe></center><em>Fallout Shelter</em> is established in the Fallout universe. In this you’ll be controlling an advanced underground facility from Vault-Tec. You construct the vault, extend it with necessary parts, inhabit it with Habitants who work for you and it’s your responsibility to safeguard them from any threats.<p></p><p>What’s most interesting is when habitants of opposite gender come across in the same room and someday sooner or later you’ve got more little inhabitants coming. Cool isn’t it?</p><p>Download this game from <strong>Play Store</strong></p><h3>5. BADLAND</h3><p></p><center><iframe src="https://www.youtube.com/embed/FjysXld6GvI" allowfullscreen="allowfullscreen" width="640" height="360" frameborder="0"></iframe></center><em>BADLAND</em> doesn’t get our attention in the beginning. It’s a side-moving runner where you ought to avoid obstructions and prevent the infinitely-scrolling screen from swallowing your character whole. However, as soon as you dive into the game, it’s hard to deny its depth.<p></p><p>There’s a real-time multiplayer campaign with local co-op mode, a great adventure mode, and the recent updates even allows the players to build their own levels.</p><p>Download this game from <a href="https://play.google.com/store/apps/details?id=com.frogmind.badland" target="_blank"><strong>Play Store</strong></a></p><h3>4. Clash of Clans</h3><p></p><center><iframe src="https://www.youtube.com/embed/GC2qk2X3fKA" allowfullscreen="allowfullscreen" width="640" height="360" frameborder="0"></iframe></center>Some people don’t like <em>Clash of Clans</em>, but a lot more do love them and for good reason. This may be the most renowned and well established multi-player title in the whole gaming world. There’s a single player campaign, a multiplayer mode with clans, clan wars, loads stuff to unlock, and more.<p></p><p>The online community is spirited with a thousands of guides and YouTube videos on how to play and hits that equity between a boring mobile title and a game you can actually sink your teeth into.</p><p>Download this game from <a href="https://play.google.com/store/apps/details?id=com.supercell.clashofclans" target="_blank"><strong>Play Store</strong></a></p><h3>3. Crossy Road</h3><p></p><center><iframe src="https://www.youtube.com/embed/siHkMYNMBkM" allowfullscreen="allowfullscreen" width="640" height="360" frameborder="0"></iframe></center><em>Crossy Road</em> can be related to the classic old title <em>Frogger</em>. But it is more of an endless game with eye-catching visuals, 3-dimensional visual aspect, loads of characters to unlock, and random generation of terrain. There’s not even a single part of those things that you don’t love.<p></p><p>The game features a <em>very stylized, isometric, cartoony visual</em> that you can’t help but adore, and there tons of characters available for you to unlock – from movie monsters to wild animals to cameos from other mobile games. A great game brought together with awesome visuals – who wouldn’t love to give a try.</p><p>Download this game from <a href="https://play.google.com/store/apps/details?id=com.yodo1.crossyroad" target="_blank"><strong>Play Store</strong></a></p><h3>2. Asphalt 8: Airborne</h3><p></p><center><iframe src="https://www.youtube.com/embed/siwzYB2dzao" allowfullscreen="allowfullscreen" width="640" height="360" frameborder="0"></iframe></center>Only a few other racing games have lasted as long as <em>Asphalt 8: Airborne</em> did. Asphalt 8 has plenty of content to enjoy, including a single player campaign, time trials, multi-player mode, unlockable stuff, and regular updates that bring in new tracks and other new stuff.<p></p><p>The graphics quality is quite good and the game works on most Android handsets. There are many other racing games out there in the Play Store, but <em>Asphalt 8: Airborne</em> tops the chart than any of its contenders.</p><p>Download this game from <a href="https://play.google.com/store/apps/details?id=com.gameloft.android.ANMP.GloftA8HM" target="_blank"><strong>Play Store</strong></a></p><h3>1. Marvel Contest of Champions</h3><p></p><center><iframe src="https://www.youtube.com/embed/KL3GLiun9y8" allowfullscreen="allowfullscreen" width="640" height="360" frameborder="0"></iframe></center>Number one our list of top 10 Android games to play in 2016, is <em>Marvel Contest of Champions</em>!&nbsp;Overlooking the not-so-fresh animations, <em>Contest of Champions</em> is a great looking title. The characters are really well-done, and though the animation is not up to the mark, there are some wonderful touches like surging hair and such. It’s even more surprising when you come to know about the number of characters you can choose from.<p></p><p>This amazing game isn’t entitled for everyone. If you’re into difficult moves or the sort of mixture that extremely different fighters can offer, then this is your cup of tea.</p><p>Download this game from <a href="https://play.google.com/store/apps/details?id=com.kabam.marvelbattle" target="_blank"><strong>Play Store</strong></a></p><!-- WhatsApp Share Button for WordPress: http://peadig.com/wordpress-plugins/whatsapp-share-button/ --><p></p>                                                          	</div>', '/image/uploads_news_newsImage-772885-1484682431.jpg', 1, '2017-01-17 14:17:11', '2017-01-17 14:17:28'),
(2, 'Windows’ Word Flow Keyboard Is Coming To The App Store', 'Ask any Windows 10 Mobile users what they love in the interface features and obviously they point to its awesome Word Flow Keyboard – the combination of word correction, swiping and overall look & feel is hard to reproduce.', '<div class="new_description "><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Ask any Windows 10 Mobile users what they love in the interface features and obviously they point to its awesome Word Flow Keyboard – the combination of word correction, swiping and overall look &amp; feel is hard to reproduce.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Well, you won’t require to buy a Windows smartphone to enjoy those subtle features in the near future. Microsoft is in the plans to bring this awesome keyboard to “other platforms,” setting out with iOS. Yup, you won’t have to get rid of that intimate typing experience just because you’re switching to (or required to use) an Apple device.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2016/01/windows-keyboard-for-iOS.jpg"><img class="aligncenter size-full wp-image-9081" src="http://mobda.com/wp-content/uploads/2016/01/windows-keyboard-for-iOS.jpg" alt="windows-keyboard-for-iOS" width="600" height="398"></a></p><p><em style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(153, 153, 153); letter-spacing: 1px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Image Courtesy: www.engadget.com</em></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">It is not clear if something changes in the transition, though we would want the keyboard to remain intact for the most part.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">The company is conducting a preview program that’s exclusive for Windows Insiders for now, but it is assuring an App Store release. It won’t be surprising to see an Android version one eventually, for that matter.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Besides, with the Cortana release (cross-platform) and other cross-platform Microsoft applications, you won’t be suffering from any Windows withdrawal symptoms at all in the future – expect the absence of the tiled home screen.</p><p></p>                                                          	</div>', '/image/uploads_news_newsImage-953857-1484682620.jpg', 1, '2017-01-17 14:20:20', '2017-01-17 14:58:39'),
(3, 'Leaked Images Confirms The Release Of 4-Inch iPhone 5se: Mini Version Of iPhone 6', 'There have been a lot of rumors hinting that Apple is planning on launching a new 4 inch handset since the launch of iPhone 6 and 6 Plus in September 2014.', '<div class="new_description "><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">There have been a lot of rumors hinting that Apple is planning on launching a new 4 inch handset since the launch of iPhone 6 and 6 Plus in September 2014.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Despite the speculations, no new device was came out in 2015, but since 2016, rumors have bolstered up and it seems to be a new 4 inch Apple smartphone could be launched in the near future.&nbsp;The handset is made keeping in mind those who want something smaller and affordable as well.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">The handset, certainly, will not be a preview to the upcoming iPhone 7 as it will hold the design of iPhone 5S for the most part and might still have a headphone jack. This also shuts down all those rumors about the release of iPhone 6C.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2016/01/iphone-5se-leaked-01.jpg"><img class="aligncenter size-full wp-image-9076" src="http://mobda.com/wp-content/uploads/2016/01/iphone-5se-leaked-01.jpg" alt="iphone-5se-leaked-01" width="700" height="525"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><span style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(153, 153, 153);"><em style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Image Courtesy:&nbsp;http://www.onemorething.nl/community/topic/dan-maar-zo-foto-iphone-6c/</em></span></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">While the new handset called as “N69” inside Apple, the launch name would probably be “iPhone 5se.” The suffix “se” has been described in two different ways: as “special edition” and also as “enhanced” version of the iPhone 5S.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">The new upgraded iPhone 5se is said to have “Live Photos” feature like in iPhone 6S series and will feature a Rose-Gold color variant as well. It won’t include the 3D Touch Display feature though and is expected to hit the stores in April 2016. We’ll have to wait till Apple makes any official announcement.</p><p></p><center><iframe src="https://www.youtube.com/embed/p8la5yjlPcs" allowfullscreen="allowfullscreen" width="650" height="400" frameborder="0"></iframe></center><p></p><!-- WhatsApp Share Button for WordPress: http://peadig.com/wordpress-plugins/whatsapp-share-button/ --><p></p>                                                          	</div>', '/image/uploads_news_newsImage-134524-1484682746.jpg', 1, '2017-01-17 14:22:26', '2017-01-17 14:58:40'),
(4, 'Microsoft Lumia 650 Is Expected To Launch Early Than Expected', 'Microsoft is expected to unveil its upcoming Lumia 650 series of smartphones on February 1 “with little fuss,” as per the sources related to the company’s plans. The smartphone was initially expected to release at the Mobile World Congress, but it appears we won’t have to wait pretty so long.', '<div class="new_description "><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Microsoft is expected to unveil its upcoming Lumia 650 series of smartphones on February 1 “<em style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">with little fuss,</em>” as per the sources related to the company’s plans. The smartphone was initially expected to release at the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Mobile World Congress</strong>, but it appears we won’t have to wait pretty so long.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Lumia 650 will be a mid-range smartphone that runs Windows 10 Mobile OS. The device is anticipated to sport a 5 inches 720p display, 1GB of RAM storage, a Snapdragon 212 or 210 chipset, 8MP primary camera, and 8GB of internal storage with a microSD card slot.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2016/01/Lumia-650-release-date-01.jpg"><img class="aligncenter size-full wp-image-8929" src="http://mobda.com/wp-content/uploads/2016/01/Lumia-650-release-date-01.jpg" alt="Lumia-650-release-date-01" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><span style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(153, 153, 153);"><em style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Image Courtesy: windowscentral.com</em></span></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Unlike other mid-range handsets in the Lumia series, the Lumia 650 is anticipated to have a high-end look and feel, with a metal frame and matte-finish plastic back cover that’ll be available in black/white variations – as seen in the leaked images.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">The handset is expected to have its official launching ceremony at the Mobile World Congress, which starts on February 22; but sources of Windows Central are saying that official launch will happen on February 1.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">On the other hand, the company isn’t expected to launch any other handsets along with Lumia 650, and there are rumors that this is going to be the only smartphone in the Lumia series of 2016. Some reports say,<span class="Apple-converted-space">&nbsp;</span><em style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">this could be the last Lumia smartphone ever</em>.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Recent reports claim that, Microsoft will rather concentrate on the upcoming series of smartphones that’ll be launched under the brand “Surface.”</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">We’re not anticipating a press conference or keynote for the Lumia 650; reports say that the smartphone launch will happen on the Microsoft blog.</p><p></p>                                                          	</div>', '/image/uploads_news_newsImage-588177-1484682839.jpg', 1, '2017-01-17 14:23:59', '2017-01-17 14:58:40'),
(5, 'Top 10 Best Samsung Smartphones To Buy Under 15000', 'Are you looking for the best Samsung smartphone to buy under 15,000 Rupees? Then it’ll be really confusing to choose one best product as there are several good Samsung variants available in this price range. Having many options is a good thing but in the other hand it makes it difficult to choose the best product. So, we have compiled the list of top 10 Samsung smartphones to buy under ₹15,000 in order to make the process simple for you.', '<div class="new_description ">Are you looking for the best Samsung smartphone to buy under 15,000 Rupees? Then it’ll be really confusing to choose one best product as there are several good Samsung variants available in this price range. Having many options is a good thing but in the other hand it makes it difficult to choose the best product. So, we have compiled the list of top 10 Samsung smartphones to buy under ₹15,000 in order to make the process simple for you.<h2>Best Samsung Phones Under 15,000</h2><h3>10. Samsung Galaxy Grand Quattro</h3><p>Samsung Galaxy Grand Quattro features a 4.7 inches TFT display with 480 x 800 pixels of resolution. Under the hood, the device comes with a Quad-core 1.2GHz processor, 1GB RAM storage, 8GB internal memory space (expandable up to 32GB) and a 2000mAh Li-Ion battery.</p><p>The device runs on Android Jelly Bean (v4.1), and boasts a 5MP primary shooter and 0.3MP front shooter.</p><p>Buy this product from <strong>Amazon</strong>:</p><p></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B00ES8JMAE&amp;asins=B00ES8JMAE&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0">&lt;br /&gt;</iframe></center><p></p><h3>9. Samsung Galaxy Grand Prime</h3><p>The Samsung Galaxy Grand Prime comes with a 5 inches TFT display with 220ppi of resolution. The device is powered by Quad-core 1.2GHz chipset and runs on Android KitKat (v4.4). Under the hood, it is packed with 1GB of RAM storage, 8GB of internal memory (expandable up to 32GB) and a 2600mAh Li-Ion battery (removable).</p><p>The smartphone features an 8MP primary camera and 5MP front facing camera.</p><p>Buy this product from <strong>Amazon</strong>:</p><p></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B00O30T0WC&amp;asins=B00O30T0WC&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0">&lt;br /&gt;</iframe></center><p></p><h3>8. Samsung Galaxy A3</h3><p>The Galaxy A3 features a 4.5 inches display with 540×960 pixels of resolution. The phone comes with Quad-core 1.2GHz chipset and RAM space of 1GB. It also has a 16GB internal storage memory (expandable up to 64GB) and runs on Android v4.4 (KitKat).</p><p>The handset sports an 8MP primary shooter and a 5MP front-facing shooter and comes with a 1900mAh non-removable Li-Ion battery.</p><p>Buy this product from <strong>Amazon</strong>:</p><p></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B00TAZDOXG&amp;asins=B00TAZDOXG&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0">&lt;br /&gt;</iframe></center><p></p><h3>7. Samsung Galaxy S3 Neo</h3><p>The Samsung S3 Neo is packed with a 4.8 inches display that has 306ppi resolution, which is comparatively great in this price range. Under the hood, the phone has a Quad-core 1.2GHz chipset, 16GB of internal memory and 1.5GB of RAM storage. The device boasts an 8MP primary shooter and a 1.9MP front-facing Selfie shooter.</p><p>The device run on Android v4.3 (KitKat) and is backed by a 2100mAh Li-Ion removable battery.</p><p>Buy this product from <strong>Amazon</strong>:</p><p></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B00JHDO1NS&amp;asins=B00JHDO1NS&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0">&lt;br /&gt;</iframe></center><p></p><h3>6. Samsung Galaxy On5</h3><p>Samsung Galaxy On5 boasts a 5 inches HD display with 1280 x 720 pixels resolution. The device is powered by Quad-core 1.3GHz Exynos processor and 1.5GB of RAM storage. The phone is loaded with the latest version of Android OS, Lollipop (v5.1). Looking at the camera department, the device has a 5MP front camera and an 8MP rear camera with LED flash support.</p><p>Buy this product from <strong>Flipkart</strong>:</p><div data-wrid="WRID-145328546866132834" data-widgettype="productBanner" data-class="affiliateAdsByFlipkart"></div><p><script src="//affiliate.flipkart.com/affiliate/widgets/FKAffiliateWidgets.js" async=""></script></p><h3>5. Samsung Galaxy J5</h3><p>The Samsung Galaxy J5 comes with a 5 inches HD display with 720 x 1280 pixels of resolution. Under the hood, the device has Quad-core 1.2GHz Qualcomm Snapdragon 410 chipset, 8GB of internal storage space (expandable up to 128GB), 1.5GB of RAM storage and a 2600mAh Li-Ion battery. Galaxy J5 is packed with a 13MP primary shooter and a 5MP front-facing camera for Selfies. The device runs on Android Lollipop (v5.1). Buy this product from <strong>Flipkart</strong>:</p><div data-wrid="WRID-145328593511629856" data-widgettype="productBanner" data-class="affiliateAdsByFlipkart"></div><p><script src="//affiliate.flipkart.com/affiliate/widgets/FKAffiliateWidgets.js" async=""></script></p><h3>4. Samsung Galaxy On7</h3><p>The Samsung Galaxy On7 comes with a 5.5 inches HD display with 1280×720 pixels resolution. The device is powered by 1.2GHz Quad-core Snapdragon chipset along with 1.5GB of RAM storage. The phones runs on the latest Android Lollipop (v5.1). Coming to the camera part, the device features a 13 MP primary camera with LED flash support and a 5 MP front-facing camera.</p><p>Buy this product from <strong>Flipkart</strong>:</p><div data-wrid="WRID-145328926472664919" data-widgettype="productBanner" data-class="affiliateAdsByFlipkart"></div><p><script src="//affiliate.flipkart.com/affiliate/widgets/FKAffiliateWidgets.js" async=""></script></p><h3>3. Samsung Galaxy E5</h3><p>Samsung launched Galaxy E5 in January 2015. The device is packed with a 5 inches HD touch-screen that has 1280X720 pixels of resolution. The phone is powered by Quad-core 1.2GHz chipset and has 1.5GB of RAM storage. The phone has internal storage space of 16GB and an external SD card slot has been provided to increase it up to 64GB. Looking at the camera aspects, the device features a 5MP front camera and an 8MP primary camera supported by LED flash light. Buy this product from <strong>Amazon</strong>:<br></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B00SF8UU2M&amp;asins=B00SF8UU2M&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0"></iframe></center><br>&nbsp;<p></p><h3>2. Samsung Galaxy Grand Prime 4G</h3><p>The Galaxy Grand Prime boasts a 5 inch touch display with 960×540 pixels resolution. The handset is packed with 1.2GHz quad-core processor and 1GB of RAM storage. The phone comes with an 8GB of internal storage space, which can be expanded up to 32GB using microSD card. It also comes with a 5MP front-facing Selfie shooter and an 8MP primary shooter. The device runs on Android KitKat (v4.4) OS platform and is backed by a 2600mAh removable Li-Ion battery. And it also has a dual-sim (micro-sim) facility. Buy this product from <strong>Amazon</strong>:<br></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B012NSGXJS&amp;asins=B012NSGXJS&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0"></iframe></center><br>&nbsp;<p></p><h3>1. Samsung Galaxy J7</h3><p>The eye-capturing features of Galaxy J7 begin at the 5.5 inches Super AMOLED display. The phone also features a 64-bit Octa-core chipset, a primary camera with a wide angle f/1.9 aperture (with Pro mode) and a front-facing 5 MP Selfie camera supported by LED flash. This is one of those smartphones that concern more about the screen size rather than the resolution and thus it settles down for 720p. The difference to the 1080p screen in Galaxy A7 is mostly for the decorative part but the practical usage difference is pretty big – you’ll have more screen space for applications and web pages on the Galaxy A7. Buy this product from <strong>Flipkart</strong>:</p><div data-wrid="WRID-145328946882827977" data-widgettype="productBanner" data-class="affiliateAdsByFlipkart"></div><p><script src="//affiliate.flipkart.com/affiliate/widgets/FKAffiliateWidgets.js" async=""></script></p><!-- WhatsApp Share Button for WordPress: http://peadig.com/wordpress-plugins/whatsapp-share-button/ --><p></p>                                                          	</div>', '/image/uploads_news_newsImage-578536-1484682926.jpg', 1, '2017-01-17 14:25:26', '2017-01-17 14:58:41');
