(6, 'Top 10 Best Earphones To Buy Under 1000', 'A nice pair of earphones can turn your music listening experience great compared to what you can get from low-quality products. While music freaks go to great degrees, and even spend a lot of money, to perfect their music gadgets, normal music lovers need not go to such extents.', '<div class="new_description ">A nice pair of earphones can turn your music listening experience great compared to what you can get from low-quality products. While music freaks go to great degrees, and even spend a lot of money, to perfect their music gadgets, normal music lovers need not go to such extents.<p>All the smartphones are packed with a pair of earphones or earbuds that are poor when compared with even the most basic level IEMs (In-Ear-Monitor). And this happens particularly with the mid-range and budget smartphones. As a result, it’s highly recommended that you upgrade your earphones or earbuds to get an enhanced music listening experience.</p><p>There are a lot of decent headphones available in the market, which you can buy without spending a lot of money. Here’s the list of top 10 best earphones under 1000 rupees.</p><h3><strong> 10. Skullcandy S2IKDZ-058 Ink’d 2 (Rasta-Edition)</strong></h3><p>This Skullcandy earphone is built with a great sound technology and its earbuds will certainly impress you with their ultimate performance. This in-ear audio gear delivers awesome bass, natural-sounding vocals and accurate highs without warping the quality of sound.</p><p>Plug these pair of earphones into any audio device such as smartphone, mp3 player, laptop or tablet to enjoy your favorite music on the go.</p><p>Buy this product from <strong>Amazon</strong>:</p><p></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B007136AW6&amp;asins=B007136AW6&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0">&lt;br /&gt;</iframe></center><p></p><h3><strong> 9. Philips SHS8100</strong></h3><p>Philips is renowned for its consumer lighting and lifestyle products. However, many people don’t recognize the brand for its quality and affordable audio gadgets. When compared to the other products in this list, the Philips SHS8100 has an added benefit: it can be used while performing sports activities such as running, jogging, working out etc.</p><p>The fact that these earphones offers good sound quality is a huge advantage. If you’re a fitness-freak and looking for a nice pair of earphones under 1000 bucks, this one is your cup of tea. You might be surprised when you know the comfort level of this audio gear and the way it fits into your ears. The adjustable over-the-ear silicon hooks make sure that the earphones doesn’t fall of from your ears during a workout or running session.</p><p>Buy this product from <strong>Amazon</strong>:</p><p></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B005643EE4&amp;asins=B005643EE4&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0">&lt;br /&gt;</iframe></center><p></p><h3><strong> 8. Creative EP-630</strong></h3><p>Creative is long-familiar for the manufacturing of professional audio equipment. Creative EP-360 is a silent competitor for the Sound Magic ES18, except for the bass quality. Everything about this headphone is great, spare for the build-quality which could have been a little better (they last only for a year or a half).</p><p>It is really stunning to know that Creative is offering such an incredible noise-cancelling earphone at this price range.</p><p>Buy this product from <strong>Amazon</strong>:</p><p></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B00I45L4F8&amp;asins=B00I45L4F8&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0">&lt;br /&gt;</iframe></center><p></p><h3><strong> 7. Cowon EM1</strong></h3><p>Cowon’s portable audio &amp; video players are very popular among the music freaks worldwide. While they are not so well-known for their earphones, the Cowon EM1 deserves a spot in this list for its decent sound quality, creative design, and a good build-quality. The bass delivered by this earphone is enough to satisfy the normal music lovers. The rubbery wires might be annoying now and then, but you will get used to it in a while.</p><p>If you’re into budget earphones and want to try out new brands, then you should certainly give this one a try.</p><p>Buy this product from <strong>Amazon</strong>:</p><p></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B00COZDYOS&amp;asins=B00COZDYOS&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0">&lt;br /&gt;</iframe></center><p></p><h3><strong>6. Sennheiser MX-170</strong></h3><p>These mighty audio gears can offer an amazing bass stereo sound, while they are not in-ear type. The cushy design provides great comfort to your ears and a hassle-free music listening experience for several hours. The Sennheiser MX-170 is ideal for outdoor use since it blocks less outdoor sound and helps to be aware of the surroundings.</p><p>You will be provided with a pair of ear cushions for a comfy fit and is compatible with almost all sorts of music gadgets.</p><p>Buy this product from <strong>Amazon</strong>:</p><p></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B003V9M0VY&amp;asins=B003V9M0VY&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0">&lt;br /&gt;</iframe></center><p></p><h3><strong> 5. Xiaomi Mi In-Ear Earphones</strong></h3><p>Xiaomi is very well-known for its quality products with humble price tags. The same style goes with the in-ear audio gear from the company. This one features an award-winning design and a stylish metal finish, which makes the earphone look captivating. To add the superior feel, the wire is Kevlar reinforced to avoid shag and also for extended durability.</p><p>Buy this product from <a href="http://www.ebay.in/itm/Box-pack-Xiaomi-mi-design-piston-handsfree-earphone-High-Bass-Quality-Gold-colo-/291571551810?hash=item43e304ce42:g:llMAAOSwEetWAhQw" target="_blank"><strong>ebay</strong></a>:</p><h3><strong> 4. Philips SHE-3590BK</strong></h3><p>Philips has set a new benchmark for budget earphones with this set of earphones. For its low price tag, this one delivers decent sound quality and sports a nice design. These are not those cheap looking low budget products seen in the market. The sound quality is not as good as that of Sennheiser or Sony products in this price range, but it’s certainly a value for money product.</p><p>One drawback the needs to be mentioned here is that the wires are not so durable.</p><p>Buy this product from <strong>Amazon</strong>:</p><p></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B007BOLAFW&amp;asins=B007BOLAFW&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0">&lt;br /&gt;</iframe></center><p></p><h3><strong>3. Soundmagic ES18</strong></h3><p>The ES18 from Soundmagic delivers an unbiased sound quality without any specific frequency band. The earbuds are removable and the users can change them as per their comfort with the provided different sizes of earbuds.</p><p>The sound-quality of these earphones are great, particularly when it comes to the <strong>mids</strong>. The bass effect is a bit overwhelming, and treble seems to differ based on the music you’re listening to. The product has got mixed reviews from the overall users.</p><p>Buy this product from <strong>Amazon</strong>:</p><p></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B00789HVDK&amp;asins=B00789HVDK&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0">&lt;br /&gt;</iframe></center><p></p><h3><strong> 2. Sony MDREX110LP</strong></h3><p>If you’re a music freak who loves listening to their favorite music with great detail in sound quality and for long hours, then Sony MDREX110LP is the one for you. The sound quality delivered by this earphone is crystal-clear and the bass quality is solid.</p><p>Hybrid silicone rubber is used to make the earbuds in order to improve comfort during long usages. With tight fit and comfy earbuds, these earphones from Sony keep you relaxed while enjoying a high-performance music gear. Finally, these in-ear devices come in a great collection of bright colors to choose from.</p><p>Buy this product from <strong>Amazon</strong>:</p><p></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B00KTY18RQ&amp;asins=B00KTY18RQ&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0">&lt;br /&gt;</iframe></center><p></p><h3><strong> 1. Sennheiser CX 180 Street II</strong></h3><p>Sennheiser is one of the most favorite brands when it comes to audio equipment. If you love a little extra bass in your songs, this is your cup of tea. It is made for extended usage and the bass-driven stereo effects lets you enjoy the wonderful bass effects of your music.</p><p>Also, this is one of the most balanced earpieces in this price category. The mids and treble are decent, the bass is amazing, and they do a better job in noise-cancellation. The build-quality of the earphone is impressive, and the finger-delineated shaping of earpiece housing really helps in fitting the earbuds perfectly into the ears. The cool design of the earphone is sure to capture some attention.</p><p>Buy this product from <strong>Amazon</strong>:</p><p></p><center><iframe style="width: 120px; height: 240px;" src="//ws-in.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&amp;OneJS=1&amp;Operation=GetAdHtml&amp;MarketPlace=IN&amp;source=ac&amp;ref=tf_til&amp;ad_type=product_link&amp;tracking_id=spicshopsimp-21&amp;marketplace=amazon&amp;region=IN&amp;placement=B00D75AB6I&amp;asins=B00D75AB6I&amp;linkId=&amp;show_border=true&amp;link_opens_in_new_window=true" marginwidth="0" marginheight="0" scrolling="no" width="300" height="150" frameborder="0">&lt;br /&gt;</iframe></center><p></p><!-- WhatsApp Share Button for WordPress: http://peadig.com/wordpress-plugins/whatsapp-share-button/ --><p></p>                                                          	</div>', '/image/uploads_news_newsImage-526159-1484683003.jpg', 1, '2017-01-17 14:26:43', '2017-01-17 14:58:42'),
(7, 'Top 10 Most Downloaded iOS Apps (Paid) Of 2015 Named By Apple', '2015 has ended and iOS app developers had a really busy year. There are was a new updated Operating System, not to mention the newly released smartphones and wearables. While there are a hundreds of thousands of apps have been came out, some of them have got the likes of us in the App Store', '<div class="new_description ">2015 has ended&nbsp;and iOS app developers had a really busy year. There are was a new updated Operating System, not to mention the newly released smartphones and wearables. While there are a hundreds of thousands of apps have been came out, some of them have got the likes of us in the App Store. So we have compiled a list of top 10 most downloaded paid <a href="http://mobda.com/top-10-most-downloaded-ios-apps-free-of-2015-named-by-apple/" target="_blank">iOS apps</a> of 2015 (which are hand-picked by Apple itself).<h3><strong>1. Heads Up!</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-02.jpeg"><img class="aligncenter size-full wp-image-7467" src="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-02.jpeg" alt="top-paid-ios-apps-2015-02" width="250" height="443"></a><span style="color: #999999;"><em>Source: itunes.apple.com</em></span></p><p><strong>Category:</strong> Games</p><p><strong>Developer:</strong> Warner Bros.</p><p><strong>Price:</strong> ₹60</p><p style="text-align: justify;"><em>Heads Up</em> is a party-style trivia game which is being promoted by widely-known reality TV show <em>The Ellen DeGeneres Show</em>. By downloading and installing this game on your iOS handset, you can rival with one or more of your friends on a trivia contest. Though you won’t enjoy much on Heads Up by playing alone, it can be the ideal app for juicing up a family event or a dinner party.</p><p style="text-align: justify;">The way this app works is, you choose a trivia category over one of seven themed pack of “cards”. Apparently they aren’t traditional trivia categories; the game incorporates trivia with recognizing weird accents, enacting an action (like in the Classic Charades), humming a sound to guess the song, and a lot of other fun activities.</p><p style="text-align: justify;">Buy this app from the <a href="https://itunes.apple.com/in/app/heads-up!/id623592465?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3><strong>2. Minecraft: Pocket Edition</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-03.jpeg"><img class="aligncenter size-full wp-image-7468" src="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-03.jpeg" alt="top-paid-ios-apps-2015-03" width="250" height="443"></a><span style="color: #999999;"><em>Source: itunes.apple.com</em></span></p><p><strong>Category:</strong> Games</p><p><strong>Developer:</strong> Mojang</p><p><strong>Price:</strong> ₹420</p><p style="text-align: justify;">For those new to <em>Minecraft: Pocket Edition</em>, it’s a sandbox game where players quest the game-world made completely with enlarged pixels or blocks. Users travel through the world of Minecraft and take part in undetermined objectives like excavating and collecting objects then merging it using recipes to form new items. Users quest at their own rate and may gather and store items, build shapes and architectures.</p><p style="text-align: justify;">The “Minecraft: Pocket Edition” for iPhone is available in both <strong>Lite</strong> (free) and <strong>Paid</strong> (₹420). The paid version has a better gameplay that feels same as in the PC edition and is the most preferred one too!</p><p>Buy this app from the <a href="https://itunes.apple.com/in/app/minecraft-pocket-edition/id479516143?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3><strong>3. Trivia Crack (Ad Free)</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-04.jpeg"><img class="aligncenter size-full wp-image-7469" src="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-04.jpeg" alt="top-paid-ios-apps-2015-04" width="250" height="444"></a><span style="color: #999999;"><em>Source: itunes.apple.com</em></span></p><p><strong>Category:</strong> Games</p><p><strong>Developer:</strong> Etermax</p><p><strong>Price:</strong> ₹190</p><p style="text-align: justify;"><em>Trivia Crack</em> took the app market by storm when it launched thanks to its adorable characters and smooth multiplayer options. Discover which of your buddies has the most trivial knowledge in 6 categories: <em>Geography, History, Entertainment, Art, Sports, and Science</em>. If you are a true trivia wizard you can also submit your own questions, which will later the added into the game for other users to see if they’re solid enough.</p><p style="text-align: justify;">Buy this app from the <a href="https://itunes.apple.com/in/app/trivia-crack-ad-free/id723795263?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3><strong>4. Five Nights at Freddy’s 2</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-05.jpeg"><img class="aligncenter size-full wp-image-7470" src="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-05.jpeg" alt="top-paid-ios-apps-2015-05" width="520" height="293"></a><span style="color: #999999;"><em>Source: itunes.apple.com</em></span></p><p><strong>Category:</strong> Games</p><p><strong>Developer:</strong> Scott Cawthon</p><p><strong>Price:</strong> ₹190</p><p style="text-align: justify;">For those who are new to <em>Five Night at Freddy’s</em>, this is a horror game that concentrates less on the game interface and more on the pure hysterical terror that its limited mechanics makes possible.</p><p style="text-align: justify;">In the game, you’ll be featured as a newly-hired security guard (<em>the last one opted for day shift – does it ring any bells?</em>) as he guards a kid’s restaurant during the night time. Just when he starts his first shift, his superior helpfully brings up that the <strong>slushy animatronic robots</strong> often come alive during the night and approach on the first sight of human being that they can ‘amuse’.</p><p style="text-align: justify;">Those who have played the first version will be glad to witness more interesting story segments and Easter Eggs featured with this version, adding some significance to the backstory.</p><p style="text-align: justify;">Buy this app from the <a href="https://itunes.apple.com/in/app/five-nights-at-freddys-2/id941143328?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3><strong>5. Facetune</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-06.jpeg"><img class="aligncenter size-full wp-image-7471" src="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-06.jpeg" alt="top-paid-ios-apps-2015-06" width="250" height="444"></a><span style="color: #999999;"><em>Source: itunes.apple.com</em></span></p><p><strong>Category:</strong> Photo &amp; Video</p><p><strong>Developer:</strong> Lightbricks Ltd.</p><p><strong>Price:</strong> ₹250</p><p style="text-align: justify;"><em>Facetune</em> is a paid photo editing app for iOS that offer you professional quality tools for all your needs. The iOS app is meant to be used with portraits or collages providing you the tools to enhance the overall appearance of your photos.</p><p style="text-align: justify;">On launching the app, you’re right away provided with the option to use a demo picture. The demo pictures are portraits of persons who might have revealed freckles, hair on their faces blemishes or some other stuff that can be eliminated through the app.</p><p style="text-align: justify;">We advise setting out with a <em>demo picture</em>, since it offers you a chance to get used to with the app and its tools you will soon be working with.</p><p>Buy this app from the <a href="https://itunes.apple.com/in/app/facetune/id606310581?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3><strong>6. Geometry Dash</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-07.jpeg"><img class="aligncenter size-full wp-image-7472" src="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-07.jpeg" alt="top-paid-ios-apps-2015-07" width="250" height="444"></a><span style="color: #999999;"><em>Source: itunes.apple.com</em></span></p><p><strong>Category:</strong> Games</p><p><strong>Developer:</strong> RobTop Games AB</p><p><strong>Price:</strong> ₹120</p><p style="text-align: justify;"><em>Geometry Dash</em>: The gameplay is very simple – all you have to do is tapping. A couple of environmental objects like glowing disks that make mid-air jumps possible are thrown into the shuffle, but all you need to worry about is timing the jumps. That’s, of course, a lot harder than it sounds. Every level is filled with obstacles to avoid, and contact with anything that isn’t ground will bring you immediate death. Fail and you’re back to the beginning of the stage.</p><p>Buy this app from the <a href="https://itunes.apple.com/in/app/geometry-dash/id625334537?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3><strong>7. Five Nights at Freddy’s</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-08.jpeg"><img class="aligncenter size-full wp-image-7473" src="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-08.jpeg" alt="top-paid-ios-apps-2015-08" width="520" height="293"></a><span style="color: #999999;"><em>Source: itunes.apple.com</em></span></p><p><strong>Category:</strong> Games</p><p><strong>Developer:</strong> Scott Cawthon</p><p><strong>Price:</strong> ₹190</p><p style="text-align: justify;"><em>Five Nights at Freddy’s</em> is the first installment in this series, and hope you know enough about this title as we have discussed about its sequel earlier.</p><p style="text-align: justify;">Buy this app from the <a href="https://itunes.apple.com/in/app/five-nights-at-freddys/id912536422?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3><strong>8. AfterLight</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-09.jpeg"><img class="aligncenter size-full wp-image-7474" src="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-09.jpeg" alt="top-paid-ios-apps-2015-09" width="250" height="444"></a><span style="color: #999999;"><em>Source: itunes.apple.com</em></span></p><p><strong>Category:</strong> Photo &amp; Video</p><p><strong>Developer:</strong> Afterlight Collective, Inc</p><p><strong>Price:</strong> ₹60</p><p style="text-align: justify;"><em>AfterLight</em> have got the likes of most people, which then become a go-to iOS photo-editing app. Besides the basic editing tools such as brightness and cropping, there are a lot of <em>amazing filters, frames,</em> and <em>textures</em> that make pictures look extraordinary. You can share the end product at <strong>high resolution</strong> to thousands of other apps and social media. Like other apps in the market, this one has some issues too.</p><p>Buy this app from the <a href="https://itunes.apple.com/in/app/afterlight/id573116090?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3><strong>9. Plague Inc.</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-10.jpeg"><img class="aligncenter size-full wp-image-7475" src="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-10.jpeg" alt="top-paid-ios-apps-2015-10" width="250" height="443"></a><span style="color: #999999;"><em>Source: itunes.apple.com</em></span></p><p><strong>Category:</strong> Games</p><p><strong>Developer:</strong> Ndemic Creations</p><p><strong>Price:</strong> ₹60</p><p style="text-align: justify;"><em>Plague Inc.</em> is a latest and possibly greatest debut in the <em>agitatingly popular</em> pandemic simulation category. You will be assigned to create the most deadly and effective plague possible, with the obscurely satisfying final objective of <em>destroying every human on the world</em> before they find out and cure your designed virus. Your contamination sets out basic, but can be modified on a regular basis and spread more quickly, or to be built more deadly.</p><p>Buy this app from the <a href="https://itunes.apple.com/in/app/plague-inc./id525818839?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3><strong>10. Goat Simulator</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-11.jpeg"><img class="aligncenter size-full wp-image-7466" src="http://mobda.com/wp-content/uploads/2016/01/top-paid-ios-apps-2015-11.jpeg" alt="top-paid-ios-apps-2015-11" width="250" height="443"></a><span style="color: #999999;"><em>Source: itunes.apple.com</em></span></p><p><strong>Category:</strong> Games</p><p><strong>Developer:</strong> Coffee Stain Studios</p><p><strong>Price:</strong> ₹300</p><p style="text-align: justify;"><em>Goat Simulator</em> is nothing but causing as much holocaust as you can but as a goat. The game has been compared with an old school skating game, except being a goat instead of a skater, and rather than doing tricks with skate board, you destroy stuff. Here you’ll destroy stuff with style, such as <em>head-butting a chair while doing a backflip</em>, and you will get even more scores! Or you could simply give Steam Workshop a try and build your own goats, missions, levels etc.</p><p>Buy this app from the <a href="https://itunes.apple.com/in/app/goat-simulator/id868692227?mt=8" target="_blank"><strong>App Store</strong></a>.</p><!-- WhatsApp Share Button for WordPress: http://peadig.com/wordpress-plugins/whatsapp-share-button/ --><p></p>                                                          	</div>', '/image/uploads_news_newsImage-146719-1484683096.jpg', 1, '2017-01-17 14:28:16', '2017-01-17 14:58:43'),
(8, 'Top 10 Most Downloaded iOS Apps (Free) Of 2015 Named By Apple', 'App Store features all sorts of apps, while some are actually great and some are not. There are a lot of people who have no idea about which ones to download and which one to not. This is why we have presented you with the list of top 10 most downloaded iOS apps of 2015 which is named by Apple itself. And here’s the list that caught the attention of Apple:', '<div class="new_description ">App Store features all sorts of apps, while some are actually great and some are not. There are a lot of people who have no idea about which ones to download and which one to not. This is why we have presented you with the list of top 10 most downloaded iOS apps of 2015 which is named by Apple itself. And here’s the list that caught the attention of Apple:<h2 style="text-align: justify;"><strong>Top 10 Most Downloaded Free iOS Apps 2015</strong></h2><h3><strong>1. Trivia Crack</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free.jpeg"><img class="aligncenter size-full wp-image-7120" src="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free.jpeg" alt="top-10-free-ios-apps-free" width="250" height="444"></a></p><p style="text-align: justify;"><strong>Category:</strong> Games</p><p style="text-align: justify;"><strong>Developer:</strong> Etermax</p><p style="text-align: justify;"><em>Trivia Crack</em> is the latest game to achieve the top spots in both paid and free categories in the App Store. It is intriguing of a quiz title you would go to a sports bar in your neighborhood to battle in, and the gameplay is pretty much same as the <a href="https://itunes.apple.com/us/app/trivial-pursuit-friends/id988831192?mt=8" target="_blank"><em>Trivial Pursuit</em></a> which is a classic board game.</p><p style="text-align: justify;">Trivia Crack is a great <em>addictive game</em>, but like some other <strong><a href="http://mobda.com/iphone-6-the-changes-that-you-can-experience/" target="_blank">iOS</a></strong> apps in the market, the in-app purchases are so disappointing. Luckily you’ll be charged nothing to start the game, but you have to pay <strong>$2.99</strong> to get rid of the annoying ads from the game.</p><p style="text-align: justify;">Get this app from the <a href="https://itunes.apple.com/in/app/trivia-crack/id651510680?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3 style="text-align: justify;"><strong>2. Messenger</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-02.jpeg"><img class="aligncenter size-full wp-image-7121" src="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-02.jpeg" alt="top-10-free-ios-apps-free-02" width="250" height="444"></a></p><p style="text-align: justify;"><strong>Category:</strong> Social Networking</p><p style="text-align: justify;"><strong>Developer:</strong> Facebook, Inc.</p><p style="text-align: justify;"><em>Facebook Messenger</em> is a great instant messenger application that includes mighty group chat and quality VoIP calling. There are plenty of other messenger apps that claim to save you some bucks by embracing the function typically provided by your cell phone carrier. Cancel your voice and SMS plans, they claim, and use cellular data or Wi-Fi rather!</p><p style="text-align: justify;">Facebook is the <em>best bet in this category</em> just by excellence of its nifty UI, tons of features, and large fan base. There’s an added benefit of not having to register yet another new account as well. Only thing the app lacks is the video calling feature. Every facebook user certainly want this app!</p><p style="text-align: justify;">Get this app from the <a href="https://itunes.apple.com/in/app/messenger/id454638411?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3 style="text-align: justify;"><strong>3. Dubsmash</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-03.jpeg"><img class="aligncenter size-full wp-image-7122" src="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-03.jpeg" alt="top-10-free-ios-apps-free-03" width="250" height="444"></a></p><p style="text-align: justify;"><strong>Category:</strong> Entertainment</p><p style="text-align: justify;"><strong>Developer:</strong> Mobile Motion GmbH</p><p style="text-align: justify;"><em>Dubsmash</em> is an amazing social innovation and an extraordinary potential comic tool. The crazy little videos you will create using the app may ruin real-time conversations between you and your allies, but at least it will be a humorous destruction.</p><p style="text-align: justify;">If you are a fan of “<em>Lip Sync Battles</em>”, you will probably grasp the concept of Dubsmash. Pick an audio, whether it’s a song or a popular movie dialogue or even just a strange sound, and record a video of yourself to keep with it.</p><p style="text-align: justify;">The limited video clip length and low video quality are the major drawbacks of this app.</p><p style="text-align: justify;">Get this app from the <a href="https://itunes.apple.com/in/app/dubsmash/id918820076?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3 style="text-align: justify;"><strong>4. Instagram</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-04.jpeg"><img class="aligncenter size-full wp-image-7123" src="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-04.jpeg" alt="top-10-free-ios-apps-free-04" width="250" height="444"></a></p><p style="text-align: justify;"><strong>Category:</strong> Photo &amp; Video</p><p style="text-align: justify;"><strong>Developer:</strong> Instagram, Inc.</p><p style="text-align: justify;"><em>Instagram</em> is a very popular photo &amp; video sharing app the needs just a few touches to create <em>retro-looking</em> works and then share it with Instagram members. The recent update lets you add filters to videos and share them to your profile just like you work with pictures.</p><p style="text-align: justify;">The latest <em>Lux Slider</em> update gives you the ability to control the contrast and brightness. And Instagram finally added the support for portrait and landscape formats, which is very easy to use. But the one special factor about the Instagram sensation is how people have used it to create a tale on their routine lives through stylized pictures and videos.</p><p style="text-align: justify;">Get this app from the <a href="https://itunes.apple.com/in/app/instagram/id389801252?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3 style="text-align: justify;"><strong>5. Snapchat</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-05.jpeg"><img class="aligncenter size-full wp-image-7124" src="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-05.jpeg" alt="top-10-free-ios-apps-free-05" width="250" height="444"></a></p><p style="text-align: justify;"><strong>Category:</strong> Photo &amp; Video</p><p style="text-align: justify;"><strong>Developer:</strong> Snapchat, Inc.</p><p style="text-align: justify;">Widely popular social network <em>Snapchat</em> earned a name for it by allowing you to share pictures and videos that automatically <em>self-destructs</em> in seconds. That is, Snapchat lets you establish a limited life-time on your shares so they are available just for a few seconds before getting <em>removed automatically</em>.</p><p style="text-align: justify;">Although there’s surely a debate that the moments-long life-time is ineffective, Snapchat’s huge user base, particularly with young adults and teens, expresses differently. Obviously, there are lots of people out there who love cherish the thought of sending out <em>private pictures</em> and videos, without leaving any trace.</p><p style="text-align: justify;">Get this app from the <a href="https://itunes.apple.com/in/app/snapchat/id447188370?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3 style="text-align: justify;"><strong>6. YouTube</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-06.png"><img class="aligncenter size-full wp-image-7125" src="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-06.png" alt="top-10-free-ios-apps-free-06" width="256" height="256"></a></p><p style="text-align: justify;"><strong>Category:</strong> Photo &amp; Video</p><p style="text-align: justify;"><strong>Developer:</strong> Google, Inc.</p><p style="text-align: justify;"><em>YouTube</em> for iOS devices is the <em>downright app for surfing the website</em> ever since Apple bumped off its version from the iOS, and to be honest, it has been a huge improvement. But with the recent update, a renovated UI and new <em>picture-in-picture</em> video feature that allows the user to continue watching the video while browsing through other videos.</p><p style="text-align: justify;">Same as the Website, with the YouTube iOS app you will be able to watch and upload videos, subscribe to your favorite channels, browse through your playlists and subscriptions, and lot more. The app starts with a video feed from your subscribed channels along with the recommended ones based on your watching behavior. No doubt this is one of the most downloaded iOS apps of 2015.</p><p style="text-align: justify;">Get this app from the <a href="https://itunes.apple.com/in/app/youtube/id544007664?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3 style="text-align: justify;"><strong>7. Facebook</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-07.jpeg"><img class="aligncenter size-full wp-image-7126" src="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-07.jpeg" alt="top-10-free-ios-apps-free-07" width="250" height="444"></a></p><p style="text-align: justify;"><strong>Category:</strong> Social Networking</p><p style="text-align: justify;"><strong>Developer:</strong> Facebook, Inc.</p><p style="text-align: justify;">With a nifty performance than the mobile website and instant access to your frequently-used functions, the Facebook iOS app is certainly the <em>best way to connect with Facebook</em> from your iPhone.</p><p style="text-align: justify;">The app is updated regularly to give you the best of best, with a great new UI, advanced sharing options and a feature that helps you find your buddies who are nearby and meet up with them.</p><p style="text-align: justify;">In previous versions of the iOS app, the UI was same as the Facebook’s website, but in latest versions, that’s all different. For example, the old navigation icons for Status, Check In and Photo at the top has been replaced by a new set of five icons.</p><p style="text-align: justify;">Get this app from the <a href="https://itunes.apple.com/in/app/facebook/id284882215?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3 style="text-align: justify;"><strong>8. Uber</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-08.jpeg"><img class="aligncenter size-full wp-image-7127" src="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-08.jpeg" alt="top-10-free-ios-apps-free-08" width="250" height="444"></a></p><p style="text-align: justify;"><strong>Category:</strong> Travel</p><p style="text-align: justify;"><strong>Developer:</strong> Uber Technologies, Inc.</p><p style="text-align: justify;">Getting a cab isn’t like moving a mountain, but it sure can be a trouble when you try hard but just can’t get the attention of any cab driver. <em>Uber</em> helps eliminate a lot of such difficulties out of the conventional ways of hailing a cab.</p><p style="text-align: justify;">The idea leads to something like this: Download and install the free Uber iOS app for your iPhone, and use it to notify your need for a cab.</p><p style="text-align: justify;">All you have to do is a few taps, and a nice, shiny black colored cab will show up within a few minutes to pick you up to your destinations. As your credit card is already saved on to the Uber app, you fare and tip will be collected automatically. Piece of cake, isn’t it?</p><p style="text-align: justify;">Get this app from the <a href="https://itunes.apple.com/in/app/uber/id368677368?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3 style="text-align: justify;"><strong>9. Crossy Road – Endless Arcade Hopper</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-09.jpeg"><img class="aligncenter size-full wp-image-7128" src="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-09.jpeg" alt="top-10-free-ios-apps-free-09" width="250" height="444"></a></p><p style="text-align: justify;"><strong>Category:</strong> Games</p><p style="text-align: justify;"><strong>Developer:</strong> HIPSTER WHALE</p><p style="text-align: justify;">You have to know that <em>Crossy Road</em> is a simple arcade game that involves helping a chicken or other characters crossing the road safely. Characters can be crushed by cars, attacked by eagles, or drowned in water, but all those are carried out in a very cartoony way, without any blood.</p><p style="text-align: justify;">While this game is available as a free download, there are around <strong>90 different characters</strong> available for purchase, which can be bought using real money or in-game money obtained by collecting coins or watching advertisements shown in-game.</p><p style="text-align: justify;">The app also lets you share your “<em>fail pictures</em>” of your character getting killed or the video of your gameplay to your Social Media profiles.</p><p style="text-align: justify;">Get this app from the <a href="https://itunes.apple.com/in/app/crossy-road-endless-arcade/id924373886?mt=8" target="_blank"><strong>App Store</strong></a>.</p><h3 style="text-align: justify;"><strong>10. Google Maps</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-10.jpeg"><img class="aligncenter size-full wp-image-7129" src="http://mobda.com/wp-content/uploads/2015/12/top-10-free-ios-apps-free-10.jpeg" alt="top-10-free-ios-apps-free-10" width="250" height="444"></a></p><p style="text-align: justify;"><strong>Category:</strong> Navigation</p><p style="text-align: justify;"><strong>Developer:</strong> Google, Inc.</p><p style="text-align: justify;">Google Maps iOS version continues to lead the chart in navigation category leaving behind Apple Maps, with further improvements after the huge update of version 3.0 that comprised user-friendly ways to explore your neighborhood, advanced navigation features and the ability to give ratings. Though Apple Maps honestly got improved over the course of time, Google Maps continues to be the <em>best iOS navigation till date</em>, and it’s getting better.</p><p style="text-align: justify;">The UI is especially neat and intuitive, and <em>Street View</em>, <em>turn-by-turn voice navigation</em>, Google’s accuracy of mapping and more details of interest in the <em>Points of Interest</em> (POI) database make a great deal.</p><p style="text-align: justify;">Get this app from the <a href="https://itunes.apple.com/in/app/google-maps/id585027354?mt=8" target="_blank"><strong>App Store</strong></a>.</p><!-- WhatsApp Share Button for WordPress: http://peadig.com/wordpress-plugins/whatsapp-share-button/ --><p></p>                                                          	</div>', '/image/uploads_news_newsImage-623663-1484683209.jpg', 1, '2017-01-17 14:30:10', '2017-01-17 14:58:44');
INSERT INTO `news` (`news_id`, `title`, `description`, `article`, `news_image`, `status`, `created_at`, `updated_at`) VALUES
(9, 'Leaked Images Of Samsung Galaxy S7 Indicates An Early Release Date', 'While it seems like the Samsung’s flagship models S6 & S6 edge launched just yesterday, tons of speculations are arising over the next flagship model. It will apparently be called the Galaxy S7, considering the names of its ‘S’ series flagships in the past.', '<div class="new_description "><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">While it seems like the Samsung’s flagship models S6 &amp; S6 edge launched just yesterday, tons of speculations are arising over the next flagship model. It will apparently be called the Galaxy S7, considering the names of its ‘S’ series flagships in the past.</span><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/12/alleged-galaxy-s7-01.png"><img class="aligncenter size-full wp-image-6774" src="http://mobda.com/wp-content/uploads/2015/12/alleged-galaxy-s7-01.png" alt="alleged-galaxy-s7-01" width="650" height="323"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><span style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(153, 153, 153);"><em style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Image Source:&nbsp;www.igalaxys7.com</em></span></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Samsung has yet again proved to the market leader of Android smartphones with the release of Galaxy S6 &amp; S6 edge later this year. Now the company is making the headlines often with the rumors of Galaxy S7 smartphone.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">One of the world’s largest telecommunication organizations “China Mobile” has appeared to have spilled the beans after images of alleged Galaxy S7 leaked from an important presentation. According to the reports of<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Slashgear</strong>, the leaked image shows a quick release for the Galaxy S7 hitting the market in February 2016.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/12/galaxy-s7-release-date-01.jpg"><img class="aligncenter size-full wp-image-6775" src="http://mobda.com/wp-content/uploads/2015/12/galaxy-s7-release-date-01.jpg" alt="galaxy-s7-release-date-01" width="700" height="393"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><em style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;"><span style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(153, 153, 153);">Image Source:&nbsp;weibo.com/133023200</span></em></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">In the above image captured by a Weibo micro-blogger, you can also find the release date of Galaxy Note 5 (32GB).</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">It is also being said that Samsung is working on a lot of new features for its future flagship devices and started optimizing new hardware specs, such as e-sim card, smarter camera, fast charging etc. Samsung Galaxy S7 is believed to launch with latest versions of Android OS, Android Marshmallow.</p><p></p>                                                          	</div>', '/image/uploads_news_newsImage-227743-1484683342.jpg', 1, '2017-01-17 14:32:22', '2017-01-17 14:58:45'),
(10, ' iPhone 6 – The Changes That You can Experience', 'iPhone 6 is the latest version of well-liked series of Apple’s smartphone, the iPhone. This is the seventh generation mobile phone and succeeds iPhone 5S. There was much excitement regarding the release of iPhone 6', '<div class="new_description "><span style="color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: 1px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">iPhone 6 is the latest version of well-liked series of Apple’s smartphone, the iPhone. This is the seventh generation mobile phone and succeeds iPhone 5S. There was much excitement regarding the release of iPhone 6 because Apple’s tech adversary Samsung was also releasing their mobile phone, Galaxy S3 to make the fight stiffer than before. Consumers all over the globe were wondering what this phone had to offer. Well, let us look at the iPhone 6 starting from the outside features to the internal features inside the phone.</span><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/iPhone-6-The-Changes-That-You-can-Experience.jpg"><img class="aligncenter size-full wp-image-3834" src="http://mobda.com/wp-content/uploads/2015/11/iPhone-6-The-Changes-That-You-can-Experience.jpg" alt="iPhone 6 - The Changes That You can Experience" width="600" height="400"></a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">First, as is common to iPhone, the display is Retina HD display, 4.7-inch (diagonal) LED-backlit screen, Multi‑Touch display with IPS technology, 1334×750-pixel resolution at 326 ppi, 1400:1 contrast ratio (typical) this makes it the thinnest and the lightest iPhone ever.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">IPhone 6 can support 4G network with nano SIM. It has an internal memory of 16/64/128 GB, 1 GB RAM DDR3 with no external memory card slot. Sincerely, who needs a memory card with that amount of memory? There have been many desktops with hard drives of even less than half the memory. With this huge memory, anyone can watch a movie on this phone and listen to loads of music. The phone also supports 3.5mm audio jack pin, which can be utilized for headphones or even loudspeakers.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">iPhone 6 has Assisted GPS and GLONASS, Wifi, Digital compass, iBeacon, Mobile data, micro-location. Other technologies the iPhone supports are Wi-Fi connectivity, Bluetooth and USB slot. For individuals with the push to not letting any moment pass without capturing it, iPhone 6 has an 8-mega pixel camera on the backside. Camera features include 1.2-megapixel photos/2.2 aperture, 720p HD video recorder, reverse illumination sensor; Auto HD Recording for photos and videos, Face recognition, Burst approach, Exposure management, Timer mode iPhone 6 can be your best partner and gadget at all times.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">With an A8 chip with 64-bit design M8 motion coprocessor, it has iOS 9 operating system, also, has built-in sensors such as a Touch ID, Barometer, Three-axis gyrometer, Proximity sensor, Accelerometer, an Ambient sensor with the screen generating touch events while on a call.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">For messaging, iPhone has iMessage, SMS (threaded view), MMS, Email and Push Email. Other messaging apps such as WhatsApp and Vibe are also available. There is no integrated radio but there is quite available number of apps available for radio streaming. It supports an HTML browser, Safari, and is GPS supported. Countless social apps and games are available which keep you busy all day long.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">It has a non-removable Li-Po 1810 mAh battery with a talk time of up to 14 hours. The stand-by time is up to 250 hours. Like past updates of the Apple iOS mobile operating system, iOS 9 is an open source upgrade for all Apple mobile gadget owners. If your device presently runs iOS 8, it should be able to install and run iOS 9 when it comes out once iOS 9 is released.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">This is the perfect phone for everybody. For business, for entertainment, it is a fact that all iPhone owners love their iPhone and is not only credited to the distinctive glossy display but its dependability and ease of use. The iPhone 6 takes the word ‘trendy’ and ‘sophistication’ to a next level. It is manifest that designers in iPhone6 have put much effort. There are several rivals in the smartphone industry trying to topple the iPhone from dominance but with iPhone 6, Apple has surely proven one time more that they are well above the other phones.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">The phone’s 4-inch retina display is also one of the factors that have made it preferable to other smartphones among the consumers. One wonderful thing about iPhone is the fact that it has the same width as its predecessor. Therefore, it is quite easy to use it with one hand and is not as bulky as other smartphones are. At present, people like being connected through their phone at all times. iPhone 6 is a one-stop shop for high-speed internet connection. This has been made possible with latest wireless technologies, enabling iPhone 6 to connect to more networks all over the world. You can browse, view streaming media and download more with the fast wireless connection thus making your online presence a enjoying and intriguing experience. One of the most important attribute people look for in a smartphone is the internet performance, and the iPhone 6 surely is the best among competitors.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">This phone is an intriguing gadget however, it has so many advanced features, but it is so thin and so light. In fact, iPhone 6 is the thinnest and lightest mobile phone in the market now. Apple could have taken the easier step and come up with something realistic and which was not so remarkable. However, they did not. Due to the advancement in technology, they were able to make this a masterpiece. They were indomitable to provide us with a quality phone, and they worked very hard. The result was iPhone 6: the thinnest, the lightest and the fastest iPhone ever.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Passbook is now Apple Wallet</strong></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Big mobile payments news in iOS 9: The Passbook app that currently stores your credit cards for Apple Pay is coined as the Wallet app. It will now be able to store Discover cards, as well as store cards.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Maps Gets Mass Transit Support</strong></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Fortunately, Apple Maps is finally trying to address this kind of pedestrian use by adding clear directions on mass transit, complete with real-time transit schedules. Maps also now show you where passageway entrances are located, so you will not need to go looking for the exact stairway or gate to enter.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">iPad with Split screen</strong></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">There are iPad-specific exciting iOS 9, including some great multitasking aspects. Split View permits you to have two apps open on your iPad at once, side-by-side so you can be browsing a website on one-half of the screen and another on the other.</p><p></p>                                                          	</div>', '/image/uploads_news_newsImage-145922-1484683705.jpg', 1, '2017-01-17 14:38:25', '2017-01-17 14:58:46'),
(11, '10 Most Expensive Phones In The World  ', 'Mobile Phones everywhere! World domination seems to be the agenda to these gadgets. There are only a handful people who are yet unaware of the existence of mobile phones. But, as days progress.', '<div class="new_description ">Mobile Phones everywhere! World domination seems to be the agenda to these gadgets. There are only a handful people who are yet unaware of the existence of mobile phones. But, as days progress. The simplicity of using a phone for connectivity seems to be replaced with a variety of purpose such as networking, social media and as one-stop entertainment solution. The ravishing trend of accessorising the mobile phone with the luxury and enhancements seems rather captivating to those willing to spend a fortune. So, here is a compilation of top 10 most expensive phones in the world. It’ll make your eyes glitter in awe. But, be warned! They are pricey! Very Pricey!<h3 style="text-align: justify;"><strong>10. Vertu Signature Diamond</strong></h3><div style="text-align: center;"><figure id="attachment_3173" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/Signature-S-Pure-Black-Diamonds2.jpg"><img class="wp-image-3173 size-full" src="http://mobda.com/wp-content/uploads/2015/11/Signature-S-Pure-Black-Diamonds2.jpg" alt="10 Most Expensive Phone In The World-Vertu Signature Diamond&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: vertuchinhhang</figcaption></figure></div><p style="text-align: justify;">It is one of the top bling phones on the market. Why? It simply has a glittering rock and costs $88,300. If that figure doesn’t pop your eyes, nothing else will. The phone from Vertu has the most advance features a phone can have. It has a flawless design and looks trendy. Certainly the best way to make your ego feel good.</p><h3 style="text-align: justify;"><strong>9. iPhone Princess Plus</strong></h3><div style="text-align: center;"><figure id="attachment_3175" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/iPhone-Princess-Plus-–-176400.jpg"><img class="wp-image-3175 size-full" src="http://mobda.com/wp-content/uploads/2015/11/iPhone-Princess-Plus-–-176400.jpg" alt="10 Most Expensive Phone In The World-iPhone Princess Plus&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: mostexpensivelist</figcaption></figure></div><p style="text-align: justify;">Princess phone for daddy’s little princess. Of course, if the price doesn’t bother you. The iPhone Princess Plus is a phone oozing with luxury and the brand speaks for itself. It is designed by a famous jeweller Peter Aloisson and features 318 diamonds that princess cut and set in an 18k gold rim. So, if you have a daddy willing to give you $176,400, then you may want to dig into features of this phone.</p><h3 style="text-align: justify;"><strong>8. Black Diamond VIPN smartphone</strong></h3><div style="text-align: center;"><figure id="attachment_3176" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/Black-Diamond-VIPN-Smartphone.png"><img class="wp-image-3176 size-full" src="http://mobda.com/wp-content/uploads/2015/11/Black-Diamond-VIPN-Smartphone.png" alt="10 Most Expensive Phone In The World-Black Diamond VIPN smartphone&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;" width="600" height="400"></a><figcaption class="wp-caption-text">Imagae Courtesy: theestle</figcaption></figure></div><p style="text-align: justify;">Want a phone that is so distinctive in its shape it makes you drool? Then here is a phone you need to know. The Black Diamond VIPN smartphone. It is a super slim phone, sleek, and borderless. It is further enhanced with a super gloss finish. The phone features three carat diamonds on the rear and a mini 0.25 carat stud on the joystick. This phone is all yours if you have $300,000 to spare. The phone is so exclusive, only 5 of these were ever made.</p><h3 style="text-align: justify;"><strong>7. Vertu Signature Cobra</strong></h3><div style="text-align: center;"><figure id="attachment_3177" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/Vertu-signature-Cobra-2.jpg"><img class="wp-image-3177 size-full" src="http://mobda.com/wp-content/uploads/2015/11/Vertu-signature-Cobra-2.jpg" alt="10 Most Expensive Phone In The World-Vertu Signature Cobra&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: theestle</figcaption></figure></div><p style="text-align: justify;">Here is another model from Vertu. It’s catchy, trendy and gorgeous in appearance. On the side of the phone is a cobra that is made of 409 rubies and two emeralds as its eyes. But, what makes it exclusive? The super rare pear cut diamond that is installed on the casing. You can’t carry such a phone into a party without drawing attention to your phone. The phone costs $310,000.</p><h3 style="text-align: justify;"><strong>6. Gresso Luxor Las Vegas Jackpot</strong></h3><figure id="attachment_3178" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/Gresso-Luxor-World-time-luxury-watch-2.jpg"><img class="wp-image-3178 size-full" src="http://mobda.com/wp-content/uploads/2015/11/Gresso-Luxor-World-time-luxury-watch-2.jpg" alt="10 Most Expensive Phone In The World-Gresso Luxor Las Vegas Jackpot&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;" width="600" height="591"></a><figcaption class="wp-caption-text">Image Courtesy: unwiredview</figcaption></figure><p style="text-align: justify;">It might seem like a joke if you heard a phone costs a million dollars. Yes! You read that right, one followed by six zeroes. The Gresso Luxor Las Vegas Jackpot is a collector’s phone that costs a million dollars. The entire phone is draped in black diamond and the frame weighs 180g and is 12mm thick. The back casing of the phone is made of 200-year-old African Blackwood. The phone also has 17 hand polished sapphires that are etched into the device. So, if you are in Vegas aim for the jackpot and who can say? You could be the lucky one walking away with the priciest phone ever made.</p><h3 style="text-align: justify;"><strong>5. Diamond Crypto Smartphone</strong></h3><figure id="attachment_3179" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/diamond-crypto-smartphone.jpg"><img class="wp-image-3179 size-full" src="http://mobda.com/wp-content/uploads/2015/11/diamond-crypto-smartphone.jpg" alt="10 Most Expensive Phone In The World-Diamond Crypto Smartphone&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: techprevue</figcaption></figure><p style="text-align: justify;">Say! If you want the perfect blend of technology and style, you may want to invest your time in checking out Diamond Crypto Smartphone. The phone is an ultimate definition of luxury! It is laden with the priciest metals and stones. The prime feature of the phone is the powerful encryption technology that makes it not just catchy in appearance, but also safe to carry. The casing of the phone is made of solid platinum and has Ancort logo and has navigation feature. It also has 18 carats rose gold and 28 cut diamonds around the navigation key. The sides are decorated with 25.5 princess diamonds and the top surface of the phone has eight more diamonds. The price of the phone? Just $1.3 million, if that doesn’t pause your breath.</p><h3 style="text-align: justify;"><strong>4. GoldVish Le Million</strong></h3><figure id="attachment_3180" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/GoldVish-Le-Million-w.jpg"><img class="wp-image-3180 size-full" src="http://mobda.com/wp-content/uploads/2015/11/GoldVish-Le-Million-w.jpg" alt="10 Most Expensive Phone In The World-GoldVish Le Million&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: 4.bp.blogspot</figcaption></figure><p style="text-align: justify;">The phone was launched in Switzerland by a famous designer Emmanuel Gueit. It is completely hand built with 120 carat VVS-1 graded diamond along with 18 carats white gold. Just 100 pieces were made and were manufactured on request only! In 2006, it was sold for a million dollars to a Russian businessman who went on to make a record on the Guinness world records as the priciest phone ever.</p><h3 style="text-align: justify;"><strong>3. iPhone 3G King’s Button</strong></h3><figure id="attachment_3181" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/Peter-Aloisson-iPhone-3G-Kings-Button.jpg"><img class="wp-image-3181 size-full" src="http://mobda.com/wp-content/uploads/2015/11/Peter-Aloisson-iPhone-3G-Kings-Button.jpg" alt="10 Most Expensive Phone In The World-iPhone 3G King’s Button" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: gsmreviews</figcaption></figure><p style="text-align: justify;">On the third spot is the iPhone 3G King. On the home button is the 6.6 carats fine quality diamond that makes you drool. Rest of the phone is made of 18carat yellow metal and the lining is made of white and rose gold. It also has 138 perfecting cut diamonds that are handcrafted on the casing. The price tag of the phone is a whopping $1.5 to 2 million. It is made by a famous Australian jeweller Peter Aloisson.</p><h3 style="text-align: justify;"><strong>2. Supreme Goldstriker IPhone 3G 32GB</strong></h3><figure id="attachment_3182" style="width: 590px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/supreme-goldstriker-iphone-3g-32gb-jpg.jpg"><img class="wp-image-3182 size-full" src="http://mobda.com/wp-content/uploads/2015/11/supreme-goldstriker-iphone-3g-32gb-jpg.jpg" alt="10 Most Expensive Phone In The World-Supreme Goldstriker IPhone 3G 32GB&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;" width="590" height="443"></a><figcaption class="wp-caption-text">Image Courtesy: vcpost</figcaption></figure><p style="text-align: justify;">More iPhones again on the list of top 10 most expensive phone ever made. The supreme Goldstriker iPhone 3G takes the second spot as the priciest gadget ever. The price tag of this model is 3.2 million dollars. Its designer is Stuart Hughes. The phone is coated with 132F diamonds and 271g of 22 carats solid gold. On the home screen rests a 7.1 carat diamond. The phone is the ultimate representation of luxury and sports a rare Kashmir gold and the lining is made of Nubuck animal skin.</p><h3 style="text-align: justify;"><strong>1. Diamond Rose iPhone 4 32GB</strong></h3><figure id="attachment_3183" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/55d72349efab0.jpg"><img class="wp-image-3183 size-full" src="http://mobda.com/wp-content/uploads/2015/11/55d72349efab0.jpg" alt="10 Most Expensive Phone In The World-Diamond Rose iPhone 4 32GB" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: vcpost</figcaption></figure><p style="text-align: justify;">On the number one slot is the Diamond Rose iPhone 4. It is made by Stuart Hughes, the maker of finest and most expensive gadgets. The device costs a massive $8 million. Yes! Time to stitch back the dropped jaws. It has 500 pricey diamonds on the phone. The rear side of the casing is made of rose gold and the Apple logo is made of 53 diamonds. On the navigation button is a single cut 7.4 carat pink diamond. If you are lucky enough to be capable of buying this phone, you will get a classy granite box. Now you will be able to flaunt the phone in style.</p><!-- WhatsApp Share Button for WordPress: http://peadig.com/wordpress-plugins/whatsapp-share-button/ --><p></p>                                                          	</div>', '/image/uploads_news_newsImage-950616-1484683866.jpg', 1, '2017-01-17 14:41:06', '2017-01-17 14:59:02');
INSERT INTO `news` (`news_id`, `title`, `description`, `article`, `news_image`, `status`, `created_at`, `updated_at`) VALUES
(12, '10 Best Photo Editing App For Android', 'Most of us have officially made a transition from the traditional point and shoot to the highly efficient smartphone. Thanks to vertically scaling camera technology. ', '<div class="new_description ">Most of us have officially made a transition from the traditional point and shoot to the highly efficient smartphone. Thanks to vertically scaling camera technology. The point and shoot cameras will soon be history with the camera quality being comparable or at times being better than expected. And the performance perks come when there are post processing apps that enhance the appearance of photos. When you can look extra special in your favorite photographs with the photo editing tools that are free, then why not? So, here is 11 best Photo Editing App for Android.<h3 style="text-align: justify;"><strong>1. PhotoDirector: The ultimate</strong></h3><div style="text-align: center;"><figure id="attachment_3161" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/unnamed.png"><img class="wp-image-3161 size-full" src="http://mobda.com/wp-content/uploads/2015/11/unnamed.png" alt="10 Best Photo Editing App For Android-PhotoDirector: The ultimate" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: lh3.ggpht</figcaption></figure></div><p style="text-align: justify;">When an editing tool is released by a brand such as Cyberlink, it means you can expect the best from it. The PhotoDirector is a multipurpose photo editor. It is extremely easy to use that you can add overlays to edit the image and can get very creative with the effects and filters. If you are a pro editor, you will find a more formidable feature that lets you completely control the intricate details of the image such as the HSL tool and RGB curves.</p><p style="text-align: justify;">You can download this amazing app from <a href="https://play.google.com/store/apps/details?id=com.cyberlink.photodirector&amp;hl=en" target="_blank">here</a></p><h3 style="text-align: justify;"><strong>2. Adobe Lightroom Mobile: The heavyweight</strong></h3><figure id="attachment_3163" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/unnamed1.jpg"><img class="wp-image-3163 size-full" src="http://mobda.com/wp-content/uploads/2015/11/unnamed1.jpg" alt="10 Best Photo Editing App For Android-Adobe Lightroom Mobile: The heavyweight" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: lh3.googleusercontent</figcaption></figure><p style="text-align: justify;">If you are a fan of Adobe image editing tools, you will instantly fall in love with this app that is the brethren to the desktop version of the tool. The app is power packed with pro editing features that give the editor the complete control of the tool. All squeezed in a small package that fits right into your pocket. Certainly makes people say, “shut up and take my money.” However, to be able to use the Android version of Lightroom, you will need to have a subscription to Adobe Cloud Photography plan. But, if you are a serious smartphone photographer, you can’t be missing this app.</p><p style="text-align: justify;">You can download this amazing app from <a href="https://play.google.com/store/apps/details?id=com.adobe.lrmobile&amp;hl=en" target="_blank">here</a></p><h3 style="text-align: justify;"><strong>3. Photo Editor by Lidow: The fast and fun</strong></h3><figure id="attachment_3164" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/AndroidPIT-Photo-Editor-by-Lidow-w782.jpg"><img class="wp-image-3164 size-full" src="http://mobda.com/wp-content/uploads/2015/11/AndroidPIT-Photo-Editor-by-Lidow-w782.jpg" alt="10 Best Photo Editing App For Android- Photo Editor by Lidow: The fast and fun" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: fs01.androidpit</figcaption></figure><p style="text-align: justify;">Looking for fun ways to edit your photos without the hassle of sifting through a dozen photo editing tools that are tiring and confusing to explore? Then look no further than the Photo editor from Lidow. If complexity isn’t your thing, you will probably find it amusing to use Photo Editor. The fun goes a notch up when you have easy to use features that be applied effortlessly.</p><p style="text-align: justify;">You can download this amazing app from <a href="https://play.google.com/store/apps/details?id=com.baiwang.PhotoFeeling&amp;hl=en" target="_blank">here</a></p><h3 style="text-align: justify;"><strong>4. VSCO Cam: The Android favorite</strong></h3><figure id="attachment_3165" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/wpupcrgkay2yocxeldbs.jpg"><img class="wp-image-3165 size-full" src="http://mobda.com/wp-content/uploads/2015/11/wpupcrgkay2yocxeldbs.jpg" alt="10 Best Photo Editing App For Android-VSCO Cam: The Android favorite" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: i.kinja-img</figcaption></figure><p style="text-align: justify;">It is one of the most popular image editing apps on Android. It packs the best features that let you play with the finest image editing tools. Just perfect to make your picture look extra special. VSCO has a dedicated camera app; Instagram-like user uploads page, and solid editing features. If you are in the pro league of smartphone photography, you will be living a dream with this app. VSCO Cam’s list of filters is one click fix for photographs to make it aesthetically charming.</p><p style="text-align: justify;">The apps minimal interface makes it easy to use, and it is a serious game for professional editors who are serious about phone photography. The dials in the application are comfortable for use and gives subtle movements that are graceful for tweaking the images. And the better part – it is free for download.</p><p style="text-align: justify;">You can download this amazing app from <a href="https://play.google.com/store/apps/details?id=com.vsco.cam&amp;hl=en" target="_blank">here</a></p><h3 style="text-align: justify;"><strong>5. Photoshop Touch for phone: The classic</strong></h3><figure id="attachment_3166" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/Photoshop-Touch-for-phone.jpg"><img class="wp-image-3166 size-full" src="http://mobda.com/wp-content/uploads/2015/11/Photoshop-Touch-for-phone.jpg" alt="10 Best Photo Editing App For Android-Photoshop Touch for phone: The classic" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: 3.bp.blogspot</figcaption></figure><p style="text-align: justify;">Yes, it’s Photoshop! But wait! Don’t get too excited. Unlike the desktop publication, the Android app isn’t comprehensive. But, you will not be charged a massive subscription fee for using it. When you have paid $4.99, you will have some of the basic functions to toy around. The phone version of Photoshop is feature packed with color correction, layers, image exporting, and other minor tweaks. If you are unwilling to pay for a quality editing apps, then you can download the Photoshop Express. However, it is the most advanced image editing tool you can use on your Android phone.</p><p style="text-align: justify;">You can download this amazing app from <a href="https://play.google.com/store/apps/details?id=com.adobe.psmobile&amp;hl=en" target="_blank">here</a></p><h3 style="text-align: justify;"><strong>6. Pho.to Lab: The framer</strong></h3><figure id="attachment_3167" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/spring_effects_at_pho.to_lab_android.png"><img class="wp-image-3167 size-full" src="http://mobda.com/wp-content/uploads/2015/11/spring_effects_at_pho.to_lab_android.png" alt="10 Best Photo Editing App For Android-Pho.to Lab: The framer" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: http://ope-api.pho.to</figcaption></figure><p style="text-align: justify;">Pho.to Lab lacks a punch when it comes to unforgiving pro editing. However, it makes up for the absence of intense performance with several customizations. Such as, Photo frames stickers, filters, landscapes, colors and many more. It is incapable of contesting with the big leagues such as Photoshop or Snapseed for photo-fixing. But, if fun is what you are aiming for, here is an app you mustn’t ignore.</p><p style="text-align: justify;">You can download this amazing app from <a href="https://play.google.com/store/apps/details?id=com.vicman.photolabpro&amp;hl=en" target="_blank">here</a></p><h3 style="text-align: justify;"><strong>7. Snapseed: The experienced</strong></h3><figure id="attachment_3168" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/16-best-google-android-apps-you-didnt-know-about-snapseed4.jpg"><img class="wp-image-3168 size-full" src="http://mobda.com/wp-content/uploads/2015/11/16-best-google-android-apps-you-didnt-know-about-snapseed4.jpg" alt="10 Best Photo Editing App For Android-Snapseed: The experienced" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: droidmen</figcaption></figure><p style="text-align: justify;">Developed by professionals from Nik Software, it is an ideal app for giving simple touches to your photos. Saturation, brightness, and contrast are some of the typical features that the application is capable of manipulating.&nbsp; The app also has a full auto correction that corrects the image for you in a single push of the button.</p><p style="text-align: justify;">Finer adjustments can be made if you are using touch gestures. If you are aiming for a much more physical feel, you can independently edit each selection within your photo.</p><p style="text-align: justify;">Snapseed is known for its filters: Tilt Shift, Drama, Retrolux Vintage and other cooler things. And the best part is … its free of charge with no annoying ads.</p><p style="text-align: justify;">You can download this amazing app from <a href="https://play.google.com/store/apps/details?id=com.niksoftware.snapseed&amp;hl=en" target="_blank">here</a></p><h3 style="text-align: justify;"><strong>8. Cymera: The portrait photographer</strong></h3><p style="text-align: justify;"><a href="http://mobda.com/wp-content/uploads/2015/11/cymera-android-1.png"><img class="aligncenter wp-image-3169 size-full" src="http://mobda.com/wp-content/uploads/2015/11/cymera-android-1.png" alt="10 Best Photo Editing App For Android-Cymera: The portrait photographer" width="600" height="400"></a></p><p style="text-align: justify;">Cymera is a universally suitable tool for prompt editing of any photo. It is ideal for editing portraits. Photos can either be directly taken from the app’s interface, or you can import an image for editing in the gallery. The app features seven different types of lens and four unique recording modes for improved camera snaps.</p><p style="text-align: justify;">There are more than twenty filters, portrait features, decorations, and make up effects that are available with the app. All the edited images can be easily shared with social media such as Twitter, Facebook, and Tumblr from the apps interface. The app is free of sponsored ads, light and easily manageable.</p><p style="text-align: justify;">You can download this amazing app from <a href="https://play.google.com/store/apps/details?id=com.cyworld.camera&amp;hl=en" target="_blank">here</a></p><h3 style="text-align: justify;"><strong>9. Aviary Photo Editor: 1, 2, 3 – Meme!</strong></h3><figure id="attachment_3170" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/Snapseed-Filter-screenshot-app-02-w620.jpg"><img class="wp-image-3170 size-full" src="http://mobda.com/wp-content/uploads/2015/11/Snapseed-Filter-screenshot-app-02-w620.jpg" alt="10 Best Photo Editing App For Android-Aviary Photo Editor: 1, 2, 3 – Meme!" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: androidpit</figcaption></figure><p style="text-align: justify;">Aviary is used for typical editing such as cropping, rotating, auto-enhancing and correcting. It also has a focus function that lets you tilt shift, input texts, make cosmetic changes, and also a Meme Generator. Similar to the previous app, you can share your edited images on social media.</p><p style="text-align: justify;">If you are aiming at in-app ad purchases, this is the app for you. As you continue using, you can make an in-App purchase of tools depending on your needs. It is also free of ads.</p><p style="text-align: justify;">You can download this amazing app from <a href="https://play.google.com/store/apps/details?id=com.aviary.android.feather&amp;hl=en" target="_blank">here</a></p><h3 style="text-align: justify;"><strong>10. PicsArt: The all-rounder</strong></h3><figure id="attachment_3171" style="width: 600px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/5581852435a9d.png"><img class="wp-image-3171 size-full" src="http://mobda.com/wp-content/uploads/2015/11/5581852435a9d.png" alt="10 Best Photo Editing App For Android-PicsArt: The all-rounder" width="600" height="400"></a><figcaption class="wp-caption-text">Image Courtesy: apkmirror</figcaption></figure><p style="text-align: justify;">One of the popular free photo editor apps on the Google Play store. The app features a camera app, effects, drawing tools, filters and an option to share the images on social websites such as Instagram. PicsArt is also a social network where you get to share your artworks and creations.</p><p style="text-align: justify;">You can download this amazing app from <a href="https://play.google.com/store/apps/details?id=com.picsart.studio&amp;hl=en" target="_blank">here</a></p><!-- WhatsApp Share Button for WordPress: http://peadig.com/wordpress-plugins/whatsapp-share-button/ --><p></p>                                                          	</div>', '/image/uploads_news_newsImage-765634-1484684078.jpeg', 1, '2017-01-17 14:44:39', '2017-01-17 14:59:01'),
(13, 'How To Reset A Phone?', 'The chances are, you are reading this article because you are on the receiving edge with your phone freezing now and then. So, do not rip your hair yet. You are in luck!', '<p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The chances are, you are reading this article because you are on the receiving edge with your phone freezing now and then. So, do not rip your hair yet. You are in luck! Read ahead to know how to reset a phone safely. Factory Reset is a powerful option on your phone that relieves you from the burden of the ill-functioning phone. But, it is a one-way process and must be a well-thought decision if you are preparing to reset your phone.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">So, the typical scenario involves a device that has an issue allowing you access the factory reset option by navigating through the settings. So, this article is focused on helping you deal with the reset process. We have rounded up most of the common cases that require a user to think of a factory reset. The most common cases are problems with navigation, touch screen issues and trouble navigating on your device or even worse, your phone unwilling to power on.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you have finally reached a conclusion, it means you are also fully aware of the risks of resetting your phone. Also, you are hopeful; it may save your device from malfunctioning. I will be instructing you to perform a hard reset is multiple ways without you having to use your phone’s touchscreen (need not be in on state).</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Make Sure The Device Is Powered Off</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Most importantly, you will have to ensure that your phone is in off state while you are attempting to make a hard reset. It is insufficient that you have your phone in a locked state (screen lock), so completely power off your device before you attempt resetting your device. But what to do if your phone is not responsive to the power button and pushing the power button long enough isn’t getting you anywhere? Then, you can pull away the battery from the phone to power down the device. Once you pull off the battery, count to ten before you reinsert the battery. Just don’t reinsert the battery right away after removing them.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You must also ensure that your phone isn’t plugged to a charger. The reset function will fail if your device is plugged to the charger and/or if it isn’t fully powered off.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Hard reset methods and procedures may differ</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">To perform a reset, you must be pushing a combination of keys. The key combos that will perform the reset will vary from one device to another and also the version of Android on the device. Suppose, you are operating a version of Android running 2.2 Froyo, and when you upgrade to 2.3 Gingerbread, the reset operation of the Froyo operating system will vary compared to the Gingerbread. Hence, if you have reset your phone using a certain key combo in Froyo, the same may not apply after you have updated to Gingerbread.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Occasionally, you will have to perform a sequence of reset to get the process right!</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Note:</strong><span class="Apple-converted-space">&nbsp;</span>You must be aware that a reset is a one-way process where you will flush your phone’s memory. The process will not harm the data on your SIM card and SD card under normal conditions. The reset will rectify any bugs, glitches, viruses, etc. But, making a backup before you attempt a reset is considered a safe precise.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Before Resetting Your Android Phone</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Here is what to expect when you attempt a recovery process on your Android device. After you power down your device, hold the<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">combo buttons</strong><span class="Apple-converted-space">&nbsp;</span>and access the access the fast boot/testing/ recovery/ so on… and choose the reset. The phone will spring back to life. Normally, most phones take few minutes. Rarely, it could take as long as<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">15 minutes</strong><span class="Apple-converted-space">&nbsp;</span>to complete the reboot process.&nbsp; After you have completed the reboot process, the phone will start up as if it were brand new, You will be guided by a software wizard to complete the setup before you can use it.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Let’s get acquainted with the most common Reset methods:</strong></h3><ol style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Power off the phone, press and hold the Volume Up and Volume Down keys simultaneously and push and hold the power button as well till the device enters a test screen. Taking no longer than<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">20 seconds</strong>, you will see the active display. Then, you can let go off the buttons.</li></ol><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You can navigate through the options using the Volume Down keys till you have located the factory Reset. Using the Power button, you will have to make a selection.</p><ol start="2" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Power down the device and push and hold the Volume Down key, simultaneously, push and hold the Power button as well and wait for<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">15 seconds</strong>. Once you see the screen light up with options being listed, you can let go off the buttons.</li></ol><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Using the Volume Down key you can navigate the list of options till you have highlighted the reset option. You will see the Factory Reset, now press the Power key to make the selection.</p><ol start="3" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">When your device is in off state, push and holds the Home button. When you keep the button pressed, power on the device by pushing the Power key as well.</li></ol><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Then, when you have seen the System Recovery screen, you must release the buttons you have been holding and use the Volume down button to navigate through the list. Look for “<strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">wipe date/factory reset</strong>” option. After you have highlighted it push the power key to select it.</p><ol start="4" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Power down your device, push and hold the Home key and release the Power button when you have the power button still pushed down.</li></ol><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Push the Search Key on the Android Recovery Screen.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Then tap the selection wipe data/ factory reset and press OK. If the screen continues to be non-responsive, use the volume buttons to scroll and Camera button to make the selection.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You must select “<strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Yes</strong>” – It will erase all the user data, and then select<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">OK</strong>.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Then choose “<strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">reboot system now</strong>” and press<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">OK</strong>.</p>', '/image/uploads_news_newsImage-276000-1484684190.png', 1, '2017-01-17 14:46:31', '2017-01-17 14:58:57');
INSERT INTO `news` (`news_id`, `title`, `description`, `article`, `news_image`, `status`, `created_at`, `updated_at`) VALUES
(14, 'How To Update Android Phone?', 'Do you own a smartphone? The chances are it is an Android; an opens source Operating System from Google. Unlike in the earlier times when the smartphones used Google’s Android software, the latest phones are custom units built with tweaks and mods from the smartphone manufacturers.', '<p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Do you own a smartphone? The chances are it is an Android; an opens source Operating System from Google. Unlike in the earlier times when the smartphones used Google’s Android software, the latest phones are custom units built with tweaks and mods from the smartphone manufacturers. Hence, they are identified as forked versions of Android. Some of the newer Operating systems revived are Amazon’s Fire and many other versions that are developed under the Open Source Project. An independent research reveals that most of the latest smartphones running the Android version are forked, and the figures are as much 20% of all the models in the operating system market.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">While the opens source has helped Google overshadow over other premium Smartphone makers Apple and Microsoft, Google is involved in an intense challenge with Open Source Project as they are vulnerable to threats of malware. And the vulnerability just escalates with older Android devices still being actively used. Hence, it is an essential rather than an option to upgrade the Operating System to the latest version to keep your phone in a robust state regarding performance and also security.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">So, you will find in this article a solution – how to update Android Phone?</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">The Role Of Smartphone Makers</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Before you settle down to make that much tempting update of your Android device, you need to bear in mind the importance of the smartphone maker that solely define the effectiveness of the update you are about to make. Most of the premium smartphone brands allow their users to make an upgrade. Their products are built to scalable standards and will positively support the transition from older Android version to the newer ones. On the contrary, the budgetary brands often limit the upgrades or may never allow the users to enjoy the benefits from the latest software updates, and you will have to satiate yourself with the stock version.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Before you press ahead with the updates, you must make yourself aware of one general rule. Google’s Nexus is an exception to the typical Android update process. Since, it is a device that is built according to the Google’s unforked version of Android, it will always receive the updates to the latest version of Android. Also, devices that are branded under the Android One platform are an exception to the typical update process as Google has announced it will dispatch auto-updates to the latest version of Android to all the android one platform devices.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">What’s Your Android Version?</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Before updating your device, you must confirm what version of Android is being used. While Android comes in a variety of versions in a smartphone, most devices will have a settings icon on the home screen (wrench or a cogwheel).</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">After you access the Settings menu look for About phone label. The About Phone label may list a circular icon with the letter “i” inside it. Once you have opened the About Phone menu, locate the Android Version label. Listed below are number series that correspond to a particular version of Android. The 5.0.2 version corresponds to Lollipop. Google’s latest release is the Android 6.0 aka. Marshmallow. It was released in October 2015, unless you own a Nexus 5, 6, 9 or a Huawei P9 you will not be able to benefit from its features. However, if you waited a little longer, you may be eligible to use Marshmallows on your device as well.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Don’t Forget To Backup Data</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">It is the most commonly ignored fundamental rule before making an update. Many people lose potential data because they failed to save them before making the update. So, be warned, important items (contacts, photos, videos, music or documents) from your phone must be backed up before updating your device. So, in case you lose any data after the update, you will be able to retrieve it.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Check For Updates</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">After verifying the version of Android on your device, you can decide when to update. It is easy to update your device. You can use your device’s System Update or Software Update option depending on the brand. You will find the System Update option in the Settings or About Phone menu. Since the update is directly applied to your mobile device, it is recommended that you connect your device to a stable Wi-Fi network so that you can enjoy uninterrupted update process. It will also prevent you from incurring unnecessary data transmission charges as some software updates can be large.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Once you have the pre-update process figured out, tap the System Update button to elicit your gadget to check for latest updates. After completion of download, you can install the updates by following simple instructions. Once you have completed the installation, wait till your device reboots itself. Then, you can verify if you have successfully installed the new version of Android by checking the version under About Phone menu. But, sometimes, it may be impossible to locate the System Update option under the Setting list of your device. It means your phone manufacturers have not provided the option to upgrade your device. That means unless you root your smartphone you will not be able to benefit from the latest version of Android.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Alternate Update Methods</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Many smartphone manufacturers will provide the update facility via the System Update function. However, due to the smartphone boom several lesser known smartphone makers operate their device on Android platforms. So, you will have to verify with your smartphone makers to confirm you are following the right update method. Check for the model make and number that will be listed on the device’s casing or it could also be found in the About Phone section, under the settings tab. Visit smartphone maker website to learn more about the update process for your device.&nbsp;&nbsp; .</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Updating your smartphone is essential not just to enhance its features that are visually amusing, but also every update features a robust security upgrade as well. These lesser known parts of the update will enhance the security of your device against a list of malware that can corrupt or devastate your phone’s functions or the valuable data.</p>', '/image/uploads_news_newsImage-610671-1484684248.jpg', 1, '2017-01-17 14:47:28', '2017-01-17 14:58:57'),
(15, 'Top 10 Smartphones Of 2015', '2015 was the year of Smartphones. With so many impressive models hitting the stores, it was certainly a daunting task for many shoppers to select the best Smartphone fitting just right into the budget. But, if you still haven’t bought yours, read ahead. You will be thrilled to know how easy we have made it for you to select the right flagship models that are premium regarding looks and performance, and also value for money.  Here is a compilation of top 10 smartphones of 2015.', '<div class="new_description ">2015 was the year of Smartphones. With so many impressive models hitting the stores, it was certainly a daunting task for many shoppers to select the best Smartphone fitting just right into the budget. But, if you still haven’t bought yours, read ahead. You will be thrilled to know how easy we have made it for you to select the right flagship models that are premium regarding looks and performance, and also value for money.&nbsp; Here is a compilation of top 10 smartphones of 2015.<h3 style="text-align: justify;"><strong>1. Apple iPhone 6s</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/iphone6s.jpg"><img class="aligncenter wp-image-3147 size-full" src="http://mobda.com/wp-content/uploads/2015/11/iphone6s.jpg" alt="Top 10 Smartphones-Apple iPhone 6s" width="600" height="400"></a></p><p style="text-align: justify;">It is unfair to start the list of best models without the iPhone 6 series. The sales of this iconic phone went spiraling thanks to the typical iPhone hype and the pre-sales promotion of some of the trendsetting technology that comes with this phone. It was released officially on 25 September in the UK. You will be able to buy the iPhone 6s models with a Rose Gold option. It features a 12MP shooter that supports 4K video recording. The camera also has a Live Photo feature that allows you to capture a second and half of the video before and after the still photograph.</p><p style="text-align: justify;">The OS installed on this device is the latest iOS 9. It also features a 3D Touchscreen that is responsive to pressure sensitive touch, letting you to “peek” and “pop” contents. However, the screen size hasn’t seen much of a change or any change at all. It is a 4.7” Retina display with 326ppi.</p><p style="text-align: justify;">The Touch ID fingerprint scanner from the previous version has been upgraded to a second gen and is more accurate and faster than ever. The processor has been revamped to make the device nippy and edgy in terms of performance. Apple’s new iPhone 6s uses an A9 processor with M9 motion coprocessor. That means it is 80% faster for CPU intense tasks and 90% faster for GPU tasks.</p><h3 style="text-align: justify;"><strong>2. Apple iPhone 6s Plus</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/21071235724_42f75a5239_b.jpg"><img class="aligncenter wp-image-3148 size-full" src="http://mobda.com/wp-content/uploads/2015/11/21071235724_42f75a5239_b.jpg" alt="Top 10 Smartphones-Apple iPhone 6s Plus" width="600" height="400"></a></p><p style="text-align: justify;">The 6s Plus was released with the 6s series. It was released on the 25 September in the UK. The significant difference between the 6S and 6s Plus is the physical dimension and weight. The gadget sports a better resolution display. It is 5.5” unlike the 4.7” in the 6s. The 6s Plus variant is larger and heavier, measuring 158.2X77.9X7.3mm and it is a tad heavy at 192g. Also, the battery capacity is enhanced to last longer.</p><p style="text-align: justify;">The 6s Plus has all the identical features of 6s. It has an A9 processor, 12MP shooter, an iSight camera with Live Photo, 3D Touchscreen and the second gen Touch ID fingerprints scanner.</p><h3 style="text-align: justify;"><strong>3.</strong> &nbsp;<strong>Asus Zenfone 2</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/16516017737_4ecf47702d_b.jpg"><img class="aligncenter wp-image-3149 size-full" src="http://mobda.com/wp-content/uploads/2015/11/16516017737_4ecf47702d_b.jpg" alt="Top 10 Smartphones-Asus Zenfone 2" width="600" height="400"></a></p><p style="text-align: justify;">The Zenphone 2 from Asus is a state of the art gadget that is built to impress its user in every manner. It is sleek, gorgeous and the phone is a definition of high performance. The top end variant (ZE551ML) is available in the Amazon for £309.99. The power packed phone has 64-bit Intel Atom Z3580 quad processor bundled with a whopping 4GB RAM making it a top performer in its class. It offers 32GB storage, and you can opt to expand using microSD. Zenphone 2 offers 4G LTE support and can accommodate 2 SIM cards in the dual active state. It has a large 5.5” inch IPS display that is full HD. The camera takes crisp snaps and videos. The rear camera has a 13MP sensor while the frontal camera has 5 MP. The device is beautifully packed in a brushed metal casing that is just 3.9” inches thick in the edge. The phone features a fully customizable interface that is designed by intuition and is easy to use. It also comes pre-installed with Trend Micro security. Be warned, Zenphone is built to impress with killer looks.</p><h3 style="text-align: justify;"><strong>4. Google Nexus 5X</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/Nexus_5_1.jpg"><img class="aligncenter wp-image-3150 size-full" src="http://mobda.com/wp-content/uploads/2015/11/Nexus_5_1.jpg" alt="Top 10 Smartphones-Google Nexus 5X" width="508" height="400"></a></p><p style="text-align: justify;">Nexus phones are Google’s pet project. They are popular and are a top performer. However, in 2014, the Nexus failed to court with users with Nexus 6. Maybe it was too big, or too pricey?</p><p style="text-align: justify;">Google is back leveraging with Nexus 5X and Nexus 6P. So, keep the eyes peeled when that occurs.</p><p style="text-align: justify;">The latest Nexus 5 is manufactured by LG and has a large 5.2 inch Full HD display, a nippy Qualcomm Snapdragon 808 CPU, a rear fingerprint scanner, and USB Type-C charging port. The device also has a 12.3 MP sensor in the back and 5MP front shooter for snapping high-quality selfies. Nexus 5 is a top performer with 2 GB of RAM and an optional 16 or 32 GB storage. Nexus 5 uses Android 6.0 Marshmallow operating system. Also, check out the latest Nexus 5X that is the top end variant of the series.</p><h3 style="text-align: justify;"><strong>5. Google Nexus 6P</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/21633185769_516ca5571e_o.jpg"><img class="aligncenter wp-image-3151 size-full" src="http://mobda.com/wp-content/uploads/2015/11/21633185769_516ca5571e_o.jpg" alt="Top 10 Smartphones-Google Nexus 6P" width="600" height="400"></a></p><p style="text-align: justify;">Of the two new Nexus series, the 6 P has more teeth to its performance. The Nexus 6P has a 5.7” HD screen and a metal body made from a single block chassis; it also has a Snapdragon 810 v2 processor, 3 GB of RAM, fingerprint scanner, 12.3 MP high-quality sensor on the back and 8MP sensor on the front.</p><p style="text-align: justify;">The latest Nexus 6P has Android 6.0 Marshmallow Operating system.</p><h3 style="text-align: justify;"><strong>6. HTC One A9</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/22149068438_baa4761cb1_b.jpg"><img class="aligncenter wp-image-3152 size-full" src="http://mobda.com/wp-content/uploads/2015/11/22149068438_baa4761cb1_b.jpg" alt="Top 10 Smartphones-HTC One A9" width="600" height="400"></a></p><p style="text-align: justify;">HTC is a brand that is performance specific, and there is an ongoing debate about its resemblance to iPhone. But, HTC has claimed it has been in the business of making phones with unibody construction for many years and that it makes their phones robust and hassle free.</p><p style="text-align: justify;">At the heart of the phone is a Snapdragon 617 processor supported by 2GB RAM. The other features include a full-HD 5” inch screen, fingerprint scanner, microSD support and a 13MP shooter in the back. HTC One A9 costs £469.99.</p><h3 style="text-align: justify;"><strong>7. HTC One M9</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/16697014916_94ed313f1c_b.jpg"><img class="aligncenter wp-image-3153 size-full" src="http://mobda.com/wp-content/uploads/2015/11/16697014916_94ed313f1c_b.jpg" alt="Top 10 Smartphones-HTC One M9" width="600" height="400"></a></p><p style="text-align: justify;">There has been a trending fanfare for the much celebrated HTC One M8, but to better that HTC has given its users HTC M9. The brand has continued the trend of using full HD screen on their phones rather than a quad-HD screen used by other premium brands such as Samsung Galaxy S6 and S6 Edge. The phone was available for sale from 31 March in the UK. It cost £569. That is&nbsp; £30 cheaper than Samsung S6.</p><h3 style="text-align: justify;"><strong>8. HTC One M9+</strong></h3><div style="text-align: center;"><figure id="attachment_3154" style="width: 610px;" class="wp-caption aligncenter"><a href="http://mobda.com/wp-content/uploads/2015/11/HTC-One-M9-Plus-official-images2.jpg"><img class="wp-image-3154 size-full" src="http://mobda.com/wp-content/uploads/2015/11/HTC-One-M9-Plus-official-images2.jpg" alt="Top 10 Smartphones-HTC One M9+" width="610" height="407"></a><figcaption class="wp-caption-text">Image Courtesy: cdn.wccftech</figcaption></figure></div><p style="text-align: justify;">It is a phablet version of HTC One M9+ having a screen size of 5.5” inch, and it has a quad HD screen with a fingerprint scanner. However, the model is announced only in China for 4,299 yuan (£522). Although, the HTC team has made it official that that model will not be hitting the UK market, there are rumors that the model is coming to Europe. But for now, your only hope to get your hands on a model is to make online purchase from the grey market.</p><h3 style="text-align: justify;"><strong>9. Huawei P8 and Huawei P8 max</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/17165569185_cc541cd355_b.jpg"><img class="aligncenter wp-image-3155 size-full" src="http://mobda.com/wp-content/uploads/2015/11/17165569185_cc541cd355_b.jpg" alt="Top 10 Smartphones-Huawei P8 and Huawei P8 max" width="600" height="400"></a></p><p style="text-align: justify;">Unibody seems to be the trend of the season. Huawei’s latest design seems to give rivals Apple and HTC chase for the money. The price of Huawei P8 starts with a tag of £357. The P8 has a 5.2”inch screen while P8 max sports a massive 6.8” inch display. The phablet and phone were made available for purchase on 15 May.</p><h3 style="text-align: justify;"><strong>10. LG G4</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/17303997522_b66b98472d_o.jpg"><img class="aligncenter wp-image-3156 size-full" src="http://mobda.com/wp-content/uploads/2015/11/17303997522_b66b98472d_o.jpg" alt="Top 10 Smartphones" width="600" height="400"></a></p><p style="text-align: justify;">LG has created a smartphone that redefines the notion of elegance, comfort, and incredible human-centric user experience. LG was riding success with their flagship model G3 in the year 2014. But things got a notch better with the arrival of G4. The phone has the following specifications that make it the feisty contestant among the other best phones of 2015. G4 has a powerful Qualcomm Snapdragon 808 processor, 32 GB storage bundled with the microSD support and has a large 5.5”inch Quad HD IPS display. The G4 also comes with a mammoth 3000mAh removable battery. It went on sales from 28 May starting at £500.</p><p style="text-align: justify;"><!-- WhatsApp Share Button for WordPress: http://peadig.com/wordpress-plugins/whatsapp-share-button/ --></p><p></p>                                                          	</div>', '/image/uploads_news_newsImage-400750-1484684363.jpg', 1, '2017-01-17 14:49:24', '2017-01-17 14:58:56'),
(16, 'How To Play Music From Phone To Car?', 'Music has become an integral part of our life. No matter where we are, music must always be with us. Whether we are working in the office or driving the car, music tends to keep us focused and improvises our moods.', '<p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Music has become an integral part of our life. No matter where we are, music must always be with us. Whether we are working in the office or driving the car, music tends to keep us focused and improvises our moods. Various researches have also proved that listening to music during the work increases our productivity by keeping our mind calm and focused. It also prevents us from the surrounding distractions. Hence, where almost all the mobile devices have GBs of internal memory, it is mandatory to load them with your favorite songs. However, there are numerous people who have no idea as how to play music from phone to car? So, to help you out, in this article, we have presented some of the easiest ways through which you can easily listen your favorite music while driving.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Primarily, to play the music from your phone to the care, there are four options available. Hence, let us have a look into those four options.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Bluetooth</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">One of the most common and easiest ways is to use the Bluetooth of your car and phone to playback your favorite playlist of songs. The majority of the cars’ audio systems are equipped with the Bluetooth option for playing the music. The range of these Bluetooth is sufficient to cover the whole car. So, to take the advantage of this option, just turn on the Bluetooth of your phone and of the car. Make sure that both the Bluetooth devices are discoverable.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">One of the best things about connecting your phone to car via Bluetooth to play music is that from next time, both the devices will connect automatically. So, once the devices are paired, you are done with connection thing. Just turn Bluetooth of both the devices and start enjoying your favorite playlist.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">While connecting the phone to car via Bluetooth, you will have all the access to your music player. You can comfortably choose which song you want to play and which one you want to skip. Talking about the volume controls, you can control them through your phone or from your car’s audio system.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">AUX Cable</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The second option to play music from phone to car is to use the AUX cable. If you do not know what an AUX cable is, then it is a cable, which has 3.5 mm sockets at both the ends. So, just insert one end of the AUX cable into your phone and other in your car’s audio system and select the AUX mode in it.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">As in the Bluetooth option, you will also have the complete access to the songs you want to select and play. Here also you can control the volume either through your device or from the car’s audio system.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">USB</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The third option is to connect the phone via a USB cable. You can use the normal USB cable that comes along with your phone to achieve this. To connect your phone to the car’s audio system just connect one end of the USB cable to the car’s audio system and the other one to your mobile phone. Once you do this, the phone’s screen will show you the notification for<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">USB Mass Storage/USB Connection Mode</strong>. So, now you can navigate in your phone’s song library through your car’s audio system.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">However, keep in mind that, if you are connecting your phone to car from the USB cable, you cannot skip or play tracks of your choice through your phone. All your access of the song library will be in the car’s audio system. So, to play the song of your choice, you need to do it from the car’s audio system.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">FM Transmitter</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The fourth and last option to connect the phone to car to listen to the music is via the FM transmitter. The majority of the phones do have an inbuilt transmitter.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Talking about the connection, you need to download a free app such as Quick FM Transmitter, which can be used to broadcast your phone’s MP3 and other audio files from your phone to car’s audio.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If this option is not a feasible one for you, you can buy a low-cost FM broadcast device from the market. You can connect this broadcast device to your phone via the headphone jack and the other side of the device to the car’s charging point. The rest of the process is almost similar to the AUX cable option.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You will have the complete access to your songs and the libraries. You can control the volume of the music from both, your device and your car’s audio system.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">So, these were the four important ways to achieve the connection between your phone and car’s audio to system to play the music. Doing so is not a daunting task, if you will follow all the instructions perfectly. Hence, go ahead and take the full advantage of your phone and car’s audio system. Connect them and enjoy your drive alone or with your loved ones. Dedicate songs, surprise them with their favorite playlist or songs.</p>', '/image/uploads_news_newsImage-511520-1484684578.jpg', 1, '2017-01-17 14:52:58', '2017-01-17 14:58:51');
