(17, 'How To Unlock An Android Phone?', 'Ever forgot your security pattern or password of your Android device? Yes? Don’t worry it happens with almost everyone. But the major question is, how to unlock an Android phone? Many of you might wandered through the complete internet, but still be disappointed because you could not find the answer. ', '<p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Ever forgot your security pattern or password of your Android device? Yes? Don’t worry it happens with almost everyone. But the major question is, how to unlock an Android phone? Many of you might wandered through the complete internet, but still be disappointed because you could not find the answer. But do not worry at all now, because here is a superb article to solve this critical problem of yours. Before we start, we would like to inform you that unlocking an android phone is no rocket science. So, just be calm and read carefully all the steps, which are mentioned here.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Primarily, there are two ways to unlock your Android phone. First, you can recover either your forgotten password or pattern. Second, you can go for the bigger step, the Factory Reset of your phone. If you do not get it now, do not worry at all, because we will be clearly explaining you both the processes in detail in the article. So, let us just start with the first method, i.e. Recovering of the forgotten password or the pattern.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">How To Recover The Forgotten Password Or Pattern Of Your Android Device?</strong></h3><h4 style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; text-transform: capitalize; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-indent: 0px; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">If You Have Numbers As Your Password</strong></h4><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">As mentioned above, this is the first method to get your phone unlocked. In the majority of times, the passwords are somehow connected to the events or occasions of your life. The phone users hardly ever go with the passwords containing the random numbers or letters in it. Most of the times, people will go with the numbers or letters that have some sort of practical meaning, for example, your date of birth, the part of yours or your loved ones’ phone number or related to it.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">However, if you remember that your password contained only four digits, you can try some of the below mentioned ways:</p><ul style="padding: 0px 0px 10px; margin: 0px 0px 0px 30px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;">Try putting the last or initial four digits of your or your loved ones’ phone number</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;">Your social security number’s last four digits</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;">Your birth year or you can also try the birth year of your loved ones’, for example, your father’s, mother’s and many more.</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;">If you are married or graduated, you can try entering the digits of that year also.</li></ul><h4 style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; text-transform: capitalize; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-indent: 0px; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">If You Have The Drawing Pattern As Your Password</strong></h4><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If in case, you have the drawing pattern in you device and you have forgotten it, start by trying the simple designs and symbols. Some of the common designs and symbols include squares, circles, stars, hearts, arrows and a few more. Moreover, you can also try drawing the first letters of your name or of your loved ones.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">While trying the random patterns and passwords, beware that you do not exceed the chances. You can only try five times for the incorrect password. Once you exceed this, you will be asked to wait for 30 seconds before you can try again. However, if you still continued trying, your phone will get locked and it will prompt for your Google account password to unlock your phone. In some cases, you can also find your devices getting reset automatically and in this case, you can lose all your data and media inside your phone.</p><h4 style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; text-transform: capitalize; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-indent: 0px; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">If Not Able To Open, Try To Connect With Your Google Account Password</strong></h4><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you are still not able to recall the password or pattern of your device, the other option is to unlock it by entering the Google account password. So, how to do it?</p><ul style="padding: 0px 0px 10px; margin: 0px 0px 0px 30px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;">The solution is, when you are sure you have forgotten your password, just tap on the “Forgot Password” or “Forgot Pattern” (if you have a pattern lock), button, which is present on the lock screen. Once you do that, it will prompt you to ask for your Gmail ID and the password. After entering the same, you will be able to skip the ‘Enter Password’ screen and you phone will get unlock.</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;">However, if in case, you do not know your Gmail ID too, just login to your computer and go to the Gmail home page. Once done, click on the “Can’t access your account” and then “I don’t know my username.”</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;">If still you are not able to retrieve your Gmail ID, the only option you left with is to Factory Reset your phone.</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;">However, you can give it one last try by taking it to the retailers shop. There are possibilities that they may charge you a little amount as their service charge and even void the warranty on your phone.</li></ul><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">Performing The Factory Reset Of Your Android Phone</strong></h3><ul style="padding: 0px 0px 10px; margin: 0px 0px 0px 30px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;">This is the second way to get your android phone unlocked. Factory Reset means, resetting your android phone settings from the core. During the process of Factory Reset, you may lose all your data, for example, photos, songs, videos, and other files. Therefore, it is recommended that you transfer all your data into a computer via USB cable. In this way, you can at least keep some of your important stuffs.</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;">Once you are done, switch off your phone through the power button. After this, press and hold your hardware keys and wait for the recovery screen. These hardware keys, on most of the android phones, are the volume button and the power button. However, in some of the devices, even the home key and camera button can be included. Once you see the all black screen along with the blue text that is the recovery screen.</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;">Select the option that says “Wipe data/ Factory reset” from the menu you see. Just use the volume-down key to reach the aforementioned option and the power button to select it. Select ‘Yes’ when it asks for it. Here also, select the power button to move down to ‘Yes’ and power button to select it.</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;">Your phone will be reset itself, just wait for some time. it may take a few minutes to a few hours. Now, when you see the ‘Reboot system now,’ select it by following the similar procedure.</li><li style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;">When the process gets completed, unlock your phone normally. Now your phone is ready again to use. While setting the password this time, just make sure to write it somewhere and place it in a safe place.</li></ul><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">&nbsp;</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">So, these were the ways through which you can recover the lost password of your phone. However, we recommend that whenever you change the password, write it down in the safe place.</p>', '/image/uploads_news_newsImage-533850-1484684631.jpeg', 1, '2017-01-17 14:53:51', '2017-01-17 14:58:51'),
(18, '6 Best Android Games Of All Time', 'Got a new Android device? There are possibilities that you will be searching some awesome and cheap ways to kill the time. So folks, you are at the right place. Here are 7 best Android games of all the time, especially for you. And guess what?', '<div class="new_description ">Got a new Android device? There are possibilities that you will be searching some awesome and cheap ways to kill the time. So folks, you are at the right place. Here are 7 best Android games of all the time, especially for you. And guess what? They are available at a very low price of just <strong>FREE</strong>. Therefore, here are 6 best Android games of all time, take a look on the list; choose your favorite game; follow the link; download it in your device and start gaming.<h3 style="text-align: justify;"><strong>1. Dumb Ways To Die</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/Dumb-Ways-To-Die.png"><img class="aligncenter size-full wp-image-3261" src="http://mobda.com/wp-content/uploads/2015/11/Dumb-Ways-To-Die.png" alt="Dumb Ways To Die" width="639" height="479"></a></p><p style="text-align: justify;">The first in the list is the Dumb Way to Die. Yes, how many dumb ways you can think of dying? In this game, you have to get through the gauntlet of small games. The difficulty of the game gradually increases as you move from lower level to higher levels. From shooting piranhas, swatting bugs to holding the balloons, all the dumb ways, which you even cannot think of, are available in the game.</p><p style="text-align: justify;">The majority of the people who already are playing this game, and for the new users, may not know, but this game is a type of public warning from the Melbourne transit association. They want you to beware that you do not perform stupid acts near the tracks. You even have a music video for this.</p><p style="text-align: justify;">If you want to download this cool game, <a href="https://play.google.com/store/apps/details?id=air.au.com.metro.DumbWaysToDie" target="_blank">Click Here</a></p><h3 style="text-align: justify;">&nbsp;<strong>2. Dots</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/Dots.jpg"><img class="aligncenter size-full wp-image-3263" src="http://mobda.com/wp-content/uploads/2015/11/Dots.jpg" alt="Dots" width="620" height="311"></a></p><p style="text-align: justify;">One of the simplest, lightest, casual and addictive games you will find on the Google Play Store. In the Dots, the players have to line up the same-colored dots as quickly as possible. You only get the limited times and moves to achieve your target. Moreover, you also get the bonuses when you trace a closed loop, and if, in case you a run out, you can use the collected dots for the power-ups.</p><p style="text-align: justify;">The game also has a local multiplayer mode, which is awesome if you want to check your friends’ strategies. Dots is sharply designed, superb and easily accessible game – give it a try!!!</p><p style="text-align: justify;">If you want to download this entertaining game, <a href="https://play.google.com/store/apps/details?id=com.nerdyoctopus.gamedots" target="_blank">Click Here</a></p><h3 style="text-align: justify;">&nbsp;<strong>3. Dead Trigger 2</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/Dead-Trigger-2.gif"><img class="aligncenter size-full wp-image-3265" src="http://mobda.com/wp-content/uploads/2015/11/Dead-Trigger-2.gif" alt="Dead Trigger 2" width="600" height="400"></a></p><p style="text-align: justify;">As the name suggest, Dead Trigger 2 is the first person shooting game taking you back to zombie apocalypse. The game is so awesome and has cool realistic visuals. The controls of the games are fast and possess auto fire mechanism, allowing you to focus continuously on the moving and aiming the gun. Apart from this, you also get the strong hideout and crafting system, which can help you in building various stuffs for you along with the assistance. However, this process is a little time consuming.</p><p style="text-align: justify;">It is extremely hard to find a better shooting game than the Dead Trigger 2.</p><p style="text-align: justify;">If you want to download this awesome game, <a href="https://play.google.com/store/apps/details?id=com.madfingergames.deadtrigger2" target="_blank">Click Here</a></p><h3 style="text-align: justify;"><strong>4. Asphalt 8: Airborne</strong></h3><p style="text-align: center;"><img class="aligncenter size-full wp-image-3264" src="http://mobda.com/wp-content/uploads/2015/11/Asphalt-8-Airborne.jpg" alt="Asphalt 8 Airborne" width="600" height="400"></p><p style="text-align: justify;">Almost all the racing games enthusiasts are aware of the Asphalt racing games. So, their new version, Asphalt 8: Airborne is one of the coolest racing games that are in the Google Play Store. The Asphalt 8: Airborne is a racing game, which gives you the realism and over-the-top, high octane experience, along with the fixings. You get an option to choose the modes of your choice, which include the career mode; you can unlock the new rides; upgrade the ones your competitor owns and many more. You can even go for an online competition as a stagger or live multiplayer.</p><p style="text-align: justify;">So, summing up, the awesomely polished graphics and exceptional graphics are the reasons, making Asphalt 8: Airborne an adrenaline trip, you won’t want to forget.</p><p style="text-align: justify;">If you want to download this adrenaline-filled game, <a href="https://play.google.com/store/apps/details?id=com.gameloft.android.ANMP.GloftA8HM" target="_blank">Click Here</a></p><h3 style="text-align: justify;"><strong>&nbsp;</strong><strong>5. Plague Inc.</strong></h3><p style="text-align: center;"><img class="aligncenter size-full wp-image-3266" src="http://mobda.com/wp-content/uploads/2015/11/Plague-Inc..jpg" alt="Plague Inc." width="600" height="400"></p><p style="text-align: justify;">Have you ever spread a virus, instead of preventing them? Or guided the diseases to the various parts of the world, and killing people with the symptoms, they would never want to die from? If not, here is a chance for you do that. Plague Inc., is the game, where you will <a href="http://mobda.com/wp-content/uploads/2015/11/Plague-Inc..jpg"><br></a>have an opportunity to spread the deadly diseases in the world. You can constantly introduce new symptoms, the ways of disease transmission and resistances. As you will move forward, you get an opportunity to unlock more deadly diseases, with their own specific traits.</p><p style="text-align: justify;">As the name, Plague Inc. is really an infectious game.</p><p style="text-align: justify;">If you want to download this infectious game, <a href="https://play.google.com/store/apps/details?id=com.miniclip.plagueinc" target="_blank">Click Here</a></p><h3 style="text-align: justify;">&nbsp;<strong>6. Galaxy On Fire 2</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/Galaxy-On-Fire-2.jpg"><img class="aligncenter size-full wp-image-3267" src="http://mobda.com/wp-content/uploads/2015/11/Galaxy-On-Fire-2.jpg" alt="Galaxy On Fire 2" width="600" height="400"></a></p><p style="text-align: justify;">Ever wondered, how the astronauts will fight with infiltrators in the space? Well, here is a chance for you to experience it. Galaxy on Fire 2 is a beautifully rendered game, taking you far in the space, where you will be blasting the meteorites, asteroids, space pirates and many more. You also get a chance to do a lot of trading in the game, along with many chances to upgrade your spaceship. As you progress in the game, you earn a lot of money, which you can use in buying the new rides.</p><p style="text-align: justify;">The Galaxy on Fire 2 runs on an awesome story line, which you will definitely enjoy to the core.</p><p style="text-align: justify;">If you want to experience a space battle, download the game. To download it, just <a href="https://play.google.com/store/apps/details?id=net.fishlabs.gof2hdallandroid2012" target="_blank">Click Here</a></p><p style="text-align: justify;">So, these were some awesome games for you, which we carefully selected from the vast ocean of Google Play Store. Download these games, absolutely for free and enjoy your android device experience.</p><!-- WhatsApp Share Button for WordPress: http://peadig.com/wordpress-plugins/whatsapp-share-button/ --><p></p>                                                          	</div>', '/image/uploads_news_newsImage-647476-1484684747.jpg', 1, '2017-01-17 14:55:47', '2017-01-17 14:58:50');
INSERT INTO `news` (`news_id`, `title`, `description`, `article`, `news_image`, `status`, `created_at`, `updated_at`) VALUES
(19, '8 Best Free Android Apps', 'Searching for the Android apps is one of the most daunting tasks you may have to do in your life. The reason, search for a specific term and you can see the Google Play Store', '<p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Searching for the Android apps is one of the most daunting tasks you may have to do in your life. The reason, search for a specific term and you can see the Google Play Store flooded with never ending list of apps, performing the same task, showing both the free and paid versions of the apps. However, still you can have an enriching experience with the free Android apps, and if you want some help, here is a list of 8 best free android apps for which you would love to go for.</p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">1. Evernote</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">It has been so long that Evernote is the front-runner in the race of free Android apps when it comes to taking your quick notes. It has some great features like organizational features, compatibility of the app with other applications, device synchronization, and many types of notes.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Millions of people are using the app, and it is in their must-have app list. You all get the paid version of the app, which adds a few more features to your Evernote. However, the majority of people love to use the free version only.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you want to download the app,<span class="Apple-converted-space">&nbsp;</span><a href="https://play.google.com/store/apps/details?id=com.evernote" target="_blank" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Click Here</a></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2. Dropbox</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">One of the most famous and widely used cloud storage is the Dropbox. It is completely free and very easy to sign up on the Dropbox. Once you register yourself, you get<span class="Apple-converted-space">&nbsp;</span><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">2GB</strong><span class="Apple-converted-space">&nbsp;</span>of storage space to start with. It is one of the best ways to back up your files, data and other important stuff. Now there is no need to carry any external storage device with you, just upload them to Dropbox. You also get an option to auto-upload files to Dropbox, once they are inside your mobile phone. It is one of the best free Android apps, and you must have it onboard with you.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you want to download the app,<span class="Apple-converted-space">&nbsp;</span><a href="https://play.google.com/store/apps/details?id=com.dropbox.android" target="_blank" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Click Here</a></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">3. Google Photos</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">It is the recently launched app from the Google. As the name suggest, Google Photos is a great app to backup your photos and videos and the best part is, it is totally free of cost. Now you do not need any external drives to store your photos and videos.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you want to download the app,<span class="Apple-converted-space">&nbsp;</span><a href="https://play.google.com/store/apps/details?id=com.google.android.apps.photos" target="_blank" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Click Here</a></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">4. Google Hangouts</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Google Hangouts, you can call it the epitome of future text messaging. With the help of Hangouts, you can chat with the people 24 hours a day, 7 days a week, and 365.25 days per year; everything free of cost. The Hangouts also supports voice calls, video calls and can manage your device’s messaging services. So, you can call Hangouts, all-in-one app for messaging services.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you have a Gmail account, you can readily use the Hangouts apps. It is the only app that is close to Skype in functionality.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you want to download the app,<span class="Apple-converted-space">&nbsp;</span><a href="https://play.google.com/store/apps/details?id=com.google.android.talk" target="_blank" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Click Here</a></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">5. iHeart Radio – Internet Radio</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">The fifth in the list is the iHeart Radio. If you are a huge radio fans, iHeart is the one app, you must have in your Android device. As the majority of the phones do not have the inbuilt radio transmitters, iHeart is here to fill that void. iHeart Radio can practically stream any radio station you want to hear.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">You can search for the stations, playing your favorite songs, or you can look for the channels playing your favorite talk radio programs. Not only this, you also have an access to thousands of radio stations around the world, recommendations as per your interests an alarms to set that will wake you with your preferred radio station. Everything you find here is available free of cost completely.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you want to download the app,<span class="Apple-converted-space">&nbsp;</span><a href="https://play.google.com/store/apps/details?id=com.clearchannel.iheartradio.controller" target="_blank" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Click Here</a></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">6. Microsoft office Mobile</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Over the past few years, Microsoft has made some really big moves on Android. Among them is launching the Android version of the Microsoft Office and that is completely free of cost. However, to make the full use of Android’s version of Microsoft Office, you need to download the OneDrive app, as everything will be saved in this app. The interface of the Microsoft Office for the Android is almost similar to the one you’ve been using on your PC. Also, you get the free storage space in OneDrive to save your stuff. Moreover, you can sync your OneDrive account with the PC and can have access to all the stuffs you have saved in OneDrive.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you want to download the app,<span class="Apple-converted-space">&nbsp;</span><a href="https://play.google.com/store/apps/details?id=com.microsoft.office.officehub" target="_blank" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Click Here</a></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">7. Google Drive</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">Talking about the functionality, Google Drive is similar to Dropbox. However, the free available storage in Google Drive is way more than that is available in the Dropbox. In Google Drive, you get around 15GB of storage and if you want more, you can buy after spending a few bucks. This app is worth having because you can have some added features of office like applications like, Google Sheets etc. Moreover, you can work with other people in real time by sharing the sheets.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you want to download the app,<span class="Apple-converted-space">&nbsp;</span><a href="https://play.google.com/store/apps/details?id=com.google.android.apps.docs" target="_blank" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Click Here</a></p><h3 style="padding: 10px 0px; margin: 0px 0px 0px -5px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: taileb; vertical-align: baseline; color: rgb(96, 96, 96); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;"><strong style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(0, 0, 0);">8. Kindle</strong></h3><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you are an avid reader and loves reading books on your device, you cannot have a better app than the Kindle. As Kindle is connected to Amazon, you can expect a huge collection of books there. In its free version, you can have a superb collection of classics, meaning it’s time to get back to classics. Moreover, if you want your kids to read books, there are plenty of them. So just choose some children’s books and keep your kids busy.</p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">If you want to download the app,<span class="Apple-converted-space">&nbsp;</span><a href="https://play.google.com/store/apps/details?id=com.amazon.kindle" target="_blank" style="padding: 0px; margin: 0px; box-sizing: border-box; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Click Here</a></p><p style="padding: 0px 0px 10px; margin: 0px; box-sizing: border-box; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: 15px; line-height: 26px; font-family: Roboto, sans-serif; vertical-align: baseline; letter-spacing: 1px; color: rgb(0, 0, 0); orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-align: justify;">So, these are some really useful free Android apps that your phone must have. For your convenience, we have given the links, so if you want to download the apps into your Android device, just click on the links and you will be redirected to the app download page.</p>', '/image/uploads_news_newsImage-418658-1484684819.jpg', 1, '2017-01-17 14:56:59', '2017-01-17 14:58:50'),
(20, '5 Best Paid Android Apps', 'Talking about the Android apps, the first thing comes to our mind is that they are available free of cost and contain a lot of ads. However, there are a few great apps out there on the Google Play Store; apps those are worth paying every penny for, so that you can have best android app experience. Therefore, here we have presented 5 best paid android apps.', '<div class="new_description ">Talking about the Android apps, the first thing comes to our mind is that they are available free of cost and contain a lot of ads. However, there are a few great apps out there on the Google Play Store; apps those are worth paying every penny for, so that you can have best android app experience. Therefore, here we have presented 5 best paid android apps.<p style="text-align: justify;">Especially for the Indians, where people look the ways to get almost everything free, Google has made it convenient and easier for them to buy apps with the help of Google Play gift cards. However, until before sometime, these were only available on offline retail stores, but now you can find them on various online stores also.</p><p style="text-align: justify;">No matter how much the apps are good, the majority of android users avoid buying the apps from Play Store. The primary reason for it is that the apps are not as good as they are in the iOS. So we have given you a list of the best android paid apps, have a look in the below mentioned list.</p><h3><strong>1. Shuttle+</strong></h3><p style="text-align: justify;">The fist in the list is the Shuttle+. If you are in search of good quality music, Shuttle+ is definitely for you. Equipped with some of the best material designs and merged with some superb features, Shuttle+ offers you an awesome musical experience for the Android users.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/shuttle.png"><img class="aligncenter size-full wp-image-3082" src="http://mobda.com/wp-content/uploads/2015/11/shuttle.png" alt="shuttle" width="600" height="400"></a></p><p style="text-align: justify;">Going for the paid version of the app adds extra value in the app. It not only allows you to explore the app but also you get the opportunity to edit id3 tags; cast your music to the devices that are enabled with Chromecast and many more.</p><h4 style="text-align: justify;"></h4><h4 style="text-align: justify;"><strong>Price: </strong>Rs. 20.00</h4><p>&nbsp;</p><p style="text-align: justify;">If you want to <strong>buy &amp; download</strong> the app, <a href="https://play.google.com/store/apps/details?id=com.simplecity.amp_pro">Click Here</a></p><h3><strong>2. Battery Widget Reborn</strong></h3><p style="text-align: justify;">You may find the remaining battery percentage in almost all the Android devices. However, there will hardly be any Android phone, which will give you a detailed analysis of your battery usage along with the help of graphs and stats. Therefore, to achieve this, Batter Widget Reborn, comes in the picture. Once downloaded, the app will be in your notification panel, and if you want to expand it and check the detailed graphs and stats of the battery usage, just tap on it.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/battery.png"><img class="aligncenter size-full wp-image-3083" src="http://mobda.com/wp-content/uploads/2015/11/battery.png" alt="battery" width="600" height="400"></a></p><p style="text-align: justify;">Not only it shows the graphs and stats, but also holds the history of your batter performance. If you do not directly want to pay for the app, you can have a free trial of the same.</p><h4 style="text-align: justify;"></h4><h4 style="text-align: justify;"><strong>Price: </strong>Rs. 20.00</h4><p>&nbsp;</p><p style="text-align: justify;">If you want to <strong>buy &amp; download</strong> the app, <a href="https://play.google.com/store/apps/details?id=net.hubalek.android.apps.reborn.pro">Click Here</a></p><h3><strong>3. Weather Timeline</strong></h3><p style="text-align: justify;">Searching for the most elegant app on Google Play Store? Weather Timeline from Sam Ruston is your answer. The beauty bar of the app is so high that all the other apps present on Google Play Store will be pale in front of Weather Timeline.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/weather.png"><img class="aligncenter size-full wp-image-3084" src="http://mobda.com/wp-content/uploads/2015/11/weather.png" alt="weather" width="600" height="400"></a></p><p style="text-align: justify;">By now, you must definitely have figured out that Weather Timeline is an awesome weather app equipped with some of the coolest widget options and weather sources. You also get an option to twist the app as per your likings with many sets of themes and icons as well.</p><h4 style="text-align: justify;"></h4><h4 style="text-align: justify;"><strong>Price: </strong>Rs. 57.99</h4><p>&nbsp;</p><p style="text-align: justify;">If you want to <strong>buy &amp; download</strong> the app, <a href="https://play.google.com/store/apps/details?id=com.samruston.weather">Click Here</a></p><h3><strong>4. Solid Explorer Pro</strong></h3><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/solid.png"><img class="aligncenter size-full wp-image-3085" src="http://mobda.com/wp-content/uploads/2015/11/solid.png" alt="solid" width="600" height="400"></a></p><p style="text-align: justify;">Whether you are a student or a professional, file manager is the one thing you need in your Android phone. Therefore, to make your file managing process smooth and hassle free, Solid Explorer Pro is for you. Being one of the best-designed apps, Solid Explorer Pro supports various cloud services, which include USB OTG, FTP, and many more.</p><h4 style="text-align: justify;"></h4><h4 style="text-align: justify;"><strong>Price: </strong>Rs. 112.59</h4><p>&nbsp;</p><p style="text-align: justify;">If you want to <strong>buy &amp; download</strong> the app, <a href="https://play.google.com/store/apps/details?id=pl.solidexplorer.unlocker">Click Here</a></p><p style="text-align: justify;">If you want to download the <strong>free version</strong>, please <a href="https://play.google.com/store/apps/details?id=pl.solidexplorer.unlocker">Click Here</a></p><p style="text-align: justify;"><strong>&nbsp;</strong></p><h3><strong>5. Nova Launcher Prime</strong></h3><p style="text-align: justify;">From the past few years, the demand for launchers has burgeoned among the Android users to get rid of stock Android look from their OEM devices, and today the launcher are more than they used to be.</p><p style="text-align: center;"><a href="http://mobda.com/wp-content/uploads/2015/11/nova.png"><img class="aligncenter size-full wp-image-3086" src="http://mobda.com/wp-content/uploads/2015/11/nova.png" alt="nova" width="600" height="400"></a></p><p style="text-align: justify;">Talking about the Nova Launcher Prime, it allows you to perform the deep customization, gives you more gesture actions than any other platform available in the Google Play Store. Though you can enjoy the free version also of Nova Launcher, but to experience all the cool features, we recommend you to buy the full version of the same.</p><p style="text-align: justify;">With the help of Nova Launcher Prime you can swipe down anything on your home-screen, for example, bringing down the notifications, pinching out to launch Hearthstone and many more.</p><h4 style="text-align: justify;"></h4><h4 style="text-align: justify;"><strong>Price: </strong>Rs. 150.00</h4><p>&nbsp;</p><p style="text-align: justify;">If you want to <strong>buy &amp; download </strong>the app, <a href="https://play.google.com/store/apps/details?id=com.teslacoilsw.launcher.prime">Click Here</a></p><p style="text-align: justify;">If you want to download the <strong>free version, </strong><a href="https://play.google.com/store/apps/details?id=com.teslacoilsw.launcher.prime">Click Here</a></p><p style="text-align: justify;">So, these were some of the best android apps for which you will have to loosen your pockets, if you want to experience their full versions. However, we can bet you that spending money on these apps will be worth every penny. Hence, go ahead and experience some of the best apps the Google Play Store has.</p><!-- WhatsApp Share Button for WordPress: http://peadig.com/wordpress-plugins/whatsapp-share-button/ --><p></p>                                                          	</div>', '/image/uploads_news_newsImage-944711-1484684897.jpg', 1, '2017-01-17 14:58:18', '2017-01-17 14:58:49');
