(1081, 1081, NULL, NULL, NULL, 0, 0, 'Talk to your family, chat with your friends, shop online, play games, do anything you love. With the Elite 2 Plus smartphone from Swipe, there’s never a dull moment. Its powerful processor and long-lasting battery help it keep up with your active lifestyle.', NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL),
(1082, 1082, NULL, NULL, NULL, 0, 0, 'Featuring the Next Generation LED Notification System called Smart Glow, the new and enhanced Samsung Galaxy J2 8GB is a 4G enabled smartphone. Supporting Dual SIM, this phone comes with loads of innovating and advanced features that bring the world of infotainment at your fingertips.', NULL, '[{"quantity":"2","value":"200","type":"1"}]', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL),
(1083, 1083, NULL, NULL, NULL, 0, 0, 'Micromax Canvas Spark 3 8GB Smartphone is an ultimate combination of performance and power. This light weighted smartphone offers an elegant metallic finish that makes it perfect to flaunt and use. It is equipped with a highly efficient processor that brings to you swift multitasking with minimal lags. The smartphone comprises of a variety of sensors like the gravity, light and proximity sensors that offer advanced sensing support. The product offers 1 year brand warranty to offer a hassle-free service support.', NULL, '[{"quantity":"3","value":"300","type":"1"}]', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL),
(1084, 1084, NULL, NULL, NULL, 0, 0, 'Samsung Galaxy J7 Prime 16GB', NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL),
(1085, 1085, NULL, NULL, NULL, 0, 0, 'Experience power in your hands with its invincible features, style and comfort! Needless to say, the iPhone from the house of Apple has always been treated as a style statement and an icon of elegance. Its beauty lies not just on the outer body but also inside the handy smartphone. Accompanied by bright Retina HD display and vivid colour panel, the iPhone 7 is all set to add life to your pictures and movies. It is no doubt the best that Apple has ever discovered!', NULL, '[{"quantity":"3","value":"2000","type":"1"}]', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL),
(1086, 1086, NULL, NULL, NULL, 0, 0, 'Lenovo is one of the newer companies in the smartphone market and they have some sturdy and strong models just like their computer devices. The Lenovo K3 Note 16 GB is one of the best in the business and a great phone for anyone who is looking for a nice Android device. The phone also comes with many features such as a 13 MP primary camera along with a 1.7 GHz octa core processor that is great for any mobile phone.', NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL),
(1087, 1087, NULL, NULL, NULL, 0, 0, 'Smartphone with premium metallic body offering an elegant sheen with hybrid Dual SIM support. This is light weighted (164g) and offers a sleek (8.65 mm thickness) full metallic body that works on 4G LTE network to provides super-fast processing speed. You can enjoy smart navigation through GPS, AGPS, GLONASS and BeiDou navigation tools. The smartphone brings to you a variety of sensors such as ambient light, proximity, E-compass, accelerometer, infrared, gyroscope and fingerprint sensors. It offers 1 speaker with 2 mics and can easily provide active noise cancellation in order transmit better quality signals at the receivers end. The product offers 1 Year manufacturer’s warranty.', NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL),
(1088, 1088, NULL, NULL, NULL, 0, 0, 'Few smartphones look inherently stunning even from a distance and the Samsung Galaxy A5 16 GB does that effortlessly. This high-end smartphone from Samsung is a powerhouse equipped with a Quad-Core processor and comes with Dual cameras, Gorilla glass technology, and 4G connectivity. The smartphone’s shiny metal shell makes it more alluring. This phone is available on Snapdeal at the best rate.', NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL),
(1089, 1089, NULL, NULL, NULL, 0, 0, 'The Micromax Canvas 5 E481 16GB is a combination of style and technology. This new mobile comes with some impressive features including a 13.2 cm IPS capacitive touch screen and has a resolution of  1920 x 1080 pixels. The display is well protected by corning gorilla glass 3. With Android Lollipop v5.1, the phone is powered by a 1.3 GHz Mediatek MT6753 Octa-core processor. The phone comes with 16GB internal memory and can be expanded up to 32GB. A dual SIM facility makes is easier for the users to manage calls and messages. The Micromax Canvas 5 E481 16GB is now available on the Snapdeal mobile store.', NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL),
(1090, 1090, NULL, NULL, NULL, 0, 0, 'Want a budget Android Smartphone that never compromises on performance? Rely on the heavily impressive MOTO G PLAY , powered by a 1.2 GHz Quad-Core CPU.', NULL, '[{"quantity":"2","value":"250","type":"1"}]', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL),
(1091, 1091, NULL, NULL, NULL, 0, 0, 'The Swipe Virtue 16GB comes with an impressive 12.7 cm HD IPS display. Now experience high-quality videos, images and gaming using this new mobile. The phone is powered by 1.3 GHz quad core processor and with 2GB RAM. This feature allows the users to have a faster and easier access to applications. With 16GB internal memory, the phone makes it easier to store a large number of music files, movies and photos. The phone is equipped with an 8MP primary camera and 5MP secondary camera. Now also get an amazing battery life with a 2500 mAh battery. The Swipe Virtue 16GB with striking metal frame is now available on Snapdeal.', NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL),
(1092, 1092, NULL, NULL, NULL, 0, 0, 'The Lenovo K6 Note 3GB RAM mobile features a 5.5 Inch display and runs on Android v6.0 (Marshmallow) operating system. The device is powered by a Octa core, 1.4 GHz, Cortex A53 processor paired with 3 GB of RAM. As far as the battery is concerned it has 4000 mAh.', NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL);
